amp;quot;&amp;gt;\r\n					Безопасность&amp;lt;/h6&amp;gt;\r\n				&amp;lt;span&amp;gt;Круглосуточная охрана&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n		&amp;lt;/ul&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n	&amp;lt;div class=&amp;quot;description-block&amp;quot;&amp;gt;\r\n		&amp;lt;p class=&amp;quot;title&amp;quot;&amp;gt;\r\n			Цена:&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;price-block&amp;quot;&amp;gt;\r\n			&amp;lt;p class=&amp;quot;total-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;3 495 780 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p class=&amp;quot;meter-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;95 780 RUB&amp;lt;/span&amp;gt;&amp;amp;nbsp;за м²&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			ул. Ленина, 21&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Статус дома &amp;lt;span&amp;gt;Квартира (жилое)&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;info-block info-block-border&amp;quot;&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				студии &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				1-к. от 44 м² &amp;lt;span&amp;gt;3 495 780 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				2-к. от 56,2 м² &amp;lt;span&amp;gt;3 495 780 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				3-к. от 96,3 м² &amp;lt;span&amp;gt;3 495 780 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				4-к. от 195,6 м² &amp;lt;span&amp;gt;3 495 780 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				своб. пл. от 102,3 м² &amp;lt;span&amp;gt;3 495 780 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n		&amp;lt;p class=&amp;quot;developer&amp;quot;&amp;gt;\r\n			Застройщик «Монолит (Крым)»&amp;lt;span&amp;gt;Основан в 2005 году (сдача - март 2019) &amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;info-block&amp;quot;&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Класс ЖК &amp;lt;span&amp;gt;эконом-класс&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Тип дома &amp;lt;span&amp;gt;монолитный&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Домов &amp;lt;span&amp;gt;1 корпус&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Год сдачи &amp;lt;span&amp;gt;2017&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n	Описание&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;full-description&amp;quot;&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Расположение, транспортная доступность&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Жилой комплекс Status House («Статус Хаус») высотой 14 этажей возводится на улице Горького в курортном городе Алушта. В шаговой доступности от новостройки располагается морская набережная, которая в летнее время выступает центром культурной жизни Алушты. Вместе с тем, от городского шума «Статус Хаус» защищен тихим ухоженным парком, состоящим из сосен, кедров и кипарисов. Благодаря удачному расположению дома, из его окон можно любоваться прекрасными видами на море или горные вершины. Стоит отметить, что проживание в ЖК&amp;lt;/p&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n',	'',	'',	'',	'',	0),
(60,	1,	'Однокомнатные квартиры',	'&amp;lt;p&amp;gt;\r\n	Всем, кто планирует купить однокомнатную квартиру в Алуште, агентство «Альянс Сити», предлагает воспользоваться профессиональной поддержкой. Казалось бы, какие могут быть сложности при оформлении сделки по покупке жилья напрямую от застройщика или владельца объекты? Особенно в тех случаях, когда законодательные документы в наличии, состояние квартиры хорошее, и район удобный во всех отношениях.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Почему же опытные участника рынка недвижимости предпочитают купить однокомнатную или двухкомнатную квартиру Алуште&amp;amp;nbsp;при поддержке юристов? На сайтах множество объявлений о прямых продажах, с гарантией надежности сделки! Однако стремление приобрести недвижимость при содействии агентств растет от месяца к месяцу. Причины тому насколько:&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	специалисты АН хорошо знают репутацию застройщиков;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Агентства заключают договор на оказание услуг с указанием степени ответственности и гарантиями;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Риелторы оказывают действенную помощь при выборе квартиры с заданными критериями;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Кроме того, юридическая поддержка включает проверку истории квартиры, установление соответствия документов законодательным требованиям.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Покупатели редко обращают внимание при осмотре квартиры (дома) на такие важные моменты как состояние коммуникаций, акустический режим, социальный контингент жильцов. Все «подводные камни» обнаруживаются уже после заселения, когда невозможно отменить сделку.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Помощь в покупке квартиры в Алуште н первичном или вторичном рынке, с выбором оптимального варианта среди однокомнатных, двухкомнатных или многокомнатных квартир ─ главная задача АН «Альянс Сити». Все пожелания покупателей относительно района, стоимости, этажности, близости объектов инфраструктуры, скорости проведения сделки мы учитываем и соблюдаем, насколько это возможно в конкретной ситуации.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Позвоните, чтобы оформить заявку на консультацию у риелтора или оформление договора абонентского обсаживание. Специалист выйдет на связь в течение нескольких минут.&amp;lt;/p&amp;gt;\r\n',	'',	'Выгодно купить однокомнатную квартиру в Алуште поможет АН Альянс Сити. На сайте разнообразные варианты, как вторичного жилья, так и в новостройках. ',	'',	'Купить однокомнатную квартиру в Алуште от АН',	'Однокомнатные квартиры в Алуште – выбор оптимального варианта',	1),
(88,	1,	'ЖК «Титан»',	'',	'&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n	ЖК «Титан»&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;photo-short-description&amp;quot;&amp;gt;\r\n	&amp;lt;div class=&amp;quot;photo-block&amp;quot;&amp;gt;\r\n		&amp;lt;div class=&amp;quot;photo&amp;quot; style=&amp;quot;background-image: url(/image/data/catalog/Novostroyki/titan-alushta-jk-363946502-6.jpg);&amp;quot;&amp;gt;\r\n			&amp;lt;span class=&amp;quot;label&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;catalog/view/theme/yaltahome/images/label-notdone.png&amp;quot; /&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\r\n		&amp;lt;ul class=&amp;quot;description-object&amp;quot;&amp;gt;\r\n			&amp;lt;li&amp;gt;\r\n				&amp;lt;h6 class=&amp;quot;title&amp;quot;&amp;gt;\r\n					Инфраструктура&amp;lt;/h6&amp;gt;\r\n				&amp;lt;span&amp;gt;Детские площадки&amp;lt;/span&amp;gt; &amp;lt;span&amp;gt;Места для отдыха&amp;lt;/span&amp;gt; &amp;lt;span&amp;gt;Коммерческие объекты&amp;lt;/span&amp;gt; &amp;lt;span&amp;gt;Офисы&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n			&amp;lt;li&amp;gt;\r\n				&amp;lt;h6 class=&amp;quot;title&amp;quot;&amp;gt;\r\n					Парковка&amp;lt;/h6&amp;gt;\r\n				&amp;lt;span&amp;gt;Подземная&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n		&amp;lt;/ul&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n	&amp;lt;div class=&amp;quot;description-block&amp;quot;&amp;gt;\r\n		&amp;lt;p class=&amp;quot;title&amp;quot;&amp;gt;\r\n			Цена:&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;price-block&amp;quot;&amp;gt;\r\n			&amp;lt;p class=&amp;quot;total-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;8 355 000 RUB&amp;lt;/span&amp;gt;&amp;lt;br /&amp;gt;\r\n				до &amp;lt;span&amp;gt;32 011 000 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p class=&amp;quot;meter-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;100 000 RUB&amp;lt;/span&amp;gt;&amp;lt;br /&amp;gt;\r\n				до &amp;lt;span&amp;gt;140 000 RUB RUB&amp;lt;/span&amp;gt;&amp;amp;nbsp;за м²&amp;lt;/p&am