&amp;gt;2018&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n	Описание&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;full-description&amp;quot;&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Новый премиальный жилой дом «ТИТАН» - это сочетание современной архитектуры с расположением в самом центре города Алушта.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Прилегание к городскому парку, видимость и слышимость моря дарят возможность наслаждаться природой, находясь всего в 200 м от центральной площади города.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		«ТИТАН» представляет собой одно из 3-х строящихся зданий группой компаний «ЭЛЛАДА» высотой в 9 этажей, фасад которого выходит на ведущую к морю улицу Ленина.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Это многоквартирный жилой дом, окна квартир в котором выходят на парк, море, горы и центр города.&amp;lt;/p&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	'',	0),
