ot;&amp;gt;\r\n				Застройщик «Монолит (Крым)»&amp;lt;span&amp;gt;Основан в 2005 году (сдача - 2017) &amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;div class=&amp;quot;info-block&amp;quot;&amp;gt;\r\n				&amp;lt;p&amp;gt;\r\n					Класс ЖК &amp;lt;span&amp;gt;эконом-класс&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n				&amp;lt;p&amp;gt;\r\n					Тип дома &amp;lt;span&amp;gt;монолитный&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n				&amp;lt;p&amp;gt;\r\n					Домов &amp;lt;span&amp;gt;1 корпус&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n				&amp;lt;p&amp;gt;\r\n					Год сдачи &amp;lt;span&amp;gt;2018&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;/div&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n	&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n		Описание&amp;lt;/p&amp;gt;\r\n	&amp;lt;div class=&amp;quot;full-description&amp;quot;&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Расположение, транспортная доступность&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Жилой комплекс Status House («Статус Хаус») высотой 14 этажей возводится на улице Горького в курортном городе Алушта. В шаговой доступности от новостройки располагается морская набережная, которая в летнее время выступает центром культурной жизни Алушты. Вместе с тем, от городского шума «Статус Хаус» защищен тихим ухоженным парком, состоящим из сосен, кедров и кипарисов. Благодаря удачному расположению дома, из его окон можно любоваться прекрасными видами на море или горные вершины. Стоит отметить, что проживание в ЖК «Статус Хаус» обеспечивает максимально комфортные условия для отдыха: вблизи от дома находятся не только морские пляжи, но и развлекательные объекты, включая Алуштинский аквариум, дельфинарий. Непосредственно рядом с новостройкой, на улице Горького, расположена ближайшая автобусная остановка. Для автомобилистов есть удобная подъездная дорога, закрытая шлагбаумом.&amp;lt;/p&amp;gt;\r\n	&amp;lt;/div&amp;gt;',	'',	'',	'',	'',	0),
