тановая, 1&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Статус дома &amp;lt;span&amp;gt;Квартира (жилое)&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;info-block info-block-border&amp;quot;&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				студии &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				1-к. от 33,8 м² &amp;lt;span&amp;gt;3,14–8,38 млн. RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				2-к. от 54,8 м² &amp;lt;span&amp;gt;6,72–17,10 млн. RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				3-к. от 76 м² &amp;lt;span&amp;gt;6,84–16,53 млн. RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				4-к. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				5-к. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				своб. пл. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n		&amp;lt;div class=&amp;quot;info-block&amp;quot;&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Класс ЖК &amp;lt;span&amp;gt;элитный&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Домов &amp;lt;span&amp;gt;1 корпус&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n	Описание&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;full-description&amp;quot;&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Жилой комплекс «Платан» – новостройка в самом сердце Крыма, которую можно отнести к элитной недвижимости. «Платан» расположен в одном из самых известных и популярных морских курортов – Алуште.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Жилой комплекс находится всего в 7 минутах пешей прогулки от морского побережья. А из окон «Платана» открывается замечательный вид на гору Демерджи и крымские виноградники. Самое подходящее слово, которое можно подобрать для описания этого жилого комплекса – уютный, ведь, в отличие от большинства новостроек, которые сейчас возводятся в Крыму и других новостроек Алушты, в жилом комплексе «Платан» всего 6 жилых этажей, последний из которых – мансардный.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Жилой комплекс «Платан» – это элитные однокомнатные, двухкомнатные и трехкомнатные квартиры с удобной планировкой, высокими потолками и большими балконами.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		В новостройке есть подземный паркинг для жильцов и наземный для их гостей.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Внутренний двор жилого комплекса «Платан», образованный П-образным расположением жилых секций, украшают зеленые газоны и пальмовые деревья. Во дворе, конечно же, расположена современная детская площадка.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		В жилом комплексе «Платан» также есть собственное домоуправление, которое обеспечивает безопасность и поддерживает чистоту в доме, и придет вам на помощь в случае озникновения проблем, связанных с вашей квартирой в этой новостройке.&amp;lt;/p&amp;gt;\r\n&amp;lt;/div&amp;gt;',	'',	'',	'',	'',	0),
