r\n					Класс ЖК &amp;lt;span&amp;gt;Элитный&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n				&amp;lt;p&amp;gt;\r\n					Тип дома &amp;lt;span&amp;gt;Монолит-каркас&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n				&amp;lt;p&amp;gt;\r\n					Домов &amp;lt;span&amp;gt;1 корпус&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n				&amp;lt;p&amp;gt;\r\n					Год сдачи &amp;lt;span&amp;gt;2007&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;/div&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n	&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n		Описание&amp;lt;/p&amp;gt;\r\n	&amp;lt;div class=&amp;quot;full-description&amp;quot;&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Жилой комплекс &amp;quot;Дача доктора Штейнгольца&amp;quot; - это современный многоквартирный 7-этажный жилой дом клубного типа со всеми видами коммуникаций.&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			В цокольном этаже здания обустроен подземный паркинг на 56 мест.&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Территория жилого комплекса благоустроена на высоком уровне. Так же на ней использовано ландшафтное озеленение.&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Квартиры в ЖК &amp;quot;Дача доктора Штейнгольца&amp;quot; относятся к категории недвижимости элитного класса и сдаются в продажу с косметическим ремонтом (в них установлены окна, двери, приборы учета). Всего в доме насчитывается 56 квартир с типовыми и индивидуальными вариантами планировок.&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Стоимость квартир в ЖК &amp;quot;Дача доктора Штейнгольца&amp;quot; зависит может варьировать в зависимости от нескольких аспектов.&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Застройщик ЖК &amp;quot;Дача доктора Штейнгольца&amp;quot; сдал комплекс в эксплуатацию.&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Месторасположение ЖК &amp;quot;Дача доктора Штейнгольца&amp;quot;: город Алушта, ул. Ленина, 10.&amp;lt;/p&amp;gt;\r\n	&amp;lt;/div&amp;gt;',	'',	'',	'',	'',	0),
(91,	1,	'ЖК «Бриз»',	'',	'&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n	ЖК «Бриз»&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;photo-short-description&amp;quot;&amp;gt;\r\n	&amp;lt;div class=&amp;quot;photo-block&amp;quot;&amp;gt;\r\n		&amp;lt;div class=&amp;quot;photo&amp;quot; style=&amp;quot;background-image: url(/image/data/catalog/Novostroyki/83703.jpg);&amp;quot;&amp;gt;\r\n			&amp;lt;span class=&amp;quot;label&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;catalog/view/theme/yaltahome/images/label-done.png&amp;quot; /&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\r\n		&amp;lt;ul class=&amp;quot;description-object&amp;quot;&amp;gt;\r\n			&amp;lt;li&amp;gt;\r\n				&amp;lt;h6 class=&amp;quot;title&amp;quot;&amp;gt;\r\n					Парковка&amp;lt;/h6&amp;gt;\r\n				&amp;lt;span&amp;gt;Подземная&amp;lt;/span&amp;gt;&amp;lt;/li&amp;gt;\r\n		&amp;lt;/ul&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n	&amp;lt;div class=&amp;quot;description-block&amp;quot;&amp;gt;\r\n		&amp;lt;p class=&amp;quot;title&amp;quot;&amp;gt;\r\n			Цена:&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;price-block&amp;quot;&amp;gt;\r\n			&amp;lt;p class=&amp;quot;total-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;4 150 000 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p class=&amp;quot;meter-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;90 000 RUB&amp;lt;/span&amp;gt;&amp;lt;br /&amp;gt;\r\n				&amp;amp;nbsp;за м²&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n&amp;lt;div class=&amp;quot;price-block&amp;quot;&amp;gt;\r\n			&amp;lt;p class=&amp;quot;total-price&amp;quot;&amp;gt;\r\n				&amp;lt;span&amp;gt;+7(978) 7-888-111&amp;lt;/span&amp;gt; Звоните!&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			ул. Октябрьская&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Статус дома &amp;lt;span&amp;gt;Квартира (жилое)&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;info-block info-block-border&amp;quot;&amp;gt;\r\n			&amp;lt;p&