(97,	1,	'Апарт-отель Фиеста',	'',	'&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n	Апарт-отель Фиеста&amp;lt;/p&amp;gt;\r\n&amp;lt;div class=&amp;quot;photo-short-description&amp;quot;&amp;gt;\r\n	&amp;lt;div class=&amp;quot;photo-block&amp;quot;&amp;gt;\r\n		&amp;lt;div class=&amp;quot;photo&amp;quot; style=&amp;quot;background-image: url(/image/data/catalog/Novostroyki/fiesta.JPG)&amp;quot;&amp;gt;\r\n			&amp;lt;span class=&amp;quot;label&amp;quot;&amp;gt;&amp;lt;img src=&amp;quot;catalog/view/theme/yaltahome/images/label-done.png&amp;quot; /&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\r\n	&amp;lt;/div&amp;gt;\r\n	&amp;lt;div class=&amp;quot;description-block&amp;quot;&amp;gt;\r\n		&amp;lt;p class=&amp;quot;title&amp;quot;&amp;gt;\r\n			Цена:&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;price-block&amp;quot;&amp;gt;\r\n			&amp;lt;p class=&amp;quot;total-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;2 460 000 RUB&amp;lt;/span&amp;gt;&amp;lt;br /&amp;gt;\r\n				до &amp;lt;span&amp;gt;2 895 000 RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p class=&amp;quot;meter-price&amp;quot;&amp;gt;\r\n				от &amp;lt;span&amp;gt;75 000 RUB&amp;lt;/span&amp;gt;&amp;lt;br /&amp;gt;\r\n				до &amp;lt;span&amp;gt;78 000 RUB&amp;lt;/span&amp;gt;&amp;amp;nbsp;за м²&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n		&amp;lt;div class=&amp;quot;price-block&amp;quot;&amp;gt;\r\n			&amp;lt;p class=&amp;quot;total-price&amp;quot;&amp;gt;\r\n				&amp;lt;span&amp;gt;+7(978) 7-888-111&amp;lt;/span&amp;gt; Звоните!&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			ул. Багликова, 21&amp;lt;/p&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Статус дома &amp;lt;span&amp;gt;Квартира (жилое)&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;info-block info-block-border&amp;quot;&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				студии &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				1-к. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				2-к. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				3-к. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				4-к. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				5-к. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				своб. пл. &amp;lt;span&amp;gt;нет данных&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				апартаменты: от 32,8 &amp;lt;span&amp;gt;2,46–2,89 млн. RUB&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt;\r\n		&amp;lt;!-- &amp;lt;p class=&amp;quot;developer&amp;quot;&amp;gt;\r\n			Застройщик «Монолит (Крым)»&amp;lt;span&amp;gt;Основан в 2005 году (сдача - 2017) &amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;div class=&amp;quot;info-block&amp;quot;&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Класс ЖК &amp;lt;span&amp;gt;эконом-класс&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Тип дома &amp;lt;span&amp;gt;монолитный&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Домов &amp;lt;span&amp;gt;1 корпус&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n			&amp;lt;p&amp;gt;\r\n				Год сдачи &amp;lt;span&amp;gt;2018&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n		&amp;lt;/div&amp;gt; --&amp;gt;&amp;lt;/div&amp;gt;\r\n	&amp;lt;p class=&amp;quot;h2-title&amp;quot;&amp;gt;\r\n		Описание&amp;lt;/p&amp;gt;\r\n	 &amp;lt;div class=&amp;quot;full-description&amp;quot;&amp;gt;\r\n		&amp;lt;p&amp;gt;\r\n			Апарт комплекс «Фиеста» расположен в самом  центре города Алушта по улице Багликова, в 700 метрах от моря.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Девятиэтажное  здание с  дизайном, сочетающим старину и современность, приятно удивит Вас лучшими ценами на Южном берегу Крыма за квадратный метр  на уютные просторные апартаменты с современным ремонтом и презентабельной мебелью. Из окон, которых, открывается прекрасный вид на город и приморскую часть, Крымские горы.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;В здании предусмотрено два лифта: пассажирский и служебный. Просторная зона общего пользования и сушильная комната с выходом на балкон на каждом из этажей. Комплекс имеет  автономное отопление, обеспеченное собственной газовой котельной.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Очень удобное расположение:&amp;lt;br&amp;gt;- парковка в 50 метрах;&amp;lt;br&amp;gt;- столовые и кафе в 150 метрах;&amp;lt;br&amp;gt;- к морю всего 700 метров;&amp;lt;br&amp;gt;- к автовокзалу 600 метров;&amp;lt;br&amp;gt;- центр в 300 метрах.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Покупка апартаментов станет выгодным вложением средств, как для собственного проживания, так и для сдачи апартаментов в аренду с помощью управляющей компании.&amp;lt;/p&amp;gt;\r\n	&amp;lt;/div&amp;gt;&amp;lt;/div&amp;gt;\r\n',	'',	'',	'',	'',	0);

