INSERT INTO `news_description` (`news_id`, `language_id`, `title`, `description`, `meta_desc`, `meta_key`, `seo_title`, `seo_h1`) VALUES
(8,	1,	'Стандартные планировки домов и квартир в Ялте',	'&amp;lt;p&amp;gt;\r\n	Ещё в конце 50-х годов в Ялте начали строиться многоэтажные дома. Популярность курорта и развивающаяся инфраструктура города ещё со времён СССР рождали спрос на жильё. В советское время архитектура многоэтажек не отличалась оригинальностью, дома строились в большинстве своём однотипные.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Ялта – знаменитый курорт, город тёплого моря, пьянящего воздуха вперемежку с ароматами экзотических растений и свежим морским бризом. Ещё ранней весной в Ялте начинают цвести деревья, вдыхая в атмосферу вечного праздника ароматы вечнозелёных растений. Ландшафт, пестрящий горными склонами, нисходящими к морю, таит в себе современные высотные здания и постройки прошлого века.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Что представляют из себя постройки разных времён в Ялте, какие особенности в типовых планировках квартир можно встретить в многоэтажных домах, что нужно знать, чтобы сделать перепланировку по своему проекту? Обо всём по порядку.&amp;lt;/p&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		&amp;quot;Грузинка&amp;quot; ( &amp;quot;Грузинка&amp;quot; в Ялте, горячие квартиры!)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Проект этих домов был разработан в Грузии, в 70-х годах для регионов с повышенной сейсмической опасностью. Поэтому бетонные стены способны выдерживать толчки землетрясений силой до 9 баллов. В таких домах, что является большим преимуществом для Ялты, установлены газовые колонки для горячей воды или обычный двухконтурный котёл. Большинство &amp;quot;грузинок&amp;quot; в Ялте – кооперативные дома. Площадь квартир – от 40 м. кв в однокомнатной до 70-ти в трёхкомнатной.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780359824.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Если крепкие монолитные стены можно отнести к преимуществам &amp;quot;грузинок&amp;quot;, то холодные бетонные стены – неоспоримый недостаток. В настоящее время это не является большой проблемой – утепление &amp;quot;грузинки&amp;quot; обойдётся всего в 14-15 тысяч рублей.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Комфорт и уют пока никто не отменял, поэтому каждый владелец &amp;quot;грузинки&amp;quot; может сделать собственную перепланировку квартиры. Увеличить площадь кухни, к примеру, можно за счёт лоджии, при этом кухня сможет выполнять функции столовой или зала.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		В стандартной планировке предусмотрена кладовка, избавившись от которой вы получите большую спальню. Санузел в классическом варианте раздельный. Чтобы &amp;quot;осовременить&amp;quot; жилище и получить просторную ванную комнату, достаточно убрать перегородку.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780405440.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Позже грузинский проект усовершенствовали, после чего каждая комната получила по отдельному балкону или лоджии. Это даёт дополнительные возможности для собственной перепланировки любой квартиры.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		&amp;quot;Хрущёвка&amp;quot; постройки 50-х годов (Только у нас! Только для вас! Уютные хрущёвки в Ялте)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		&amp;quot;Хрущёвки&amp;quot; – наиболее распространённый вид застроек советского времени. Существуют &amp;quot;хрущёвки&amp;quot; типа &amp;quot;А&amp;quot; и &amp;quot;В&amp;quot;. В квартирах первого типа меньше жилая площадь, соответственно, отдельные комнаты уступают по размерам квартирам типа &amp;quot;В&amp;quot;. Типовая квартира в &amp;quot;хрущёвке&amp;quot; имеет размеры от 30 м. кв. в однокомнатной до 60-ти в трёхкомнатной.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780451331.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Крымские &amp;quot;хрущёвки&amp;quot; были построены в основном из высокопрочных альминских блоков, поэтому этот тип зданий достойно показал себя с точки зрения характеристик эксплуатации вплоть до наших дней.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780502546.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		&amp;quot;Хрущёвки&amp;quot; - это дома-долгожители, поэтому вокруг них сформировалась своя неповторимая обстановка – уютные дворики, детские площадки, много зелени, цветов перед домами. В ялтинских &amp;quot;хрущёвках&amp;quot; на Московской и Киевской, что в центре города, почти все первые этажи выкуплены предпринимателями под магазины, бары и офисные помещения.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780608927.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Толстые стены из инкерманского камня обладают достаточной теплоизоляцией, поэтому в отличие от &amp;quot;грузинок&amp;quot;, на утеплении можно сэкономить. Главный недостаток квартир такого типа – очень маленькие жилые комнаты, кухни и санузлы.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		Архитектура многоэтажных домов серии &amp;quot;ЮБК&amp;quot; (Квартиры в домах серии ЮБК – не роскошь. Подарите себе Ялту!)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Этот тип домов используется застройщиками до нынешнего времени. Многоэтажные дома серии &amp;quot;ЮБК&amp;quot; - самый распространённый тип девятиэтажных домов в Ялте. Здания возводились, начиная с 80-х годов. Для квартир в этих домах характерны большие светлые комнаты улучшенной планировки, общей площадью от 33-х кв. м. в однокомнатной квартире и до 80-ти в трёхкомнатной.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780655865.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Квартиры домов типа &amp;quot;ЮБК&amp;quot; - всегда светлые и солнечные независимо от места расположения. Такое количество естественного освещения делает комнаты ещё больше, а для любителей домашних растений помогает создать в своей квартире настоящую оранжерею.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780769240.jpg&amp;quot; /&amp;gt;&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		16-ти этажный типовой дом в Ялте (Квартиры под облаками в высотках Ялты)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Самые высокие стандартные дома в Ялте начали строить позже &amp;quot;хрущёвок&amp;quot; и &amp;quot;грузинок&amp;quot;. Квартиры в таких высотках только 3-х и 4-х комнатные. Большие балконы с хорошим обзором, улучшенная планировка с просторными комнатами делают жильё в таком доме особенно привлекательным. К тому же общая площадь 70 и 80 м. кв. в трёхкомнатной и четырёхкомнатной квартире соответственно.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780805206.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		К недостаткам здесь можно отнести относительно блеклый внешний вид подъездов и дворов. Очевидно, этажность дома стояла для архитекторов в то время на первом месте.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		&amp;quot;Малосемейки&amp;quot; в Ялте (Купите малосемейку в Ялте, дешевле и даром уже не будет)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		&amp;quot;Малосемейки&amp;quot; - самый доступный по цене вид жилья в Ялте. Квартиры в таких домах бывают двух видов – с общей площадью 33.5 и 43.4 м. кв. Дома в большинстве своём расположены в спальных районах Ялты, вдали от центра. Ещё одно преимущество квартиры в &amp;quot;малосемейке&amp;quot; - самая большая жилая комната в доме панельного типа – около 19 кв. м.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780840455.jpg&amp;quot; /&amp;gt; &amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;images/1429780959519.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Главный недостаток – плохая звукоизоляция, свойственная планировке такого типа.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		12-этажный монолитный дом в Ялте (Надёжный тыл в Ялте – квартира в монолитном доме. Купите и проверьте!)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Типовая постройка этого типа – монолитные дома, которые начали возводиться в Ялте в 80-е года. Квартиры здесь только двухкомнатные общей площадью 64 кв. м.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Монолитные несущие стены в таких домах исключают возможность подтекания по швам, а кирпичная опалубка – неоспоримый &amp;quot;плюс&amp;quot; для теплоизоляции дома. В 12-ти этажных домах установлены по 2 лифта, один из которых грузовой. Хороший обзор и дополнительная полезная площадь – заслуга балконов по всему периметру квартиры.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780937285.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Слабое место построек такого типа – подъезды, которые не всегда содержатся в нормальном состоянии. В последние годы ситуация может меняться в зависимости от отдельно взятого дома.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		Планировка квартир в домах 135-й серии (Квартира в домах 135-й серии – купите сегодня, завтра солнце может стать дороже!)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Такие дома появились в Ялте в 80-х годах. Здания строились по двум проектам – 5-ти и 9-ти этажные, с однокомнатными и двухкомнатными или с трёх и четырёхкомнатными квартирами соответственно. Площадь квартир в домах 135-й серии относительно немаленькая – от 48-ми кв. м. в однокомнатной до 80-ти – в трёхкомнатной.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780908378.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		К преимуществам этой архитектуры можно отнести большие по площади балконы, просторные комнаты «квадратного» типа, что не может не радовать практичных жильцов при расстановке мебели и создании своего неповторимого дизайна помещения.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Недостатки домов 135-й серии повторяют слабые места остальных высотных многоэтажных зданий в Ялте.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		&amp;quot;Сталинка&amp;quot; (&amp;quot;Сталинка&amp;quot; в Ялте – стань частью истории!)&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Особенный тип зданий с самой разной планировкой среди многоэтажек города – &amp;quot;сталинки&amp;quot;. По возрасту - это самые старые дома в Ялте. Наверное, тот факт, что архитекторы, которые создавали проект &amp;quot;сталинки&amp;quot;, получили образование ещё до революции, сыграл для этих построек решающую роль.&amp;lt;/p&amp;gt;\r\n	&amp;lt;img alt=&amp;quot;&amp;quot; src=&amp;quot;/catalog/view/theme/yaltahome/images/1429780880638.jpg&amp;quot; /&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Внешний вид домов говорит об основательности и долговечности постройки, внушая своими изысканными архитектурными элементами силу и уважение.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Отличная теплоизоляция толстых стен позволяет обходиться в жаркие летние месяцы без кондиционера. Потолки в &amp;quot;сталинках&amp;quot; обычно высокие, площади квартир могут быть разными, но в большинстве случаев большие.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Отдельно нужно заметить, что коммуникации в таких домах оборудованы соответственно виду здания, на совесть, и до сих пор находятся в нормальном эксплуатационном состоянии.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Владельцы квартир в &amp;quot;сталинках&amp;quot; могут сетовать только лишь на возраст здания, который, конечно, может требовать ремонта.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		Свободная планировка&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		В любом здании, независимо от года постройки и места расположения, можно воплотить в жизнь свои идеи для более комфортного проживания. Если фантазия не даёт разыграться в полную силу полёту мысли, к этому ответственному делу можно подключить опытных дизайнеров и архитекторов. Из любой, на первый взгляд, невзрачной квартиры, вы сможете сделать своё любимое место, где приятно просыпаться по утрам и куда не терпится вернуться после работы.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Наиболее подходящий вариант для выражения своего стиля – квартира со свободной планировкой, где всё готово для реализации ваших идей. Всего-то нужно грамотно рассчитать размеры будущих помещений с учётом пожеланий членов вашей семьи и стиля жизни. Свободная планировка – это возможность построить собственный дом, где стены, крыша и потолок уже есть.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Дизайн помещения может быть разным, даже отдельные комнаты могут передавать свою неповторимую атмосферу, настраивая на нужный лад. Всё, о чём вы когда-то мечтали – личный кабинет или библиотека, спортивный зал или бильярдная, - это всё реально, если вы покупаете квартиру со свободной планировкой.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n&amp;lt;section&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n		Свободная планировка&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Квартира-&amp;quot;студия&amp;quot; – то ли веянье моды, то ли желание свободнее дышать в четырёх стенах. Для квартир в курортных городах, каким является Ялта, это очень популярное решение, всё больше хозяев отказываются от тесных комнатушек в пользу просторного светлого помещения.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Многофункциональное помещение может с одинаковым успехом использоваться, как кухня или столовая, площадка для шумной вечеринки с друзьями или уютное место для романтического свидания.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Убрав надоевшие перегородки, наполнив свою квартиру светом, вы, возможно, начнёте свой новый этап в жизни, где преграды на пути к успеху будут нести лишь условный характер.&amp;lt;/p&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		Ялта – красивый гостеприимный курорт и удобное место для проживания, а какой для этого выбрать дом – решать вам.&amp;lt;/p&amp;gt;\r\n&amp;lt;/section&amp;gt;\r\n',	'',	'',	'',	''),
(22,	1,	'Украшенные пальмы и новогодние приключения',	'&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;– Как Артек готовится встретить 2018 Новый Год&amp;lt;h3&amp;gt;\r\n&amp;lt;p&amp;gt;Помощник Деда Мороза уже прибыл в Артек и  активно готовится к новогодней ночи. Главный Дед Мороз, ранее прилетавший на вертолете, уже зажег праздничную елку, вокруг которой пройдут веселые мероприятия. Две тысячи детей из 60 регионов страны встретят 2018 год в международном лагере.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Дети будут сами мастерить игрушки и украшать пальмы. Генеральный директор Артека  Алексей Каспржак сообщил, что 31 декабря в лагере пройдут новогодние квесты, а в 22 часа все участники новогодней программы соберуются на главной площадке. Будет много сюрпризов, подарков, представлений. Главный сюрприз ждет детей на набережной Артека, но пока информация держится в строжайшем секрете. В новогоднюю ночь прогремят три праздничных  салюта, а впервые день 2018 года лагерь посетить знаменитость (имя гостя  пока держится а тайне).&amp;lt;/p&amp;gt;',	'',	'',	'',	''),
(21,	1,	'Жители Алушты будут платить за воду меньше',	'&amp;lt;p&amp;gt;Жители Алушты будут платить за воду по общим нормативам, установленным в Крыму – не более 35 рублей за 1 кубометр.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Ранее, глава Крыма Сергей Аксенов поручил провести проверку тарифов в курортном городе, и доложить, насколько обоснованными являются действующие расценки. По словам вице-премьера, стоимость воды для жителей Крыма в некоторых населенных пунктах была завышена без объективных причин.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Сейчас проводится отработка вопроса о снижении стоимости кубометра до 35 рублей с ГУП РК «Вода Крыма». Резервы для этого существуют, и они должны быть использованы. Кроме того, актуальным  является вопрос о снабжении питьевой водой сельских населенных пунктов. Дорожные карты на строительство водопровода для подачи воды в Лучистое, Верхнюю и Нижнюю Кутузовку детально проработаны. Проектно-изыскательские работы и торги планируется провести в 3 квартале 2018 года, а начать строительство – уже в 4 квартале 2018 года.&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	''),
(20,	1,	'Симферополь, 19 декабря - АиФ-Крым.',	'&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;О модернизации набережных Ялты и Алушты&amp;lt;h3&amp;gt;\r\n&amp;lt;p&amp;gt;Почетный гражданин  Алушты, известный российский коммерсант, Александра Лебедев, планирует инвестировать средства в модернизацию  городской Набережной  (источник Крыминформ со ссылкой на слова вице-премьера Виталия Нахлупина).&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;В Ялте запретили ловить рыбу в районе городской набережной.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;На территории, примыкающей к ялтинской Набережной, планируется обустроить современные спортивные и детские площадки, открыть дополнительные точки быстрого питания.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Вице-премьер Нахлупин рассказал о двух встречах, проведенных  с владельцем пансионата «Море» Лебедвым, с целью согласования инвестиционного плана. Бизнесмен подтвердил свои намерения о преобразовании прибрежной линии и заявил, что выделит сумму в пределах 60-100 миллионов рублей в 2018 году.&amp;lt;/p&amp;gt;\r\n\r\n&amp;lt;p&amp;gt;Администрация Алушты  предупреждает собственников незаконно построенной недвижимости на Набережной  о том, что до конца текущего года все объекты, построенные с нарушением законодательства, будут демонтированы.&amp;lt;/p&amp;gt;',	'',	'',	'',	''),
(19,	1,	'О водоснабжении ',	'&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n	сел Лучистое, Верхняя Кутузовка, Нижняя Кутузовка.&amp;lt;/h3&amp;gt;\r\n&amp;lt;h3&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/h3&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Строительство системы водоснабжения, ветки которой будут протянуты в три села Большой Алушты, начнется в конце следующего года (источник─ Крыминформ, ссылка на слова вице-премьера, Виталия Нахлупина).&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Аксенов выразил удивление, узнав о факте необоснованного повышения тарифов на воду в сельских населенных пункта. Глава Крыма подчеркнул, что схемы строительных работ детально продуманы, дорожные карты открыты. По плану, в конце третьего квартала 2018 года будут проведены проектно-изыскательские работы и торги, а в четвертом квартале должно быть все готово к строительно-монтажному циклу. Результатом реализации проекта станет непрерывная подача питьевой воды в Лучистое, Верхнюю Кутузовку, Нижнюю Кутузовку.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Источник: &amp;lt;a href=&amp;quot;http://krym.aif.ru&amp;quot;&amp;gt;http://krym.aif.ru&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	''),
(23,	1,	'Представители органов власти сообщили, что...',	'&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n	Представители органов власти сообщили, что площадь зеленой зоны в Крыму увеличилась&amp;lt;/h3&amp;gt;\r\n&amp;lt;h3&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/h3&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Площадь, отведенная для посадки зеленых насаждений, увеличилась в прошлом году, объявленном Годом экологии, на 350 гектаров.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Эту информацию оставил на своей странице Facebook Сергей Аксенов, приурочив обращение Дню заповедников и национальных парков России.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Глава республики Крым написал, что зеленые зоны, парки леса полуострова – уникальные природные комплексы, являющиеся национальным достоянием, гордостью региона и всей России. Аксенов подчеркнул, что сохранение природных ресурсов – важнейший фактор социально-экономического развития. Сегодня в Крыму официально зарегистрировано 189 региональных природных территорий, находящихся под особой охраной. В прошедшем Году экологии в разных городах Крыма, в рамках тематических программ, проводились масштабные акции, в которых приняли участие около 250 тысяч человек.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	2017 год отмечен важным событием – это создание трех, особо охраняемых территорий, к которым относятся государственные природные заказники регионального значения комплексный заказник «Озера Ачи и Камышинский луг» (Феодосия),«Аунлар» (Судак), «Красная заря» (Бахчисарайский район). Глава Крымской республики выразил благодарность сотрудникам природоохранных органов, ученым-экологам и волонтерам.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Тепличный комплекс будет организован в Нижнегорском районе Крыма. По данным пресс-службы Минсельхоза Крыма, в строительство объекта планирует вложить средства китайские инвесторы. Плановая стоимость комплекса, где будут выращивать овощи, ягоды, бахчевые культуры, составляет порядка 600 млн. рублей. В строительных работах будут принимать участие местные жители. При достижении договоренностей, строительный цикл начнется в текущем году.&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	''),
(24,	1,	'На развитие сельского хозяйства в республике Крым...',	'&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n	На развитие сельского хозяйства в республике Крым в 2018 году выделено 3,5 млрд. рублей.&amp;lt;/h3&amp;gt;\r\n&amp;lt;h3&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/h3&amp;gt;\r\n&amp;lt;p&amp;gt;Прогноз по агрономическому развитию 2018. Сельскохозяйственное производство в Крыму – одна из главных задач, которую предстоит решить правительству Республики. По словам Сергея Аксенова, в прошлом году были зафиксированы хорошие результаты в отрасли – бюджетные средства освоены в соответствии с планом и законодательством, достигнуты высокие показатели урожая.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;В 2018 году планируется освоить 3,5 миллиардов рублей, направленных на дальнейшее развитие агропромышленного комплекса.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;По словам Сергея Аксёнова, в прошлом году отрасль показала впечатляющий результат: выделенные средства потратили согласно законодательству, урожай был высоким. В 2018 году на развитие агропромышленного комплекса направлены около 3,5 миллиардов рублей. В какой проект будет вложены, в первую очередь, бюджетные деньги, и какие показатели урожая  ожидаются в Крыму –  актуальная тема обсуждений  Главы Крыма с министерством.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Инвестиции в размере 2,5 миллиарда рублей будут направлены на развитие, приоритетной на полуострове, растениеводческой отрасли. Планируется расширить территорию, отведенную под виноградники, на 1 тысячу гектаров, и садов – на 900 тысяч.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Оптимистичен прогноз в отношении урожайности традиционных зерновых культур.   Крымские аграрии впервые за последние 8 лет собрали урожай более одного миллиона семисот тысяч тонн зерна. Этот показатель, как считает министр, не будет снижен.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Рост урожайности планируется и по другим культурам. Это относится, в первую очередь, к масличным растениям, и  к овощам.  В 2018 году ожидается увеличение сбора семян подсолнечника на 4 тысячи тонны, а картофеля – на 30.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Поддержка подсобных хозяйств личного пользования, по мнению Главы Республики, является важнейшей задачей правительства, поэтому министерства обязаны оказывать всяческую помощь инициативным частникам.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Схема реализации такого содействия, по поручению Сергея Аксенова, должна  быть представлена на рассмотрение и утверждена до 1 марта 2018 года.&amp;lt;/p&amp;gt;',	'',	'',	'',	''),
(25,	1,	'Министр транспорта Максим Соколов сообщил, что...',	'&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\n	Министр транспорта Максим Соколов сообщил, что дата введения в эксплуатацию Крымского моста, будет объявлена нынешней весной&amp;lt;/h3&amp;gt;\r\n&amp;lt;h3&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/h3&amp;gt;\r\n&amp;lt;p&amp;gt;Автодорожная магистраль  должна быть введена в эксплуатацию в 2018 году. Точную дату министра не назвал, поскольку неблагоприятные погодные условия могут незначительно замедлить темы строительства. Однако ближе к весне можно будет с высокой точностью назвать время открытия Крымского моста.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;В конце 2017 года министр прибыл с инспекцией на место строительства. Маршрут инспекционной группы совпадал с траекторией автодорожной трассы, соединяющей Анапу и Симферополь. Строительство идет по плану, и даже с небольшим опережением сроков.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Мост через Керченский пролив, соединяющий Краснодарский край и полуостров, будет самым протяженным в России – длина магистрали составляет 19 километров. Запланированный период запуска движения автомобильных транспортных средств – декабрь 2018 года.&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	''),
(26,	1,	'Будут ли жители Крыма платить госпошлину при...',	'&amp;lt;h3 class=&amp;quot;h4-title news-title&amp;quot;&amp;gt;\r\nБудут ли жители Крыма платить госпошлину при перерегистрации прав на недвижимость?&amp;lt;/h3&amp;gt;\r\n&amp;lt;h3&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/h3&amp;gt;\r\n&amp;lt;p&amp;gt;До 1 января 2019 года жители Крымского полуострова  освобождены от уплаты пошлины за перерегистрацию прав на недвижимость, находящуюся в собственности. Эту информацию сообщил Александр Спиридонов, председатель Госкомрегистра Крыма.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;Спиридонов пояснил, что у граждан часто возникают вопросы в отношении сроков действия различных законодательных актов. Множество обращений  с просьбой разъяснить законодательство поступило по «горячей линии» Госкомрегистра.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;В течение 2018 год для крымчан льгота сохраняется. В данную категорию включаются все объекты недвижимости,  расположенные на полуострове, права собственности на которые были зарегистрированы до момента перехода республики Крым в состав России. Под действие закона подпадают юридические и физические лица.&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	''),
(27,	1,	'Видео строящегося терминаал аэропорта Симферополя',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;iframe allow=&amp;quot;autoplay; encrypted-media&amp;quot; allowfullscreen=&amp;quot;&amp;quot; frameborder=&amp;quot;0&amp;quot; height=&amp;quot;315&amp;quot; src=&amp;quot;https://www.youtube.com/embed/hLxvw-qgy4g&amp;quot; width=&amp;quot;560&amp;quot;&amp;gt;&amp;lt;/iframe&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Видео строящегося терминаал аэропорта Симферополя. Высота построенного в форме волны комплекса, расположившемся в нескольких километрах от действующего аэровокзала, колеблется от 25 до 35 метров в разных точках. В нем предусмотрено почти 30 лифтов, 16 эскалаторов, восемь телетрапов и восемь выходов к перронным автобусам.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	На привокзальной площади в 11 га разбит ландшафтный парк, есть зона отдыха с детской площадкой. В эксплуатацию в аэропорту также будет введена отремонтированная и удлиненная взлетно-посадочная полоса с новыми рулежными дорожками.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Работы в новом терминале планируется завершит к летнему туристическому сезону 2018 года.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Источник: &amp;lt;a href=&amp;quot;https://3652.ru&amp;quot;&amp;gt;3652.ru&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	''),
(28,	1,	'Cервис Tvil.ru выявил популярные города России для отдыха',	'&amp;lt;p&amp;gt;\r\n	Российский сервис бронирования жилья Tvil.ru выявил самые популярные у туристов с детьми города России для отдыха на весенние школьные каникулы.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Рейтинг представлен по данным броней отелей и апартаментов с 24 марта по 1 апреля 2018 года.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Ялта является лидером по длительности отдыха с детьми на каникулы.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	В топ-10 городов, популярных для поездок с детьми на весенние каникулы, входят Санкт-Петербург, Сочи, Ялта, Москва, Казань, Нижний Новгород, Анапа, Екатеринбург, Ярославль и Калининград.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	По данным Tvil.ru, российские туристы бронируют жилье в Ялте в дни весенних каникул в среднем на 8 ночей и тратят на проживание 2,4 тысячи рублей в сутки.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Топ-10 городов России для отдыха с детьми на весенние каникулы:&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Санкт-Петербург - 2,5 тысячи рублей в сутки/ 7 ночей *&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Сочи - 2,3 тысячи рублей/ 9 ночей&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Ялта - 2,4 тысячи рублей/ 8 ночей&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Москва - 2,9 тысяч рублей/ 3 ночи&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Казань - 2,6 тысяч рублей/ 4 ночи&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Нижний Новгород - 2,3 тысячи рублей/ 2 ночи&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Анапа - 2,2 тысячи рублей/ 7 ночей&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Екатеринбург - 2,6 тысяч рублей/ 3 ночи&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Ярославль - 2,8 тысяч рублей/ 2 ночи&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Калининград - 2,7 тысяч рублей/ 3 ночи&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	* Средняя плата за проживание в сутки/ среднее число забронированных ночей&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Отдых с Детьми на весенних каникулах в Алуште обойдется от 1,7 тысяч рублей в сутки. Более подробно об аренде вы сможете узнать, позвонив по номеру &amp;lt;a href=&amp;quot;tel:+79787888111&amp;quot;&amp;gt;+7(978) 7-888-111&amp;lt;/a&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'',	'',	'',	''),
(29,	1,	'Где купить недвижимость в Алуште?',	'&amp;lt;p&amp;gt;\r\n	Алушта – небольшой город на ЮБК, разделяющий с Ялтой первое место в рейтинге курортов по популярности. Тем, кто планирует приобрести недвижимость в Алуште, стоит получить представление об условных границах городской территории (административной градации здесь нет, за исключением «Профессорского уголка», выделенного в отдельный район). Согласно городским традициям, в населенном пункте существуют следующие зоны:&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• Центр;&amp;lt;br&amp;gt;\r\n	• Центральная набережная;&amp;lt;br&amp;gt;\r\n	• Черемушки;&amp;lt;br&amp;gt;\r\n	• р-н улицы Судакской;&amp;lt;br&amp;gt;\r\n	• р-н Автовокзала;&amp;lt;br&amp;gt;\r\n	• р-н ул.60 лет СССР;&amp;lt;br&amp;gt;\r\n	• р-н ул. Октябрьской;&amp;lt;br&amp;gt;\r\n	• микрорайон Мирный;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	• р-н восточной набережной&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Центральный район расположен близко к морю. Отличительные особенности – ровный рельеф местности, развитая инфраструктура, высокая плотность населения. Здесь находятся Православные храмы и мусульманская мечеть, памятники архитектуры и музеи.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	В районе Центральной набережной расположены лучшие пляжи и развлекательные заведения – бары, рестораны, кафе, кинотеатр, дельфинарии, а также знаменитый парк «Крым в миниатюре».&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Район «Черемушки» относится к центральным участкам города. На территории расположен Олимпийский центр «Спартак», вдоль которого протянулась улица Перекопская, спускающаяся к морю, приморскому парку и Центру детского творчества.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Район улицы Судакской – уютная тихая часть города, где есть абсолютно все для комфортного проживания – много магазинов, аптек, детский сад. В окружении зеленых парков здесь находятся известные санатории «Ветеран», «Славутич», «Магнолия», пансионат «Чайка», курортный комплекс Golden.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Микрорайон Мирный – спальный район, расположенный на возвышенности, откуда открывается панорамный вид города. До центра можно добраться за 5-10 минут пешим ходом, или на общественном транспорте (каждые 15 минут отправляются автобусы и маршрутки).&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Район улицы Ялтинской (автовокзал) – оживленный центр города, где, помимо многочисленных магазинов, находится рынок (Первомайская улица). Здесь есть школа и детский сад, остановки общественного транспорта, откуда легко добраться в любой участок города.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Район 60 лет СССР ─ тихая местность, расположенная на городском холме (над автовокзалом). Кроме многочисленных объектов городской инфраструктуры, здесь находится недавно построенный (действующий) храм Святых Царственных Страстотерпцев.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Район улицы Октябрьской ─ это, по сути, два спальных района, верхний и нижний. Нижний ─ простирается от набережной до дороги, ведущей в Рабочий уголок. Верхний – начинается от этой же дороги, и заканчивается у трассы «Симферополь-Ялта».&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Профессорский уголок ─ престижная курортная зона, где сосредоточено наибольшее число здравниц и отелей. Здесь же находятся многочисленные музеи, аквапарк, фешенебельные новостройки.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Район «Восточной набережной» начинается от парк-отеля «Porto Mare» и до лодочной станции «Волна». Это популярный курортный и спортивный район города, где действуют теннисные корты, выдаются напрокат плавсредства. В 30 метрах от прибрежной линии расположены престижные жилые комплексы и новостройки премиального класса.&amp;lt;/p&amp;gt;\r\n',	'',	'',	'Где купить недвижимость в Алуште?',	'Где купить недвижимость в Алуште?'),
(30,	1,	'Материнский капитал в Крыму',	'&amp;lt;p&amp;gt;\r\n	ВНИМАНИЕ!!! Материнский капитал в Крыму – возможность улучшить свои жилищные условия.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Помощь в оформлении!!!&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;lt;img src=&amp;quot;/image/data/bizfeTLp-71.jpg&amp;quot; /&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Размер материнского капитала в 2018 году составляет 453 026 рублей.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Согласно решению Президента Российской Федерации Владимира Путина материнский капитал в Крыму распространяется на детей, родившихся с 01 января 2007 года, как и на всей территории России, а не с момента вступления в силу закона в Республике Крым.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Улучшение жилищных условий остается самым популярным направлением расходования материнского капитала – 77,2 % заявлений.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	К четвертому основному направлению расходования материнского капитала относится – социальная адаптация и интеграция в общество детей-инвалидов.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	За время действия программы материнского капитала в Республике Крым количество семей, получивших материнский сертификат, составляет 101 099, 17,3 % крымских семей уже распорядилось капиталом полностью.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	С января 2018 года Пенсионный фонд России начал принимать заявления от нуждающихся семей на получение ежемесячной выплаты из средств материнского капитала. За пять месяцев в Крыму на ежемесячную выплату принято 343 заявления.&amp;lt;/p&amp;gt;\r\n',	'',	'',	'Материнский капитал в Крыму',	'Материнский капитал в Крыму');

