CREATE TABLE `product_attribute` (
  `product_id` int(11) NOT NULL,
  `attribute_id` int(11) NOT NULL,
  `language_id` int(11) NOT NULL,
  `text` text NOT NULL,
  PRIMARY KEY (`product_id`,`attribute_id`,`language_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `product_description`;
CREATE TABLE `product_description` (
  `product_id` int(11) NOT NULL AUTO_INCREMENT,
  `language_id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `description` text NOT NULL,
  `meta_description` varchar(255) NOT NULL,
  `meta_keyword` varchar(255) NOT NULL,
  `seo_title` varchar(255) NOT NULL,
  `seo_h1` varchar(255) NOT NULL,
  `tag` text NOT NULL,
  PRIMARY KEY (`product_id`,`language_id`),
  KEY `name` (`name`),
  FULLTEXT KEY `description` (`description`),
  FULLTEXT KEY `tag` (`tag`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

INSERT INTO `product_description` (`product_id`, `language_id`, `name`, `description`, `meta_description`, `meta_keyword`, `seo_title`, `seo_h1`, `tag`) VALUES
(699,	1,	'Продается два дома в Алуште ул. Сергеева-Ценского',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;br /&amp;gt;\r\n	Общая площадь каждого продаваемого дома 240 кв.м., купить можно как вместе так и отдельно. Земельный участок у каждого дома свой и составляет 2,5 сотки. На участок заведены все коммуникации: свет 15кВт, газ, вода. Дом трех этажный, с видовыми террасами. Два дома построены и введены в эксплуатацию в сентябре 2016 года. Внешняя отделка полностью готова, Внутри дома под отделку. Хорошее место, закрыто от лишних глаз, прекрасно подойдет для спокойного отдыха или тихого проживания.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается два дома в Алуште ул. Сергеева-Ценского',	'Продается два дома в Алуште ул. Сергеева-Ценского',	'Продается два дома в Алуште ул. Сергеева-Ценского',	'Продается два дома в Алуште ул. Сергеева-Ценского',	'дом, купить, продажа, Алушта, Крым, центр, професорский уголок, рабочий уголок.'),
(700,	1,	'Продается дом в центре Алушты, ул. Краснофлотская',	'&amp;lt;p&amp;gt;\r\n	Отдельно стоящий дом, 5.2 сотки земли, в собственности. Земля с уточненными границами, есть свидетельство РФ. Общая площадь продаваемого дома 350 кв.м., из которых 250 дом и 100 кв.м. гараж с подсобными помещениями. Можно приобрести и соседний дом. Внешняя отделка сделана полностью, внутри под отделку. Есть место под бассейн, беседку, барбекю. Прекрасный панорамный вид из окон дома на город и море. До моря и набережной 5 минут пешком, всю инфраструктура в шаговой доступности.&amp;lt;/p&amp;gt;\r\n',	'Продается дом в центре Алушты, ул. Краснофлотская',	'Продается дом в центре Алушты, ул. Краснофлотская',	'Продается дом в центре Алушты, ул. Краснофлотская',	'Продается дом в центре Алушты, ул. Краснофлотская',	'дом, купить, продажа, Алушта, Крым, центр, професорский уголок, рабочий уголок.'),
(701,	1,	'Срочно! Продается дом в Алуште, район улицы Чатырдагская',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;br /&amp;gt;\r\n	Дом сдан в эксплуатацию, у каждого коттеджа свой земельный участок, все коммуникации, гараж. Доделывается вся внешняя отделка как в проекте, подведены все коммуникации, сделано панорамное остекление. Участок 1,5 сотки под каждым коттеджем. На Первом этаже планируется гардероб, туалет и ванная комната, большая гостиная комната, спальня. На Втором этаже 2 комнаты-спальня, санузел. Третий этаж терраса.&amp;lt;br /&amp;gt;\r\n	Общая площадь 250 м.кв.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;lt;br /&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-size:16px;&amp;quot;&amp;gt;СРОЧНО Цена&amp;lt;del&amp;gt; 16 500 000&amp;lt;/del&amp;gt; рублей. &amp;lt;strong&amp;gt;&amp;lt;span style=&amp;quot;color: rgb(255, 0, 0);&amp;quot;&amp;gt;10 300 000 рублей.&amp;lt;/span&amp;gt;&amp;lt;/strong&amp;gt; (Под внутреннюю отделку).&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Общая площадь 190 м.кв. (ПРОДАН)&amp;lt;br /&amp;gt;\r\n	Цена 11 300 000 рублей. (Под внутреннюю отделку)&amp;lt;br /&amp;gt;\r\n	Общая площадь 180 м.кв. (ПРОДАН)&amp;lt;br /&amp;gt;\r\n	Цена 10 800 000 рублей. (Под внутреннюю отделку)&amp;lt;/p&amp;gt;\r\n',	'Срочно! Продается дом в Алуште, район улицы Чатырдагская',	'Срочно! Продается дом в Алуште, район улицы Чатырдагская',	'Срочно! Продается дом в Алуште, район улицы Чатырдагская',	'Срочно! Продается дом в Алуште, район улицы Чатырдагская',	'дом, купить, продажа, Алушта, Крым, центр, професорский уголок, рабочий уголок.'),
(709,	1,	'Продается квартира 100 кв.м. в Алуште',	'&amp;lt;p&amp;gt;\r\n	Общая площадь 100 кв.м. первый этаж двух этажного дома. Коммуникации все, кроме газа, газовая труба идет по дому. Установлены два бойлера по 80 литров, кондиционеры. По документам как две жилые квартиры, продаются только вместе. В квартиры свободная планировка, стены гипсокартон. Очень перспективное место, до продаже была парикмахерская. До набережной города 30 метров.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 100 кв.м. в Алуште',	'Продается квартира 100 кв.м. в Алуште',	'Продается квартира 100 кв.м. в Алуште',	'Продается квартира 100 кв.м. в Алуште',	'продажа, квартира, Алушта, купить, ЮБК, центр, набережная.'),
(809,	1,	'Продается участок 10 соток г. Алушта, поселок Семидворье',	'&amp;lt;p&amp;gt;\r\n	Продается участок 10 соток г. Алушта, поселок Семидворье, от Алушты всего 3 км. 5 мин. на машине и Вы в городе. С земельного участка открывается прекрасный вид на море, расположен в микрорайоне «Дельфин» с целевым назначением (ИЖС), хорошее и удобное место под строительства жилого дома в пределах города, 5 минут к морю. Подъездная асфальтированная дорога, коммуникации на соседних участках, рядом свет, централизованное водоснабжение. Есть возможность увеличить площадь участка купив смежные участки по 10 соток.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;amp;nbsp;Все документы РФ и к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 10 соток г. Алушта, поселок Семидворье',	'Продается участок 10 соток г. Алушта, поселок Семидворье',	'Продается участок 10 соток г. Алушта, поселок Семидворье',	'Продается участок 10 соток г. Алушта, поселок Семидворье',	'Продам, Продажа, Продаю, Куплю, участок, землю, Семидворье, Дельфин, Алушта'),
(704,	1,	'Продается 1 км. квартира в Алуште ул. Чатырдагского',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;br /&amp;gt;\r\n	Площадь квартиры 50 кв.м., с качественной отделкой и мебелью.&amp;lt;br /&amp;gt;\r\n	Дом 10 этажный квартира находиться на 6 этаже. Окна выходят в сторону моря и города.&amp;lt;br /&amp;gt;\r\n	Два лифта, один грузовой один пассажирский.&amp;lt;br /&amp;gt;\r\n	Охраняемая территория. От моря 400 метров.&amp;lt;br /&amp;gt;\r\n	Вся инфраструктура рядом.&amp;lt;/p&amp;gt;\r\n',	'Продается 1 км. квартира в Алуште ул. Чатырдагского',	'Продается 1 км. квартира в Алуште ул. Чатырдагского',	'Продается 1 км. квартира в Алуште ул. Чатырдагского',	'Продается 1 км. квартира в Алуште ул. Чатырдагского',	'продажа, квартира, Алушта, купить, ЮБК.'),
(707,	1,	'Продается 3 комнатная квартира в Алуште, ул. 15 Апреля',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;br /&amp;gt;\r\n	Общая площадь квартиры 58 кв.м., жилая 38,7 кв.м.. В квартире три комнаты 9,9 кв.м., 11,5 кв.м., и 17,3 кв.м., одна из них проходная. Кухня 10,6 кв.м., прихожая 8,7 кв.м. Квартира находится на 2 этаже, 2-х этажного дома. Очень удобная транспортная развязка, развитая инфраструктура. Квартира чистая и уютная, есть свой сарай, который переоборудовали в квартирку под сдачу.&amp;lt;br /&amp;gt;\r\n	Очень хорошо сдаваемый район, до моря 3-5 минуты пешком и вы выходите на набережную Алушты.&amp;lt;/p&amp;gt;\r\n',	'Продается 3 комнатная квартира в Алуште, ул. 15 Апреля',	'Продается 3 комнатная квартира в Алуште, ул. 15 Апреля',	'Продается 3 комнатная квартира в Алуште, ул. 15 Апреля',	'Продается 3 комнатная квартира в Алуште, ул. 15 Апреля',	'продажа, квартира, Алушта, купить, ЮБК.'),
(706,	1,	'Продается 2-х комнатная квартира в Партените',	'&amp;lt;p&amp;gt;\r\n	Общая площадь квартиры 49 м.кв., жилая 29 м.кв.&amp;lt;br /&amp;gt;\r\n	Санузел совмещен. 4 этаж/4 этажного дома.&amp;lt;br /&amp;gt;\r\n	Частичный вид на море. Очень удобная транспортная развязка.&amp;lt;br /&amp;gt;\r\n	250 метров от моря. Рядом остановка, магазин.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира в Партените',	'Продается 2-х комнатная квартира в Партените',	'Продается 2-х комнатная квартира в Партените',	'Продается 2-х комнатная квартира в Партените',	'продажа, квартира, Алушта, купить, ЮБК., Партенит.'),
(705,	1,	'Продается 3 ком. квартира в Алуште по ул. Платановой (центр)',	'&amp;lt;p&amp;gt;\r\n	Общя площадь квартиры 82,3 кв.м., жилая 40 кв.м., кухня 11,2 км.м.&amp;lt;br /&amp;gt;\r\n	Квартира расположена на 3 этаже 5 этажного дома.&amp;lt;br /&amp;gt;\r\n	Продается с мебелью и техникой. Современный ремонт.&amp;lt;br /&amp;gt;\r\n	2 санузла, 2 спальни, кухня-студия, большая прихожая.&amp;lt;br /&amp;gt;\r\n	Дома под круглосуточной охраной, чистая территория, есть детская площадка.&amp;lt;br /&amp;gt;\r\n	Рядом школа, супермаркет, остановка, рынок.&amp;lt;br /&amp;gt;\r\n	До моря 5-7 минут ходьбы по ровной местности.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается 3 ком. квартира в Алуште по ул. Платановой (центр)',	'Продается 3 ком. квартира в Алуште по ул. Платановой (центр)',	'Продается 3 ком. квартира в Алуште по ул. Платановой (центр)',	'Продается 3 ком. квартира в Алуште по ул. Платановой (центр)',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(837,	1,	'Продается 2 комнатная квартира в Алуште, улица Платановая.',	'&amp;lt;div&amp;gt;\r\n	Общая площадь продаваемой квартиры составляет 69,9 кв.м. Квартира находится на 4 этаже, 5 этажного жилого дома.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	В квартире сделан дорогостоящий ремонт, установлена мебель и встроенная техника. Территория дома закрытого типа, есть свой внутренний дворик, круглосуточное видео наблюдение и охрана по периметру дома. Развитая инфраструктура, у дома магазин, школа, аптека и садик.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается 2 комнатная квартира в Алуште, улица Платановая.',	'Продается 2 комнатная квартира в Алуште, улица Платановая.',	'Продается 2 комнатная квартира в Алуште, улица Платановая.',	'Продается 2 комнатная квартира в Алуште, улица Платановая.',	'продам, квартира, в центре, платановая, куплю, алушта'),
(838,	1,	'Продаётся 2-х комнатная квартира в Алуште,улица Платановая 1.',	'&amp;lt;div&amp;gt;\r\n	&amp;lt;p style=&amp;quot;color: rgb(0, 0, 0); font-family: yandex-sans; font-size: 15px; margin-bottom: 0.11in;&amp;quot;&amp;gt;\r\n		Продам двухкомнатную квартиру в центре Алушты. Квартира находится по улице Платановой 1, в центральной части города Алушты. Общая площадь квартиры 64,3 кв. м., спланирована как квартира-студия. Квартира под ремонт, коммуникации централизованные, газовое отопление в квартире автономное, установлен двухконтурный котёл. Расположена квартира на 1-м этаже (Высоком), в 9-ти этажном новом доме, имеет прекрасный вид на горы и виноградное поле. Рядом есть школа, детский садик, магазин. Территория двора закрытого типа, озеленённая и ухоженная с зоной отдыха и детской площадкой, также есть охрана, круглосуточное видеонаблюдение. Документы к продаже подготовлены.&amp;lt;/p&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся 2-х комнатная квартира в Алуште,улица Платановая 1.',	'Продаётся 2-х комнатная квартира в Алуште,улица Платановая 1.',	'Продаётся 2-х комнатная квартира в Алуште,улица Платановая 1.',	'Продаётся 2-х комнатная квартира в Алуште,улица Платановая 1.',	'продам, квартира, в центре, куплю, Алушта, новостройка '),
(710,	1,	'Продается 3 ком. квартира в Алуште, ул. Платановая 1',	'&amp;lt;p&amp;gt;\r\n	Общая площадь 99,3 кв.м., жилая 56,3 кв.м., комнаты 27,3/16,7/12,3 кв.м., туалет 2,4 кв.м., ванная 5,6 кв.м., кухня 10,8 кв.м. Квартира находится на 3 этаже 5 этажного дома, полностью укомплектована мебелью и техникой. Закрытая территория, охраняемый дом, парковка, детская площадка.&amp;lt;/p&amp;gt;\r\n',	'Продается 3 ком. квартира в Алуште, ул. Платановая 1',	'Продается 3 ком. квартира в Алуште, ул. Платановая 1',	'Продается 3 ком. квартира в Алуште, ул. Платановая 1',	'Продается 3 ком. квартира в Алуште, ул. Платановая 1',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(711,	1,	'Продается уютная 2-х комнатная квартира по ул. Чатырдагская, в Алуште',	'&amp;lt;p&amp;gt;\r\n	Квартира на 3 этаж, 10 этажного дома, общая площадь квартиры 65 кв.м., два санузла. Полностью готова для жизни, техника и мебель остается. Дом новой постройки, есть паркинг, два лифта, консьерж, видео наблюдения. По документам числится как квартира с правом прописки. Все документы образца РФ, в собственности.&amp;lt;/p&amp;gt;\r\n',	'Продается уютная 2-х комнатная квартира по ул. Чатырдагская, в Алуште',	'Продается уютная 2-х комнатная квартира по ул. Чатырдагская, в Алуште',	'Продается уютная 2-х комнатная квартира по ул. Чатырдагская, в Алуште',	'Продается уютная 2-х комнатная квартира по ул. Чатырдагская, в Алуште',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(712,	1,	'Продается 2-х комн. квартира в Ялте',	'&amp;lt;p&amp;gt;\r\n	Дом находится в районе пляжа «Донбасс», ул. Морской спуск, 6.&amp;lt;br /&amp;gt;\r\n	Общая площадь продаваемой квартиры 75 кв.м.,вместе с балконом.&amp;lt;br /&amp;gt;\r\n	В доме 8 этажей, квартира расположена на 2 этаже.&amp;lt;br /&amp;gt;\r\n	Дом новой постройки, комнаты раздельные, два санузла, полы с подогревом, автономное отопление.&amp;lt;br /&amp;gt;\r\n	В квартире сделан современный ремонт, до моря 100 метров.&amp;lt;br /&amp;gt;\r\n	Есть место для парковки автомобиля, до набережной Ялты 3 минуты на машине.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комн. квартира в Ялте',	'Продается 2-х комн. квартира в Ялте',	'Продается 2-х комн. квартира в Ялте',	'Продается 2-х комн. квартира в Ялте',	'продажа, квартира, Ялта, купить, ЮБК.'),
(917,	1,	'Продается квартира двухкомнатная на 60 лет СССР в гор. Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира двухкомнатная на 60 лет СССР в гор. Алушта. Квартира под отделку, общей площадью в 69, 29 кв. м. из них 41 - жилой площади, расположена на 13-м из 14-ти этажей многоквартирного дома в тихом и видовом районе Алушты. Из окон квартиры и балкончика в 2 кв. м. открывается шикарный вид на город Алушту, гору Демерджи и море. В многоквартирном доме предусмотрены грузовые лифты, охрана и видеонаблюдение на входе, возле дома удобная парковка, в цокольном этаже магазин, неподалёку есть остановка общественного транспорта.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира двухкомнатная на 60 лет СССР в гор. Алушта.',	'Продается квартира двухкомнатная на 60 лет СССР в гор. Алушта.',	'Продается квартира двухкомнатная на 60 лет СССР в гор. Алушта.',	'Продается квартира двухкомнатная на 60 лет СССР в гор. Алушта.',	'Продается, купить, куплю, продажа, квартиру, квартира, город Алушта, 60 Лет СССР, район автовокзала, спальный район'),
(714,	1,	'Продается 3 комн. квартира в клубном доме в Алуште, ул. Парковая',	'&amp;lt;p&amp;gt;\r\n	Квартира находиться в «Дачи Доктора Штейнгольца», дом в центральной части города, в районе набережной города.&amp;lt;br /&amp;gt;\r\n	Общая площадь продаваемых апартаментов 192 кв.м., всего в доме 9 этажей, продаваемая квартира располагается на 4 этаже.&amp;lt;br /&amp;gt;\r\n	Продается с современным ремонтом и мебелью, 3 отдельные комнаты, большая кухня-студия, в каждой спальне свой санузел.&amp;lt;br /&amp;gt;\r\n	Есть тех.помещения, большие лоджии, вид на город и парк. Дом современный, 2 своих ресепшна, круглосуточная охрана, развитая инфраструктура, городская набережная города в 2 минутах ходьбы, парк.&amp;lt;/p&amp;gt;\r\n',	'Продается 3 комн. квартира в клубном доме в Алуште, ул. Парковая',	'Продается 3 комн. квартира в клубном доме в Алуште, ул. Парковая',	'Продается 3 комн. квартира в клубном доме в Алуште, ул. Парковая',	'Продается 3 комн. квартира в клубном доме в Алуште, ул. Парковая',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(715,	1,	'Продается 2 комн. апартамент в кооперативе «Дельфин» Алушта',	'&amp;lt;p&amp;gt;\r\n	Апартамент находится на 4 линии, перед домом есть паркинг, Этаж 4/6 этажного здания. Площадь продаваемого апартамента 49,7 кв.м., жилая площадь апартамента 28,1 кв.м., большая кухня площадью 11,1 кв.м. Санузел совмещенный, с окон вид на моря, до моря 50 метров.&amp;lt;/p&amp;gt;\r\n',	'Продается 2 комн. апартамент в кооперативе «Дельфин» Алушта',	'Продается 2 комн. апартамент в кооперативе «Дельфин» Алушта',	'Продается 2 комн. апартамент в кооперативе «Дельфин» Алушта',	'Продается 2 комн. апартамент в кооперативе «Дельфин» Алушта',	'продажа, апартомент, Алушта, купить, ЮБК, центр.'),
(716,	1,	'Продаются 1 комн. апартаменты в Малом Маяке, комплекс «Премьера»',	'&amp;lt;p&amp;gt;\r\n	Комплекс расположен на берегу черного моря, свой пляж, набережная. Общая площадь продаваемого апартаменты 42 кв.м., жилая 21 кв.м. Комплекс представляет собой четырех этажное здание, продаваемый апартамент расположен на 1 этаже. Первый этаж имеет свои преимущества, это прямой выход к морю, не проходя через все здание. Сделан современный ремонт, встроенная техника, прекрасно подойдет для летнего отдыха, да и просто побыть вдали всей суеты. Развитая инфраструктура, охраняемая территория, видео наблюдение, кофе, детская площадка.&amp;lt;/p&amp;gt;\r\n',	'Продаются 1 комн. апартаменты в Малом Маяке, комплекс «Премьера»',	'Продаются 1 комн. апартаменты в Малом Маяке, комплекс «Премьера»',	'Продаются 1 комн. апартаменты в Малом Маяке, комплекс «Премьера»',	'Продаются 1 комн. апартаменты в Малом Маяке, комплекс «Премьера»',	'продажа, апартомент, Алушта, купить, ЮБК, берег моря.'),
(717,	1,	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'&amp;lt;p&amp;gt;\r\n	Комплекс расположен на берегу моря, со своей набережной и оборудованный пляжем. Общая площадь продаваемого апартамента 177,6 кв.м., жилая площадь апартамента 102,5 кв.м. В апартаментах, 2 санузла, 2 комнаты которые используются как гардероб. Большая видовая терраса 53 кв.м., с нее открывается потрясающий вид на моря, горы, пляж. Этаж 3, всего же в комплексе 9 этажей. Апартамент полностью укомплектован мебелью и дорогой техникой. Сделан современный евро ремонт, закрытая, охраняемая территория.&amp;lt;/p&amp;gt;\r\n',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'продажа, апартомент, Алушта, купить, ЮБК, берег моря.'),
(718,	1,	'Продается 3 ком. квартира в г. Алушта, ул. Платановая',	'&amp;lt;p&amp;gt;\r\n	Квартира в тихом районе, общей площадью 62 кв.м., в доме 5 этажей, продаваемая квартира на 3 этаже.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Комнаты раздельные, состояние средние, все коммуникации центральные.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Спокойный район, есть где поставить авто, рядом магазин, аптека.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается 3 ком. квартира в г. Алушта, ул. Платановая',	'Продается 3 ком. квартира в г. Алушта, ул. Платановая',	'Продается 3 ком. квартира в г. Алушта, ул. Платановая',	'Продается 3 ком. квартира в г. Алушта, ул. Платановая',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(916,	1,	'Продается 2-х комнатная квартира по улице Ялтинская в г. Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается 2-х комнатная квартира по улице Ялтинская в г. Алушта. Квартира общей площадью в 43,7 кв. м. и просторной лоджией, оборудованной в виде третьей отдельной спальни, включает в себя две полноценные комнаты, кухню, объединенную с частью лоджии и объединенный сан. узел, в прихожей комнате предусмотрено кладовое помещение в 1,5 кв. м., расположена на 5-м из 5-ти этажей многоквартирного дома, который находится в районе автовокзала. Рядом магазины, школа, детский сад и рынок.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира по улице Ялтинская в г. Алушта.',	'Продается 2-х комнатная квартира по улице Ялтинская в г. Алушта.',	'Продается 2-х комнатная квартира по улице Ялтинская в г. Алушта.',	'Продается 2-х комнатная квартира по улице Ялтинская в г. Алушта.',	'продам, квартира, в центре, куплю, Алушта, спальный район, Ялтинская, автовокзал'),
(720,	1,	'Продаётся двухкомнатная квартира в центре Алушты, ул. Ленина',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-family:symbol;font-size:15px;&amp;quot;&amp;gt;Общая площадь 44,7 м.кв., жилая занимает 27,7 м.кв. Имееются 2 раздельные комнаты 16,4 и 11,3 м.кв., и &amp;amp;nbsp;уютный балкончик. Квартира находится на пятом этаже, лифт отсутствует. Светлая, хорошо укомплектована всем необходимым для комфортного проживания. Из окон открывается отличный вид на горы и во двор. Удобное расположение дома, так как вся необходимая инфраструктура рядом. Море рядом. Все документы РФ и готовы к продаже. Звоните &amp;amp;nbsp;в любое удобное для вас время, мы все покажем и расскажем!&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся двухкомнатная квартира в центре Алушты, ул. Ленина',	'Продаётся двухкомнатная квартира в центре Алушты, ул. Ленина',	'Продаётся двухкомнатная квартира в центре Алушты, ул. Ленина',	'Продаётся двухкомнатная квартира в центре Алушты, ул. Ленина',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(721,	1,	'Продаётся однокомнатная  квартира в Алуште,  улица Юбилейная',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-family:symbol;font-size:15px;&amp;quot;&amp;gt;Общая площадь 30.3 м.кв. Жилая площадь составляет 17,1 м.кв.,санузел совмещенный и занимает 4 м.кв. Квартира расположена на третьем этаже, откуда открывается замечательный , панорамный вид. В доме на первом этаже находится продуктовый магазин, также недалеко от дома есть автобусная остановка, развита инфраструктура и удобная транспортная развязка. До моря &amp;amp;nbsp;25 минут ходьбы размеренным шагом. Полный пакет документов, сделка свободная, один собственник. Обращайтесь, и мы ответим на все ваши вопросы.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся однокомнатная  квартира в Алуште,  улица Юбилейная',	'Продаётся однокомнатная  квартира в Алуште,  улица Юбилейная',	'Продаётся однокомнатная  квартира в Алуште,  улица Юбилейная',	'Продаётся однокомнатная  квартира в Алуште,  улица Юбилейная',	'продажа, квартира, Алушта, купить, ЮБК.'),
(722,	1,	'Продается уютную 1 комн. квартиру в г. Алушта, ул.Ленина',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; color: rgb(51, 51, 51); font-family: symbol; font-size: 15px;&amp;quot;&amp;gt;Площадь данной квартиры 28,8 м.кв. Она находится на 4 этаже четырехэтажного дома, сделанного из природных материалов. Вы можете не беспокоиться о влажности и плесени, так как дом сухой и теплый. Квартира в хорошем состояние, продается вместе с техникой и мебелью. Отопление автономное-имеется 2-х контурный газовый котел и установлен кондиционер. &amp;lt;/span&amp;gt;&amp;lt;span style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; color: rgb(51, 51, 51); font-family: symbol; font-size: 15px;&amp;quot;&amp;gt;Также в квартире есть открытый балкон , с которого вы сможете любоваться панорамным видом на Крымские горы и город. Дом расположен в центре города, до всей необходимой инфраструктуры рукой подать. Городской пляж и центральная набережная расположены в семи минутах ходьбы размеренным шагом.&amp;lt;/span&amp;gt;&amp;lt;br data-mce-style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; box-sizing: border-box; color: #333333; font-family: \'Trebuchet MS\', \'Helvetica Neue\', Helvetica, Arial, sans-serif; background-color: #f5f5f5;&amp;quot; style=&amp;quot;font-variant-ligatures:normal;font-variant-east-asian:normal;font-variant-position:normal;color:#333333;font-family:&amp;amp;quot;Trebuchet MS&amp;amp;quot;,&amp;amp;quot;Helvetica Neue&amp;amp;quot;,Helvetica,Arial,sans-serif;background-color:#f5f5f5;&amp;quot; /&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; color: rgb(51, 51, 51); font-family: symbol; font-size: 15px;&amp;quot;&amp;gt;Если у вас возникнут дополнительные