(723,	1,	'Продаётся светлая 2-х комн. квартира в г. Алушта',	'&amp;lt;div data-mce-style=&amp;quot;font-family: -apple-system-font; font-size: 12px; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; line-height: 16px;&amp;quot; style=&amp;quot;font-family: -apple-system-font; font-size: 12px; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; line-height: 16px;&amp;quot;&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-size:14px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-family: times new roman,times,serif;&amp;quot;&amp;gt;В городе Алушта&amp;amp;nbsp;продается &amp;amp;nbsp;квартира в новом доме по &amp;lt;span class=&amp;quot;js-extracted-address js-extracted-highlighted-address mail-Message-Map-Link&amp;quot; data-address=&amp;quot;улице Пуцатова&amp;quot; data-ids=&amp;quot;162974011515485499&amp;quot;&amp;gt;улице &amp;lt;span class=&amp;quot;mail-Message-Map-NoBreak&amp;quot;&amp;gt;Пуцатова&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;. Общая площадь &amp;amp;nbsp;60.7 м.кв. плюс лоджия &amp;amp;nbsp;16,7 м.кв. Квартира расположена на 8 этаже монолитного девятиэтажного дома. Жилая площадь занимает 39,5 м.кв. Благодаря лоджии площадь кухни увеличена до 14.кв.м. Квартира новая, в отличном жилом состоянии и с качественным ремонтом. Продается с мебелью и техникой, имеется все для вашего&amp;amp;nbsp;комфорта. &amp;amp;nbsp;Отопление в квартире автономное( имеется 2х контурный газовый котел) . Из окон квартиры вы можете наслаждаться прекрасным видом на море и горы. Расположение дома очень удобное, вся необходимая инфраструктура находится неподалеку.&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/div&amp;gt;\r\n&amp;lt;div data-mce-style=&amp;quot;font-family: -apple-system-font; font-size: 12px; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; line-height: 16px;&amp;quot; style=&amp;quot;font-family: -apple-system-font; fo