(726,	1,	'Продается 2 комн. квартира в Алуште, под ремонт',	'&amp;lt;p&amp;gt;\r\n	Квартира расположена по улице Партизанская, этаж последний 5-ый, крыша не течет.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Общая площадь двух комнатной квартиры составляет 48 кв.м., коммуникации все центральные.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Состояние требующие ремонта, район хороший рядом садик, школа, магазин, аптека.&amp;lt;/p&amp;gt;\r\n',	'Продается 2 комн. квартира в Алуште, под ремонт',	'Продается 2 комн. квартира в Алуште, под ремонт',	'Продается 2 комн. квартира в Алуште, под ремонт',	'Продается 2 комн. квартира в Алуште, под ремонт',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
