(727,	1,	'Продается современная видовая 4-комн. кв в Алуште',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-size:14px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-family: times new roman,times,serif;&amp;quot;&amp;gt;&amp;lt;span data-mce-style=&amp;quot;font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; font-size: 16px; line-height: 21px;&amp;quot; style=&amp;quot;line-height: 21px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size:14px;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-family: times new roman,times,serif;&amp;quot;&amp;gt;Вашему вниманию предлагается большая, красивая 4-х комнатная квартира в Алуште по ул. Б.Хмельницкого.&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt; Квартира вмещает в себя 3 отдельных&amp;amp;nbsp;спальни, просторную кухни и&amp;amp;nbsp;гостиную, 3 санузла, большую гардеробную комнату, 3 лоджии и 2 уютных&amp;amp;nbsp;балкона. Общая&amp;amp;nbsp;площадь 111,3 м. кв., жилая вмещает в себя 54,5 м.кв. Квартира оборудована 2-х контурным газовым&amp;amp;nbsp;котлом, охранной сигнализацией, теплыми полами,&amp;amp;nbsp;спутников ТВ и, конечно же интернетом. &amp;amp;nbsp;Высококачественная отделка, итальянская мебель, удобная планировка, дизайнерский ремонт - все &amp;amp;nbsp;для максимального комфорта! Квартира находится на последнем этаже. Просторные, солнечные лоджии позволят Вам наслаждаться живописной Крымской природой. Хорошо развита инфраструктура. Все документы готовы.&amp;amp;nbsp;&amp;lt;span data-mce-style=&amp;quot;font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; font-size: 16px; line-height: 21px;&amp;quot; style=&amp;quot;line-height: 21px;&amp;quot;&amp;gt;если возникнут вопросы, звоните &amp;amp;nbsp;в любое удобное для вас время, мы все покажем и расскажем!&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается современная видовая 4-комн. кв в Алуште',	'Продается современная видовая 4-комн. кв в Алуште',	'Пр