(811,	1,	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'&amp;lt;p&amp;gt;\r\n	Общей площадью 44.2 кв.м., жилой 15.4 кв.м., кухня 13.7 кв.м., прихожая 7.5 кв .м., сан. узел 5.1 кв.м., балкон 5.3 кв .м. Квартира на 11-м этаже. Потолки 2.7 м. Состояние под отделку. Отопление индивидуальное, из окон открывается вид на парк, горы и море. Дом введен в эксплуатацию в сентябре 2016 года, 14-этажное здание, два лифта: грузовой, пассажирский. Закрытая придомовая территория. Хорошим преимуществом является невысокая цена за обслуживание квартир, 20 руб./кв.м. Многоквартирный дом расположен в 360 метрах от центральной набережной, рядом всё что необходима для комфортного проживания, развитая инфраструктура: магазины, рестораны, кафе, салоны красоты, детский парк, дельфинарий, пляжи, фитнес-центр. Покупая квартиру в этом доме сегодня, Вы удачно инвестируете свои средства на завтра.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы .&amp;lt;/p&amp;gt;\r\n',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продается, купить, куплю, продажа, квартиру, квартира, новостройка, город Алушта,'),
