(732,	1,	'Продается квартиру в новом доме .Утес, г.Алушта',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-size:14px;&amp;quot;&amp;gt;&amp;lt;span data-mce-style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; font-size: 16px;&amp;quot; style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; font-family: Arial,&amp;amp;quot;Helvetica Neue&amp;amp;quot;,Helvetica,sans-serif;&amp;quot;&amp;gt;Квартира площадью 31,9 м.кв. Находится на 6 этаже. Под отделку. &amp;lt;/span&amp;gt;&amp;lt;span data-mce-style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; font-size: 16px;&amp;quot; style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; font-family: Arial,&amp;amp;quot;Helvetica Neue&amp;amp;quot;,Helvetica,sans-serif;&amp;quot;&amp;gt;Квартира оборудована &amp;amp;nbsp;балконами с великолепным видом на парк санатория &amp;quot;Утес&amp;quot;, на замок графини Гагариной санатория) и бескрайнее море. Пляж всего в 150 метрах. &amp;lt;/span&amp;gt;&amp;lt;span data-mce-style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; font-size: 16px;&amp;quot; style=&amp;quot;font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; font-family: Arial,&amp;amp;quot;Helvetica Neue&amp;amp;quot;,Helvetica,sans-serif;&amp;quot;&amp;gt;В доме осталось всего 6 квартир, как с ремонтом, так и без. &amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается квартиру в новом доме .Утес, г.Алушта',	'Продается квартиру в новом доме .Утес, г.Алушта',	'Продается квартиру в новом доме .Утес, г.Алушта',	'Продается квартиру в новом доме .Утес, г.Алушта',	'продажа, квартира, Алушта, купить, ЮБК, Малый Маяк, утес.'),
(733,	1,	'Продаётся трехкомнатная квартира ул. Судакская, Алушта',	'&amp;lt;p style=&amp;quot;font-family: -apple-system-font; font-size: 12px; font-variant-ligatures: normal; font-variant-east-asian: normal; font-variant-position: normal; line-height: 16px;&amp;quot;&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-family:times new roman,times,serif;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;Квартира на 4 этаже. Общая площадь 96 м.кв., не учитывая лоджию и балкон Дом железобетонный , 1986 года постройки. Все комнаты раздельные. Квартира продается с мебелью и всем необходимым оборудованием для комфортного проживания. Установлены новые пластиковые окна и сигнализация. Дом находится в тихом районе города, вся необходимая инфраструктура &amp;amp;nbsp;в пешей доступности. До моря 15 мин. Все документы готовы. &amp;lt;span data-mce-style=&amp;quot;font-family: Arial, \'Helvetica Neue\', Helvetica, sans-serif; line-height: 21px;&amp;quot; style=&amp;quot;line-height: 21px;&amp;quot;&amp;gt;Если возникнут вопросы, звоните &amp;amp;nbsp;в любое удобное для вас время!&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся трехкомнатная квартира ул. Судакская, Алушта',	'Продаётся трехкомнатная квартира ул. Судакская, Алушта',	'Продаётся трехкомнатная квартира ул. Судакская, Алушта',	'Продаётся трехкомнатная квартира ул. Судакская, Алушта',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(734,	1,	'Продаётся 3-х комн. квартира в Алуште, клубный дом закрытого типа',	'&amp;lt;p&amp;gt;\r\n	Продаётся 3-х комн. квартира в Алуште, клубный дом закрытого типа.&amp;lt;br /&amp;gt;\r\n	Квартира находится в центре Алушты по ул. Парковая 5, Дача Доктора &amp;quot;Штэйнгольца&amp;quot;.&amp;lt;br /&amp;gt;\r\n	Общая площадь продаваемой квартиры 110 м² и 51,5 м² открытая террасы, с прекрасным видом на в сторону моря моря.&amp;lt;br /&amp;gt;\r\n	В квартире 2 спальни, большая гостиная 44 кв.м, два санузла, гардероб и прихожая.&amp;lt;br /&amp;gt;\r\n	Квартира наполнена светом и уютом, оборудована дорогостоящей мебелью и техникой.&amp;lt;br /&amp;gt;\r\n	Основная идея этого дома – обеспечение нового, высокого качества жизни.&amp;lt;br /&amp;gt;\r\n	Хорошо развита инфраструктура, собственный пляж, парк, SPA – центр, идеальный сервис, качественная охрана территории.&amp;lt;br /&amp;gt;\r\n	Территория комплекса занимает 3560 м.кв. Придомовой парк благоустроен и оборудован фонтанами, беседками, скульптурами.&amp;lt;br /&amp;gt;\r\n	Также предусмотрены зоны отдыха для взрослых, для детей оборудован современный детский комплекс.&amp;lt;br /&amp;gt;\r\n	Круглогодичный для жильцов комплекса функционируют крытые бассейны, SPA. До кромки воды всего 120 метров.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 3-х комн. квартира в Алуште, клубный дом закрытого типа',	'Продаётся 3-х комн. квартира в Алуште, клубный дом закрытого типа',	'Продаётся 3-х комн. квартира в Алуште, клубный дом закрытого типа',	'Продаётся 3-х комн. квартира в Алуште, клубный дом закрытого типа',	'продажа, квартира, Алушта, купить, ЮБК, центр, берег моря.'),
(735,	1,	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'&amp;lt;p&amp;gt;\r\n	Комплекс расположен на берегу моря, со своей набережной и оборудованный пляжем. Общая площадь продаваемого апартамента 177,6 кв.м., жилая площадь апартамента 102,5 кв.м. В апартаментах, 2 санузла, 2 комнаты которые используются как гардероб. Большая видовая терраса 53 кв.м., с нее открывается потрясающий вид на моря, горы, пляж. Этаж 3, всего же в комплексе 9 этажей. Апартамент полностью укомплектован мебелью и дорогой техникой. Сделан современный евро ремонт, закрытая, охраняемая территория.&amp;lt;/p&amp;gt;\r\n',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'Продается 3 комн. апартаменты в Малом маяке, комплекс «Премьера»',	'продажа, апартомент, Алушта, купить, ЮБК, берег моря.'),
(736,	1,	'Продается VIP квартира в Гурзуфе',	'&amp;lt;p&amp;gt;\r\n	Продается VIP квартира в Гурзуфе.&amp;lt;br /&amp;gt;\r\n	Представляю вашему вниманию квартира расположенную в VIP корпусе комплекса Шато Ришелье. Комплекс имеет закрытую территорию, полностью находящийся под круглосуточной охраной. На территории паркинг, два бассейна, детские площадки, магазин, ресторан. Дом построен в 2008 году и сдан в эксплуатацию. Общая площадь продаваемой квартиры составляет 152 кв.м., из которых кухня 54 кв.м. Квартира расположена на 7 этаже, дом полностью заселен. В квартире 2 санузла, окна смотрят в сторону гор, моря, Гурзуфа. Квартира продается под чистовую отделку, заведены все коммуникации. Стоимость квартиры зафиксирована в рублях.&amp;lt;/p&amp;gt;\r\n',	'Продается VIP квартира в Гурзуфе',	'Продается VIP квартира в Гурзуфе',	'Продается VIP квартира в Гурзуфе',	'Продается VIP квартира в Гурзуфе',	'продажа, квартира, Ялта, купить, ЮБК.'),
(737,	1,	'Продается 2 ком. квартира в Ялте, улица Карла Маркса',	'&amp;lt;p&amp;gt;\r\n	Квартира расположена на набережной Ялты, за Главпочтамтом. Общая площадь продаваемой квартиры 47 кв.м., этаж 2, дом монолитный 2 этажный. Квартира в среднем, жилом состоянии, с высокими 3 метровыми потолками. Закрытая территория дома.&amp;lt;/p&amp;gt;\r\n',	'Продается 2 ком. квартира в Ялте, улица Карла Маркса',	'Продается 2 ком. квартира в Ялте, улица Карла Маркса',	'Продается 2 ком. квартира в Ялте, улица Карла Маркса',	'Продается 2 ком. квартира в Ялте, улица Карла Маркса',	'продажа, квартира, Ялта, купить, ЮБК.'),
(942,	1,	'Продается земельный участок 8.5 соток г. Алушта в с. Лазурное',	'&amp;lt;p&amp;gt;\r\n	Продается земельный участок 8.5 соток г. Алушта в с. Лазурное. Участок с незначительным уклоном, правильной формы, развернут на Юг, с видом в сторону на море и гор. Участок находиться ниже федеральной трассы «Ялта-Симферополь» 1 км. По асфальтированной дороге. До моря 2 км. Хорошие подъездные пути. Удобное месторасположения, находиться между Алуштой и Ялтой. По границе участка проходит газ, есть возможность подключения к электросетям, в 50 метрах столб на 10 кВт.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 8.5 соток г. Алушта в с. Лазурное',	'Продается земельный участок 8.5 соток г. Алушта в с. Лазурное',	'Продается земельный участок 8.5 соток г. Алушта в с. Лазурное',	'Продается земельный участок 8.5 соток г. Алушта в с. Лазурное',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Лазурное'),
(740,	1,	'Продается Вилла в Алуште у подножья &amp;quot;Медведь горы&amp;quot;.',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-family:times new roman,times,serif;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size: 14px;&amp;quot;&amp;gt;Продается великолепная вилла 2016г постройки, расположенная у подножья горы «Медведь» п.Лавровое, воплощающая в себе все лучшие качества региона, прекрасный вид на моря и горы делает это место по истине уникальным. Вилла располагает большой парковой территорией - 45 соток, имеется свой розариум, березовая роща, хвойные насаждения. Основной дом 410 кв.м: цокольный этаж- 100кв.м. (свободного назначения). На 1 этаже большая кухня - гостиная, уборная, спальня, бойлерная. На 2-ом этаже расположены четыре просторные комнаты со своими балконами, а так же сан.узел. Дом выполнен с дизайнерским решением из экологически чистых природных материалов с сейсмоустойчивостью 8-9 баллов, своя автономная система кондиционирования , автономная канализация. Гостевой дом-105 кв.м., 3 этажа, 3-й этаж с большими панорамными окнами с&amp;lt;span id=&amp;quot;chunkItem808&amp;quot;&amp;gt; видом на море, горы. На 2 этаже: комнаты и сан.узел. На территории свой гараж на два авто, с комнатой охраны.&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается Вилла в Алуште у подножья &amp;quot;Медведь горы&amp;quot;.',	'Продается Вилла в Алуште у подножья &amp;quot;Медведь горы&amp;quot;.',	'Продается Вилла в Алуште у подножья &amp;quot;Медведь горы&amp;quot;.',	'Продается Вилла в Алуште у подножья &amp;quot;Медведь горы&amp;quot;.',	'Алушта,Лавровое,продам,куплю,дом,вилла,поместье,Медведь гора,Новая деревня,Партенит,Аю-Даг'),
(743,	1,	'Продаётся участок 15 соток поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся земельный участок 15 соток с шикарным панорамным видом на черное море и горы . Назначение земли ИЖС. Объект расположился у подножия горы &amp;quot;Демерджи&amp;quot;, 7км до города, в пяти мин. пешком центр села, рядом детский сад , магазин, остановка общественного транспорта, чистый воздух, потрясающий вид, все коммуникации на соседних участках, рядом свет, газ, чистейшая вода, хорошая подъездная асфальтированная дорога. Так же есть возможность увеличить площадь земельного участка, купив смежный участок 25 соток.&amp;lt;br /&amp;gt;\r\n	Все документы РФ и готовы к сделки.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 15 соток поселок Лучистое',	'Продаётся участок 15 соток поселок Лучистое',	'Продаётся участок 15 соток поселок Лучистое',	'Продаётся участок 15 соток поселок Лучистое',	'Продам, продажа, куплю, участок, землю, поселок Лучистое'),
(744,	1,	'Продаётся участок 10 соток поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 10 соток поселок Лучистое. Форма земельного участка квадратная 33*33, коммуникации в доступности, рядом проходит газопровод. Хорошие подъездные пути. Открывается замечательный панорамный вид на черное море, горы. Так же есть возможность увеличить площадь земельных участков, купив смежные участки по 10-40 соток&amp;lt;br /&amp;gt;\r\n	Все документы РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 10 соток поселок Лучисто',	'Продаётся участок 10 соток поселок Лучисто',	'Продаётся участок 10 соток поселок Лучисто',	'Продаётся участок 10 соток поселок Лучисто',	'Куплю, продам, участок, землю, поселок Лучистое'),
(745,	1,	'Продаётся участок 40 соток село Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 40 соток поселок Лучистое. Форма земельного участка квадратная 64*64, коммуникации в доступности, рядом проходит газопровод. Хорошие подъездные пути. Открывается замечательный панорамный вид на черное море, горы. Так же есть возможность увеличить площадь земельных участков, купив смежный участок 10-40 соток.&amp;lt;br /&amp;gt;\r\n	Все документы РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 40 соток село Лучистое',	'Продаётся участок 40 соток село Лучистое',	'Продаётся участок 40 соток село Лучистое',	'Продаётся участок 40 соток село Лучистое',	'Продам, продажа, куплю, участок, землю, поселок Лучистое'),
(746,	1,	'Продаётся земельный участок 15 соток поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	Участок с целевым назначением ИЖС, под строительство жилого дома, хороший грунтовый подъезд. Участки поблизости уже строятся, в ста метрах проходит газопровод, электроэнергия, горная кристально чистая вода, вид с участка на моря и город.&amp;lt;br /&amp;gt;\r\n	Все документы РФ и к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся земельный участок 15 соток поселок Лучистое',	'Продаётся земельный участок 15 соток поселок Лучистое',	'Продаётся земельный участок 15 соток поселок Лучистое',	'Продаётся земельный участок 15 соток поселок Лучистое',	'Продам, продажа, куплю, купить, участок, землю, земля, поселок Лучистое'),
(748,	1,	'Продаётся земельный участок 6 соток в Алуште',	'&amp;lt;p&amp;gt;\r\n	Участок находиться в одном из прекрасных городов Южного Берега Крыма - Алуште, славящейся своим целебным воздухом, великолепными большими пляжами. Коммуникации все централизованные: электроэнергия, водоснабжение, газ, канализация. Имеется целевое назначение (ИЖС), под застройку жилого дома. Подъездная асфальтированная дорога, через дорогу большая школа, рядом детский сад, магазины, стоматологическая клиника, пансионат с лечением, общественный транспорт, Алуштинский вин. Завод, район тихий, замечательный вид на город, черное море, горы. Пешком к морю в прогулочном темпе до 20 мин.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ и к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся земельный участок 6 соток в Алуште',	'Продаётся земельный участок 6 соток в Алуште',	'Продаётся земельный участок 6 соток в Алуште',	'Продаётся земельный участок 6 соток в Алуште',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта'),
(749,	1,	'Продаётся действующий отельный бизнес',	'&amp;lt;p&amp;gt;\r\n	Продается действующий отельный бизнес в курортном селе Малореченское, Большая Алушта, к морю 700 м., видовая на черное море, горы. Отличное и выгодное капиталовложение, гостиница представляет собой 1-о этажное здание монолит, общей площадью 492,0 м.кв. Гостиница включает в себя 13 номеров со всеми удобствами, просторная комната отдыха с действующим камином, бильярдная и кухня-столовая общего пользования. Гостиница в хорошем состоянии, продается со всем оборудованием. Подключены свет, вода, канализация, кроме газа. Здание гостиницы расположено на земельном участке 8 соток, участок в собственности. Благоустроенный двор, зона комфортного отдыха, барбекю. Есть возможность проживания и развития курортного бизнеса, для собственников отведена площадь с отдельным входом.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся действующий отельный бизнес ',	'Продаётся действующий отельный бизнес',	'Продаётся действующий отельный бизнес',	'Продаётся действующий отельный бизнес',	'Продам, продаю, куплю, участок, отель, бизнес, Малореченское '),
(747,	1,	'Продается участок 10,58 соток поселок Семидворье, микрорайон Дельфин',	'&amp;lt;p&amp;gt;\r\n	Продается участок 10,58 соток поселок Семидворье, микрорайон Дельфин. С земельного участка открывается прекрасный вид на море, расположен в микрорайоне «Дельфин» с целевым назначением (ИЖС), участок относительно ровный, хорошее и удобное место под строительства жилого дома в пределах города, немного округлой формы, на автомобиле 5 минут к морю. Подъездная асфальтированная дорога, рядом свет, централизованное водоснабжение.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ и к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 10,58 соток поселок Семидворье, микрорайон Дельфин',	'Продается участок 10,58 соток поселок Семидворье, микрорайон Дельфин',	'Продается участок 10,58 соток поселок Семидворье, микрорайон Дельфин',	'Продается участок 10,58 соток поселок Семидворье, микрорайон Дельфин',	'Продам, Продажа, Продаю, Куплю, участок, землю, Семидворье, Дельфин, Алушта'),
(750,	1,	'Продаётся участок 30 соток в Алуште',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 30 соток в Алуште. Земля находится от Алушты в 1км. в направление к Судаку, в доль дороги. Участо ровный, асфальтный подъезд, коммуникации все рядом. Уникальность места заключается в близости к городу и доступности инфраструктуры. Место прекрасно подойдет под видение бизнеса, в том числе мотель, торговый центр, ресторан, мойка, заправка и т.д. Участки смежные, получены кадастровые паспорта РФ, целевое назначение (ИЖС). Стоимость по 2 млн за 10 соток или 6 млн за 30 соток.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Пакет документов РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 30 соток в Алуште',	'Продаётся участок 30 соток в Алуште',	'Продаётся участок 30 соток в Алуште',	'Продаётся участок 30 соток в Алуште',	'Куплю, участок, продаётся, земля, продажа, в Алуште,'),
(751,	1,	'Продаётся участок 10 соток в Алуште по ул. Сергея Ценского',	'&amp;lt;p&amp;gt;\r\n	Продается участок 10 соток в Алуште с домом под снос. Земельный участок расположен в районе улицы Сергеева-Ценского, абсолютно ровный, имеет прямоугольную форму. На участки стоит ветхий дом под снос, коммуникации все по границы участка. Хорошие подъездные пути. С места открывается прекрасный вид на моря и горы.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Пакет документов РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 10 соток в Алуште по ул. Сергея Ценского',	'Продаётся участок 10 соток в Алуште по ул. Сергея Ценского',	'Продаётся участок 10 соток в Алуште по ул. Сергея Ценского',	'Продаётся участок 10 соток в Алуште по ул. Сергея Ценского',	'Продаётся, участок, куплю, купить, продажа, в Алуште, Сергея Ценского,'),
(752,	1,	'Срочно продаётся участок 10 соток село Лаванда',	'&amp;lt;p&amp;gt;\r\n	Срочно продается земельный участок 10 соток в селе Лаванда. Участок правильной формы, под строительство жилого дома, есть в продаже смежный участок. Подъездная дорога асфальтная, расположения рельефа умеренный, участок развернутый к морю, коммуникации в доступности. Отлично подойдет под строительство жилого дома, дачи.&amp;lt;br /&amp;gt;\r\n	Весь пакет документов РФ к сделки готов.&amp;lt;/p&amp;gt;\r\n',	'Срочно продаётся участок 10 соток село Лаванда',	'Срочно продаётся участок 10 соток село Лаванда',	'Срочно продаётся участок 10 соток село Лаванда',	'Срочно продаётся участок 10 соток село Лаванда',	'Продаётся, участок, куплю, купить, продажа, в Лаванде'),
(753,	1,	'Продаётся участок 25 соток поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся видовой земельный участок 25 соток с шикарным панорамным видом в море и на горы. Назначение земли ИЖС. Объект расположился у подножия горы &amp;quot;Демерджи&amp;quot;, 7км до города, в пяти минутах ходьбы пешком центр села, рядом детский сад, магазин, остановка общественного транспорта, чистый горный воздух, потрясающий удивительный вид, коммуникации на соседних участках, рядом электроэнергия, газ, чистейшая вода, хорошая подъездная асфальтная дорога. Плюсом есть возможность увеличить площадь земельного участка, купив смежный участок 15 соток.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделке готов.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 25 соток поселок Лучистое',	'Продаётся участок 25 соток поселок Лучистое',	'Продаётся участок 25 соток поселок Лучистое',	'Продаётся участок 25 соток поселок Лучистое',	'Продам, продажа, куплю, участок, землю, поселок Лучистое'),
(755,	1,	'Продаётся новый дом в Алуште ул. Богдана Хмельницкого',	'&amp;lt;p&amp;gt;\r\n	Продается новый дом в Алуште, по улице Б.Хмельницкого. Дом расположен ниже улицы Богдана Хмельницкого в зеленном массиве, в окружении реликтовых и лиственных деревьев. Общая площадь продаваемого дома составила 200 кв.м., дом состоит из 3-х этажей и стоит на земельном участки 3 сотки. Будут сделаны все фасадные работы, все стены по периметру участка и дом будет готов под внутреннею отделку. Дом весь монолитный, деревянные в нем только балконы, рядом же строиться еще точно такой же дом, который тоже можно приобрести.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся новый дом в Алуште ул. Богдана Хмельницкого',	'Продаётся новый дом в Алуште ул. Богдана Хмельницкого',	'Продаётся новый дом в Алуште ул. Богдана Хмельницкого',	'Продаётся новый дом в Алуште ул. Богдана Хмельницкого',	'Продаётся, продажа, купить, куплю, дом, в Алуште '),
(756,	1,	'Продаётся дом в Алуште, село Нижняя Кутузовка',	'&amp;lt;p&amp;gt;\r\n	Общая площадь продаваемого дома 165 кв.м., дом очень просторный и уютный, жилая площадь дома 72 кв.м. Земельный участок 12 соток, все в собственности, ухоженная территория, фонтан, сад. В доме 3 жилые комнаты, один санузел, дорогая отделка, мебель.&amp;lt;br /&amp;gt;\r\n	Весь пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом в Алуште, село Нижняя Кутузовка',	'Продаётся дом в Алуште, село Нижняя Кутузовка',	'Продаётся дом в Алуште, село Нижняя Кутузовка',	'Продаётся дом в Алуште, село Нижняя Кутузовка',	'Куплю, купить, продаётся, продажа, дом, в Алуште, Нижняя Кутузовка'),
(757,	1,	'Продаётся гостиница в Алуште по ул. Багликова',	'&amp;lt;p&amp;gt;\r\n	Площадь гостиницы составляет 186 кв.м., земельный участок 1,67 соток. Строение а так же земля в собственности. Номеров в гостиницы 9 из которых: 8 однокомнатных номеров и 1 двух комнатный. Во каждом номере свой сан.узел, кондиционер. Год постройки 2014. К гостиницы подведены все коммуникации, на территории есть свой колодец с водой.&amp;lt;br /&amp;gt;\r\n	Полный пакет документов РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся гостиница в Алуште по ул. Багликова',	'Продаётся гостиница в Алуште по ул. Багликова',	'Продаётся гостиница в Алуште по ул. Багликова',	'Продаётся гостиница в Алуште по ул. Багликова',	'Продаётся, гостиница, купить, куплю, в Алуште, продажа,'),
(758,	1,	'Продаётся 2-х комнатная квартира в Алуште по ул. Б. Хмельницкого',	'&amp;lt;p&amp;gt;\r\n	Вся площадь продаваемой квартиры составляет 54 кв.м., сделан современный ремонт. Дом свежий, построй 2008 года, на весь дом своя отдельная котельная, чистый лифт, в доме стоит домофон. Дом 9 этажный, продаваемая квартира расположена на 9 этаже, этаж не последний по-тому что крыша тоже жилая. В доме на первом этаже магазин, остановка общественного транспорта в 150 метрах, тихий, спальный район.&amp;lt;br /&amp;gt;\r\n	Весь пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 2-х комнатная квартира в Алуште по ул. Б. Хмельницкого',	'Продаётся 2-х комнатная квартира в Алуште по ул. Б. Хмельницкого',	'Продаётся 2-х комнатная квартира в Алуште по ул. Б. Хмельницкого',	'Продаётся 2-х комнатная квартира в Алуште по ул. Б. Хмельницкого',	'Продаётся, куплю, купить, продажа, квартира, в Алуште'),
(759,	1,	'Продаётся 1 комнатная квартира в Алуште по ул. Таврическая',	'&amp;lt;p&amp;gt;\r\n	Продается 1 к.кв. в Алуште, ул. Таврическая. Общая площадь продаваемой квартиры 31 кв.м., лоджия 7 кв.м. Квартира расположена на первом этаже, всего в доме их 5. Отопление централизованное, лоджия переоборудована в кухню, сделаны теплые электрические полы, установлена газовая колонка, санузел совмещенный. В квартире установлен кондиционер, в подъезде стоит домофон.&amp;lt;br /&amp;gt;\r\n	Весь пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 1 комнатная квартира в Алуште по ул. Таврическая',	'Продаётся 1 комнатная квартира в Алуште по ул. Таврическая',	'Продаётся 1 комнатная квартира в Алуште по ул. Таврическая',	'Продаётся 1 комнатная квартира в Алуште по ул. Таврическая',	'Продаётся, куплю, купить, продажа, квартира, в Алуште'),
(760,	1,	'Продаются два дома в Лучистом, город Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продаются два дома в Лучистом, город Алушта. Совместная площадь двух продаваемых домов составляет 256 кв.м., расположены на земельном участки 12 соток, при желании участок возможно увеличить за счет покупки смежного участка 14 соток. Внутрянка дома под отделку, внешняя сделана практически вся, выложены огромные подпорные стены с целью сохранения вида и укрепления участка. Коммуникации: заведены на участок вода и свет, газовая труба проходит в 50 метрах, есть возможность подключения. Дом строился для одной большой семьи, но так как он с отдельными входами, с отдельными территориями, заездами, возможно проживания для двух семей, соответственно купить дома можно и по отдельности. Площадь отдельного дома составит 128 кв.м., с участком в 600 кв.м. С участка открывается прекрасный вид на город, горы и моря. Стоимость 120 000 долларов за 2 дома или 65 000 дол. за пол дома.&amp;lt;br /&amp;gt;\r\n	Полный пакет документы РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаются два дома в Лучистом, город Алушта.',	'Продаются два дома в Лучистом, город Алушта.',	'Продаются два дома в Лучистом, город Алушта.',	'Продаются два дома в Лучистом, город Алушта.',	'Продаётся, продажа, купить, куплю, дом, в Алуште, Лучистое'),
(761,	1,	'Продается 2 комнатная квартира в Алуште, улица Пригородная.',	'&amp;lt;p&amp;gt;\r\n	Квартира расположена в районе микрорайона Мирный по улицы Пригородная д.5а. Дом 11 этажный квартира находиться на первом этаже, этаж первый высокий. Общая площадь продаваемой квартиры составляет 49,3 кв.м., отопление центральное. Санузел раздельный, лоджия и балкон застеклены, установлен кондиционер. Продается с мебелью и техникой, квартира чистая и ухоженная, состояние хорошее. Рядом с домом остановка, магазин, детская площадка, место для авто, аптека.&amp;lt;/p&amp;gt;\r\n',	'Продается 2 комнатная квартира в Алуште, улица Пригородная.',	'Продается 2 комнатная квартира в Алуште, улица Пригородная.',	'Продается 2 комнатная квартира в Алуште, улица Пригородная.',	'Продается 2 комнатная квартира в Алуште, улица Пригородная.',	'Продам, Алушта,квартира,Пригородная,куплю'),
(763,	1,	'Продаётся шикарный жилой дом в селе Лучистое г. Алушта ',	'&amp;lt;p&amp;gt;\r\n	Продается красивый жилой дом в живописном горном селе Лучистое, г.Алушта. Дом построен в 2 этажа, общий площадью в 197,4 м.кв. Состояние дома просто превосходное. Произведен высококачественный ремонт с использованием дорогостоящих строй. материалов. Продаётся полностью с дорогостоящей мебелью и техникой. Подведены все инженерные сети (электроэнергия, водоснабжение, газ), асфальтированная подъездная дорога, за отопление и подачу горячей воды отвечает сверхмощный 2-х контурный газовый котел (по всему дому установлена сис-ма &amp;quot;теплый пол&amp;quot;). На территории свой собственный бассейн. Из окон дома и с открытой террасы завораживающий по истине великолепный панорамный вид на море, город и горы. Экологически чистый и полезный воздух, кристально чистая горная вода. Дом построен на земельном участке в 7,5 соток (ИЖС).&amp;lt;br /&amp;gt;\r\n	Весь пакет документов РФ к сделки готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся шикарный жилой дом в селе Лучистое г. Алушта ',	'Продаётся шикарный жилой дом в селе Лучистое г. Алушта ',	'Продаётся шикарный жилой дом в селе Лучистое г. Алушта ',	'Продаётся шикарный жилой дом в селе Лучистое г. Алушта ',	'Продаётся, продажа, купить, куплю, дом, в Алуште, Лучистое'),
(764,	1,	'Продаётся помещение свободного пользования в центре  города Алушта',	'&amp;lt;p&amp;gt;\r\n	Продажа помещения свободного пользования, площадью 133 .7кв.м. в центре г. Алушта. Подходит для всех сфер коммерческой деятельности. Строение 3 этажа, хороший ремонт, пожарная сигнализация, пультовая охрана, удобный подъезд автотранспорта.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся помещение свободного пользования в центре  города Алушта',	'Продаётся помещение свободного пользования в центре  города Алушта',	'Продаётся помещение свободного пользования в центре  города Алушта',	'Продаётся помещение свободного пользования в центре  города Алушта',	'Прдаётся, куплю, купить, продажа, помещение, Алушта'),
(765,	1,	'Продаётся двухкомнатная квартира в 5 минутах от моря г. Алушта',	'&amp;lt;p&amp;gt;\r\n	Идеально подойдёт для проживания или курортного бизнеса, идеальное капиталовложение с постоянным доходом, квартира день в день сдаётся весь год. Квартиру можно рассматривать как коммерческое помещение под офис, салон красоты, магазинчик. Рядом горисполком, банк Россия, центральный рынок, школа, детский сад, продуктовые магазины «Фуршет и ПУД». Отличная транспортная развязка. Вся площадь квартиры 33 м.кв.,жилой 22.3 м.кв. (две комнаты, первая 13.1 м.кв., вторая 9.2 м.кв.), кухня 6 м.кв., площ.прихожей 2.5 м.кв. и совмещенный санузел. В квартире стоит все для Вашего комфортабельного проживания. Летом прохладно, а зимой очень тепло, дом построенный из инкерманского камня. Закрытый и ухоженный зеленый дворик. Окна выходят на кипарисную и кедровую аллею.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Полный пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся двухкомнатная квартира в 5 минутах от моря г. Алушта',	'Продаётся двухкомнатная квартира в 5 минутах от моря г. Алушта',	'Продаётся двухкомнатная квартира в 5 минутах от моря г. Алушта',	'Продаётся двухкомнатная квартира в 5 минутах от моря г. Алушта',	'Продаётся, куплю, купить, продажа, продаётся, квартира, квартиру, в Алуште'),
(766,	1,	'Продаётся коттедж в Алуште, район Восточной набережной',	'&amp;lt;p&amp;gt;\r\n	Продаётся коттедж в городе Алушта, район Восточной набережной берег моря. Комплекс коттеджей размещается у берега черного моря в г. Алушта. Коттедж общей площадью в 204 м.кв.,выстроенных 3 этажа с дорогой отделочной работой и мебелью. 1-й этаж: просторная комната для отдыха, санузел, гардеробная, кладовая, сауна. 2-й этаж: кухня студия с выходом на террасу, санузел. 3-й этаж: 2 спальные комнаты, балкончик, санузел. Во всех комнатах установлен кондиционер, так же остается вся мебель и техника. Перед комплексом своих два пляжа, магазинчик, аптека. Собственник один, не в браке, прописанных людей нет.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся коттедж в Алуште, район Восточной набережной',	'Продаётся коттедж в Алуште, район Восточной набережной',	'Продаётся коттедж в Алуште, район Восточной набережной',	'Продаётся коттедж в Алуште, район Восточной набережной',	'Продаётся, продажа, купить, куплю, коттедж, дом, в Алуште, берег моря.'),
(767,	1,	'Продаётся дом 450 кв.м. в Алуште, село Нижняя Кутузовка',	'&amp;lt;p&amp;gt;\r\n	Вся площадь продаваемого дома составляет 450 кв.м., в котором 162кв.м. жилой площади. Земельный участок в 12 соток, в собственности, дом 3 эт., с хорошим ремонтом . В доме пять спальных комнат, три санузла, гараж, сауна, тех. помещения, просторная кухня, видовые террасы. Подведены коммуникации: газ, вода и электроэнергия, установлен хороший газовый котел. Асфальтированная подъездная дорога, добрые и хорошие соседи. Из окон открывается превосходный вид на горы и моря. До города и моря 4-5 километров.&amp;lt;br /&amp;gt;\r\n	Полный пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом 450 кв.м. в Алуште, село Нижняя Кутузовка',	'Продаётся дом 450 кв.м. в Алуште, село Нижняя Кутузовка',	'Продаётся дом 450 кв.м. в Алуште, село Нижняя Кутузовка',	'Продаётся дом 450 кв.м. в Алуште, село Нижняя Кутузовка',	'Куплю, купить, продаётся, продажа, дом, в Алуште, Нижняя Кутузовка'),
(768,	1,	'Продаётся дом в Алуште по ул. Багликова',	'&amp;lt;p&amp;gt;\r\n	Общей площадью дома в 250 м.кв., земельный участок две сотки, в собственности. Свежий ремонт, теплые полы, в доме газовый котел и колонка, все коммуникации в доме централизованные. Удобная транспортная развязка, до супермаркета 2 мин., район ул. Багликова. Возможность использовать под гостиницу, в доме 10 комнат.&amp;lt;br /&amp;gt;\r\n	Весь пакет документов РФ, к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом в Алуште по ул. Багликова',	'Продаётся дом в Алуште по ул. Багликова',	'Продаётся дом в Алуште по ул. Багликова',	'Продаётся дом в Алуште по ул. Багликова',	'Куплю, купить, продаётся, продажа, дом, гостиница, в Алуште'),
(769,	1,	'Продаётся новый дом г. Алушта село Верхняя Кутузовка',	'&amp;lt;p&amp;gt;\r\n	Продаётся дом в селе Верхняя Кутузовка, (ниже трассы Ялта-Симферополь). Общая площадь строения приблизительно 300 кв. Цоколь, этаж, мансарда, 2 балкона, два санузла. Отопление в планах, стоит электрический котел, в перспективе газ (газопровод проходит в ста метрах). Под чистовую отделку. Из окон дома и двора открывается замечательный панорамный вид на море, кутузовское водохранилище, горы. Подъездной путь: асфальтная дорога, 50 м.грунт. Тип постройки – монолит с заполнением (газоблоками). В наличии тех.условия под электроэнергию. Вода в перспективе своя скважина, Земельный участок 6,1 сотки, в собственности.&amp;lt;br /&amp;gt;\r\n	Весь пакет документов РФ, к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся новый дом г. Алушта село Верхняя Кутузовка',	'Продаётся новый дом г. Алушта село Верхняя Кутузовка',	'Продаётся новый дом г. Алушта село Верхняя Кутузовка',	'Продаётся новый дом г. Алушта село Верхняя Кутузовка',	'Куплю, купить, продаётся, продажа, дом, в Алуште, Верхняя Кутузовка'),
(770,	1,	'Продается просторная 2-х комнатная квартира в новом комплексе в г.Алушта',	'&amp;lt;p&amp;gt;\r\n	Продается просторная 2-х комнатная квартира в новом жилом комплексе в г.Алушта (дому всего 5 лет).&amp;lt;br /&amp;gt;\r\n	Квартира общей площадью 70,4 м.кв. (без учета лоджии 8 м.кв.)&amp;lt;br /&amp;gt;\r\n	расположена на 16 этаже/16 этажного монолитного дома,&amp;lt;br /&amp;gt;\r\n	что позволит Вам круглосуточно любоваться великолепными панорамными видами на город и горы.&amp;lt;br /&amp;gt;\r\n	16-й этаж не последний, над ним есть еще технический этаж. Состояние квартиры - под отделку.&amp;lt;br /&amp;gt;\r\n	Дом представляет собой новый жилой комплекс с закрытой ухоженной придомовой территорией,&amp;lt;br /&amp;gt;\r\n	круглосуточной охраной. К Вашим услугам подземный паркинг.&amp;lt;br /&amp;gt;\r\n	Дом расположен в тихом спальном районе города с развитой инфраструктурой:&amp;lt;br /&amp;gt;\r\n	в пешей доступности находятся магазины, детский сад, остановки общественного транспорта.&amp;lt;br /&amp;gt;\r\n	До моря - 15 минут ходьбы. Звоните! Ответим на все дополнительные вопросы!&amp;lt;/p&amp;gt;\r\n',	'Продается просторная 2-х комнатная квартира в новом комплексе в г.Алушта',	'Продается просторная 2-х комнатная квартира в новом комплексе в г.Алушта',	'Продается просторная 2-х комнатная квартира в новом комплексе в г.Алушта',	'Продается просторная 2-х комнатная квартира в новом комплексе в г.Алушта',	'Продам, Алушта,квартира,элитное жилье,новострой,куплю'),
(771,	1,	'Продается просторная уютная 2-х комнатная квартира в пгт.Партенит, г.Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается просторная уютная 2-х комнатная квартира в пгт.Партенит, г.Алушта.&amp;lt;br /&amp;gt;\r\n	Квартира общей площадью 64,4 м.кв. расположена на 1-ом этаже/6-и этажного дома. Год постройки дома - 2011.&amp;lt;br /&amp;gt;\r\n	В квартире выполнен качественный ремонт. Продается с мебелью и техникой.&amp;lt;br /&amp;gt;\r\n	Квартира полностью готова для Вашего комфортного летнего отдыха или постоянного проживания.&amp;lt;br /&amp;gt;\r\n	Дом отапливается индивидуальной котельной, для подачи горячей воды установлен электрический бойлер.&amp;lt;br /&amp;gt;\r\n	Дом расположен в тихом живописном районе курортного поселка Партенит.&amp;lt;br /&amp;gt;\r\n	В пешей доступности расположены все необходимые для жизни объекты инфраструктуры:&amp;lt;br /&amp;gt;\r\n	кафе, магазины, аптека, остановка общественного транспорта.&amp;lt;br /&amp;gt;\r\n	А к пляжу всего 5 минут ходьбы через ухоженный парк санатория.&amp;lt;br /&amp;gt;\r\n	Расстояние до города Алушта - 14 км, до Ялты - 15 км.&amp;lt;/p&amp;gt;\r\n',	'Продается просторная уютная 2-х комнатная квартира в пгт.Партенит, г.Алушта.',	'Продается просторная уютная 2-х комнатная квартира в пгт.Партенит, г.Алушта.',	'Продается просторная уютная 2-х комнатная квартира в пгт.Партенит, г.Алушта.',	'Продается просторная уютная 2-х комнатная квартира в пгт.Партенит, г.Алушта.',	'Продам, Алушта,квартира,Партенит,куплю'),
(772,	1,	'Продается 1-о комнатная квартира (апартаменты) в живописном курортном поселке Партенит,г.Алушта.',	'&amp;lt;p&amp;gt;\r\n	Предлагаем Вам стать владельцем собственных уютных апартаментов в самом сердце Партенита.&amp;lt;br /&amp;gt;\r\n	Апартаменты общей площадью 36,2 м.кв. расположены на 1 (высоком) этаже /11 этажного дома (дому всего 9 лет).&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;Квартира светлая, теплая. Состоит из просторной кухни-гостинной, спальни, санузла и прихожей.&amp;lt;br /&amp;gt;\r\n	Во всех помещениях, кроме спальни, установлена система &amp;quot;теплый пол&amp;quot;.&amp;lt;br /&amp;gt;\r\n	Квартира в хорошем жилом состоянии, продается&amp;amp;nbsp; с мебелью и техникой.&amp;lt;br /&amp;gt;\r\n	Дополнительно имеется кладовое помещение (1 м.кв.) для хранения различной домашней утвари,&amp;lt;br /&amp;gt;\r\n	прикрепленное к данной квартире. Для Вашего удобства в доме функционирует подземный паркинг&amp;lt;br /&amp;gt;\r\n	и круглогодичный продовольственный магазин. В пешей доступности расположены и другие объекты инфраструктуры:&amp;lt;br /&amp;gt;\r\n	кафе, магазины, остановка общественного транспорта.&amp;lt;br /&amp;gt;\r\n	А до пляжа всего 5 минут ходьбы через ухоженный парк санатория. Возможна рассрочка!&amp;lt;/p&amp;gt;\r\n',	'Продается 1-о комнатная квартира (апартаменты) в живописном курортном поселке Партенит,г.Алушта.',	'Продается 1-о комнатная квартира (апартаменты) в живописном курортном поселке Партенит,г.Алушта.',	'Продается 1-о комнатная квартира (апартаменты) в живописном курортном поселке Партенит,г.Алушта.',	'Продается 1-о комнатная квартира (апартаменты) в живописном курортном поселке Партенит,г.Алушта.',	'Продам, Алушта,квартира,Партенит,куплю'),
(773,	1,	'Продаются уютные 3-х комнатные апартаменты в  поселке Партенит, г.Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продаются уютные 3-х комнатные апартаменты в самом центре курортного поселка Партенит, г.Алушта.&amp;lt;br /&amp;gt;\r\n	3-х комнатные апартаменты общей площадью 114,3 м.кв. расположены на 5 этаже/9 этажного монолитного дома&amp;lt;br /&amp;gt;\r\n	(дому всего 5 лет). Апартаменты в отличном состоянии, продаются с мебелью и техникой.&amp;lt;br /&amp;gt;\r\n	Для Вашего удобства, помимо 3-х раздельных спален, апартаменты оснащены двумя санузлами и&amp;lt;br /&amp;gt;\r\n	просторной кухней-гостинной. В каждой спальне установлен кондиционер, дополнительно - система &amp;quot;теплый пол&amp;quot;.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;Вся мебель, бытовая и сантехника высокого качества от известных мировых производителей.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;Апартаменты оборудованы двумя балконами, с которых открывается великолепный панорамный вид на курортный&amp;lt;br /&amp;gt;\r\n	поселок Партенит, парк санатория и море. Удобное месторасположение дома позволяет&amp;lt;br /&amp;gt;\r\n	Вам без труда добраться к любому объекту инфраструктуры за считанные минуты.&amp;lt;br /&amp;gt;\r\n	А до моря всего 5 минут ходьбы прогулочным шагом через красивый ухоженный парк санатория.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаются уютные 3-х комнатные апартаменты в  поселке Партенит, г.Алушта.',	'Продаются уютные 3-х комнатные апартаменты в  поселке Партенит, г.Алушта.',	'Продаются уютные 3-х комнатные апартаменты в  поселке Партенит, г.Алушта.',	'Продаются уютные 3-х комнатные апартаменты в  поселке Партенит, г.Алушта.',	'Продам, Алушта,квартира,Партенит,куплю,элитное жилье'),
(774,	1,	'Продаётся видовой участок 8 соток в Алуште',	'&amp;lt;p&amp;gt;\r\n	К морю 100 метров, красивейший панорамный вид, до центральной набережной 500 метров через парк, внизу находится реставрированная набережная и облагороженные пляжи. По коммуникациям, есть тех условия на свет и воду. По документам, украинский госакт и российский кадастровый паспорт на руках.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;lt;span&amp;gt;Документы РФ к сделки готовы.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся видовой участок 8 соток в Алуште',	'Продаётся видовой участок 8 соток в Алуште',	'Продаётся видовой участок 8 соток в Алуште',	'Продаётся видовой участок 8 соток в Алуште',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта'),
(775,	1,	'Продаётся коттедж в Алуште',	'&amp;lt;p&amp;gt;\r\n	Продаётся коттедж в г&amp;amp;nbsp;. Алушта. Общей площадью коттеджа в 248.1 кв.м., расположенный в закрытом коттеджном поселке из 10 коттеджей. На территории детская площадка, бассейн, подземный паркинг на 2 авто. К морю пешком всего 150 метров. Коттедж полностью с ремонтом, продаётся с мебелью. Коттедж введен в эксплуатацию с 2009 года. Все коттеджи имеют по три этажа, по два входа, 3-4 спальни. Холл с камином, прекрасный вид из окон, рядом Алуштинский аквапарк.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся коттедж в Алуште',	'Продаётся коттедж в Алуште',	'Продаётся коттедж в Алуште',	'Продаётся коттедж в Алуште',	'Продаётся, продажа, купить, куплю, коттедж, дом, в Алуште'),
(776,	1,	'Продаётся видовой пентхаус в Алуште',	'&amp;lt;p&amp;gt;\r\n	Продаётся видовой пентхаус в г. Алушта. Комплекс расположен в 150 метрах к морю, в комплекс входят три отдельно стоящих квартирных дома. На территории своя детская площадка, бассейн, паркинг. Круглосуточная охрана. Общая площадь пентхауса составляет 126,3 кв.м., этаж 5-6. Из окон открывается превосходный вид на море и горы, а так же Алуштинский аквапарк, сделана разводка электричества, поставлены кондиционеры, положен кафель, установлены санузлы.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся видовой пентхаус в Алуште',	'Продаётся видовой пентхаус в Алуште',	'Продаётся видовой пентхаус в Алуште',	'Продаётся видовой пентхаус в Алуште',	'Продаётся, купить, дом, пентхаус, куплю, квартира, коттедж, Алушта,'),
(777,	1,	'Продается хороший участок 8 соток г. Алушта, возле санатория Ветеран',	'&amp;lt;p&amp;gt;\r\n	Продается хороший участок 8 соток г. Алушта, возле санатория Ветеран. Участок имеет правильную и прямоугольную форму, ровный. Подъездная хорошая асфальтная дорога. По краям от участка достраиваются дома, хорошие соседи, с участка открывается отличный вид на город и горы. Коммуникации уже на соседних участках, мощности есть. Район хорошо застраиваемый, удобная транспортная развязка, до остановке в город 2 минуты машиной, пешим шагом 5-7 минут.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается хороший участок 8 соток г. Алушта, возле санатория Ветеран',	'Продается хороший участок 8 соток г. Алушта, возле санатория Ветеран',	'Продается хороший участок 8 соток г. Алушта, возле санатория Ветеран',	'Продается хороший участок 8 соток г. Алушта, возле санатория Ветеран',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта'),
(778,	1,	'Продаётся шикарный участок 36 соток в селе Лучистое г. Алушта',	'&amp;lt;p&amp;gt;\r\n	Продается участок 36 соток в селе Лучистое, г.Алушта. Участок продолговатой прямоугольной формы, протягивается вдоль дороги. Подъездные пути асфальтированная дорога, рядом коммуникации, ровный рельеф. Открывается изысканный вид на город, горы и моря. При Вашем желании можно поделить участок. Участок правильной формы, пролегает вдоль дороги которая идет через весь поселок. До поселка 1-2 минуты на машине, ходит общественный транспорт в город, есть школа, садик, магазины. Коммуникации в доступности, асфальтированный подъезд, участок ровный, прекрасно подойдет под застройку отеля, кемпинга или жилого дома.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся шикарный участок 36 соток в селе Лучистое г. Алушта',	'Продаётся шикарный участок 36 соток в селе Лучистое г. Алушта',	'Продаётся шикарный участок 36 соток в селе Лучистое г. Алушта',	'Продаётся шикарный участок 36 соток в селе Лучистое г. Алушта',	'Продам, продажа, куплю, участок, землю, поселок Лучистое, Алушта'),
(810,	1,	'Продается дом в г. Алушта поселок Лазурное',	'&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Дом в три этажа + мансарда, общей площадью 700 кв.м. на участке в 10 соток, есть проект, соблюдены все нормы сейсмоустойчивости в 8-9 балов, конструкция представляет собой монолитный каркас с заполнением ракушечника экологически чистого природного камня с кирпичными перегородками. Дом строился для себя, стадия завершения 80%, планировался под сдачу номеров, по проекту 9 полноценных номеров с отдельными сан. Узлами с хорошим видом на море и горы, по проекту три отдельных входа в дом, так же в доме по плану есть место под сауна. Первый и второй этаж под чистовую отделку, на первом этаже сделана стяжка и заведены теплые полы. Хорошие подъездные пути, асфальтированная дорога, заведены все коммуникации свет, вода, централизованная канализация, кроме газа (перспектива в течение года). До моря всего 300 метров по асфальтированной дороге и Вы попадаете на набережную с чистыми и просторными пляжами.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается дом в г. Алушта поселок Лазурное',	'Продается дом в г. Алушта поселок Лазурное',	'Продается дом в г. Алушта поселок Лазурное',	'Продается дом в г. Алушта поселок Лазурное',	'Купить, куплю, продажа, продам, дом, Алушта, Лазурное'),
(780,	1,	'Продаётся дом 450 кв.м. в селе Лучистое г. Алушта',	'&amp;lt;p&amp;gt;\r\n	Вся площадь дома составляет 450 кв.м., 2 этажа цокольный этаж, дом под отделку. Панорамные окна, материал: дом выполнен из железо-бетона, заполнение ракушечник. Земельный участок 19 соток, участок ровный, по всему периметру качественные бутовые стены, все коммуникации возле дома, отличный асфальтированный подъезд, потрясающий панорамный вид на горы, море и город. В селе есть все необходимое для жизни: садик, школа, магазин, ходит общественный транспорт, мед. Пункт. До г. Алушта 8 км., машиной 10 минут и Вы на месте.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Полный пакет документов РФ, к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом 450 кв.м. в селе Лучистое г. Алушта',	'Продаётся дом 450 кв.м. в селе Лучистое г. Алушта',	'Продаётся дом 450 кв.м. в селе Лучистое г. Алушта',	'Продаётся дом 450 кв.м. в селе Лучистое г. Алушта',	'Продаётся, продажа, купить, куплю, дом, в Алуште, Лучистое'),
(781,	1,	'Продаётся 3 смежных участка по 7.5 соток в курортном городе Алушта',	'&amp;lt;p&amp;gt;\r\n	Продаётся 3 смежных участка в курортном городе Алушта, микрорайон Профессорский уголок. Каждый участок 7.5 соток с целевым назначением (ИЖС). Так же плюсом есть то, что участки можно купить как вместе так и раздельно, при сильном желании можно увеличить площадь приобретя соседние участки. Коммуникации все в доступности, район успешно развивается, проложена дорога к участкам, сейчас к участкам прокладывают газовую трубу, много зелени, чистый воздух, тихое и спокойное место. До моря всего 5-7 минут ходьбы и попадаете на прекрасную набережную, где Вас ждут ухоженные, чистые и большие пляжи. Отличное видовое место, открывается вид на черное моря, горы.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 3 смежных участка по 7.5 соток в курортном городе Алушта',	'Продаётся 3 смежных участка по 7.5 соток в курортном городе Алушта',	'Продаётся 3 смежных участка по 7.5 соток в курортном городе Алушта',	'Продаётся 3 смежных участка по 7.5 соток в курортном городе Алушта',	'Продам, продаётся, продажа, куплю, купить, участок, землю, земля, Алушта, Профессорский Уголок'),
(782,	1,	'Продается дом в Профессорском уголке, г.Алушта',	'&amp;lt;p&amp;gt;\r\n	Дом расположен в красивом и тихом районе, вдали от городской суеты, много зеленых насаждений, в шаговой доступности ухоженные пляжи. Общая площадь дома 250 кв.м., 2 сотки земли, 3 этажа, мансарда. На первом этаже гаражное помещение на два автомобиля. В доме 4 жилых просторных комнаты, большая кухня-студия. На каждом из этажей есть санузел. Отопление дома обеспечивается мощным 2-х контурным газовым котлом, установлены кондиционеры. Абсолютно новый дом с качественным дизайнерским ремонтом, с новой мебелью. Хорошая асфальтированная дорога ведущая к дому. До моря всего 150 метров. Отличный дом для постоянного проживания и летнего отдыха в красивом южном городе.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Весь пакет документов РФ, к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается дом в Профессорском уголке, г.Алушта',	'Продается дом в Профессорском уголке, г.Алушта',	'Продается дом в Профессорском уголке, г.Алушта',	'Продается дом в Профессорском уголке, г.Алушта',	'Продаётся, продажа, купить, куплю, коттедж, дом, в Алуште, Професорский уголок'),
(783,	1,	'Продам квартиру в Алуште, ул.Ленина,10',	'&amp;lt;p&amp;gt;\r\n	Продам квартиру в Алуште, ул.Ленина,10&amp;lt;br /&amp;gt;\r\n	Общая площадь 100 кв.м, жилая 57,1 кв.м, кухня-столовая 13,3 кв.м, лоджия с видом на море-9,7 кв.м. Клубный дом закрытого типа,охраняемая территория, на входе ресепшен. До моря 3 мин, до центра 7 мин.&amp;lt;br /&amp;gt;\r\n	&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продам квартиру в Алуште, ул.Ленина,10',	'Продам квартиру в Алуште, ул.Ленина,10',	'Продам квартиру в Алуште, ул.Ленина,10',	'Продам квартиру в Алуште, ул.Ленина,10',	'Куплю, квартира, Алушта, элитное жилье, дача Штейнгольца'),
(784,	1,	'Продам 3 комнатную квартиру в Алуште,ул.Ленина,10.',	'&amp;lt;p&amp;gt;\r\n	Продам 3 комнатную квартиру в Алуште,ул.Ленина,10.&amp;lt;br /&amp;gt;\r\n	Общая площадь 103,8 кв.м.,3 изолированные спальни с 3 метровыми потолками,большая кухня-столовая,гардеробная.Квартира полностью оборудованна мебелью и техникой.Дом закрытого типа,полностью под видеонаблюдением,на входе ресепшен.До собственного пляжа-3 мин,до центра-7мин.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продам 3 комнатную квартиру в Алуште,ул.Ленина,10.',	'Продам 3 комнатную квартиру в Алуште,ул.Ленина,10.',	'Продам 3 комнатную квартиру в Алуште,ул.Ленина,10.',	'Продам 3 комнатную квартиру в Алуште,ул.Ленина,10.',	'Куплю, квартира, Алушта, элитное жилье, дача Штейнгольца'),
(785,	1,	'Продам 3 комнатные апартаменты в Алуште, ул.Парковой,5.',	'&amp;lt;p&amp;gt;\r\n	Продам 3 комнатные апартаменты в Алуште, ул.Парковой,5.&amp;lt;br /&amp;gt;\r\n	Общая площадь 150кв.м.В квартире 3 изолированные комнаты,большая просторная кухня-12,2 кв.м, с выходом на террасу с прекрасным видом на парк.Также в квартире 2 сан.узла и гардероб.&amp;lt;br /&amp;gt;\r\n	Квартира продается с техникой и мебелью!Все документы РФ,к сделке готовы.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продам 3 комнатные апартаменты в Алуште, ул.Парковой,5.',	'Продам 3 комнатные апартаменты в Алуште, ул.Парковой,5.',	'Продам 3 комнатные апартаменты в Алуште, ул.Парковой,5.',	'Продам 3 комнатные апартаменты в Алуште, ул.Парковой,5.',	'Куплю, квартира, Алушта, элитное жилье, дача Штейнгольца, апартаменты'),
(826,	1,	'Продается 2-х комнатные шикарные апартаменты в г. Алушта, по ул. Парковая 5а',	'&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Апартаменты расположены на четвертом этаже, 9-го жилого дома, единственного в городе Клубном комплексе «Дача Доктора Штейнгольца». Современный дизайнерский ремонт, с привлечением качественных и дорогих материалов. Вся площадь данных апартаментов составляет 105.7 кв.м., с прекрасным видом на море, горы и Приморский парк Алушты. Комплекс состоит: 1. Гостиничный комплекс (66 апартаментов); 2. Жилой дом (18 квартир); 3. Двухуровневый подземный паркинг (64 места). Развитая инфраструктура: рецепция, два крытых бассейна (детский и взрослый), придомовая парковая зона отдыха (детский городок, декоративный ручей, фонтан, шахматная и музыкальная площадки, беседки, реликтовые зеленые насаждения), собственный пляж, бильярдная, SPA 1027 кв.м., своя котельная на 2.4 мВт, чиллеры на 25 000 кв.м.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Все документы РФ, и готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатные шикарные апартаменты в г. Алушта, по ул. Парковая 5а',	'Продается 2-х комнатные шикарные апартаменты в г. Алушта, по ул. Парковая 5а',	'Продается 2-х комнатные шикарные апартаменты в г. Алушта, по ул. Парковая 5а',	'Продается 2-х комнатные шикарные апартаменты в г. Алушта, по ул. Парковая 5а',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(788,	1,	'Продается 2-х комнатная квартира в г.Алушта, на  ул.60 лет СССР',	'&amp;lt;p&amp;gt;\r\n	Продается 2-х комнатная квартира в г.Алушта, на&amp;amp;nbsp; ул.60 лет СССР, дом 9. Квартира расположена на 5 этаже/5 этажного дома.Общая площадь квартиры 47.8 м.кв., жилая 28,6 м.кв.&amp;lt;br /&amp;gt;\r\n	Комнаты не проходные, сан. узел.раздельный.Квартира оборудованная газовой колонкой. Из кухни и зала выход на просторную лоджию 4 кв.м..Дом расположен в тихом спальном районе,рядом детская площадка, магазин, школа, автобусная остановка.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира в г.Алушта, на  ул.60 лет СССР',	'Продается 2-х комнатная квартира в г.Алушта, на  ул.60 лет СССР',	'Продается 2-х комнатная квартира в г.Алушта, на  ул.60 лет СССР',	'Продается 2-х комнатная квартира в г.Алушта, на  ул.60 лет СССР',	'Продам, Алушта,квартира,куплю, 60 лет СССР'),
(789,	1,	'Продается 2-х комнатная квартира в г.Алушта по ул.Виноградная, дом 26.',	'&amp;lt;p&amp;gt;\r\n	Квартира находится на 1 (высоком) этаже/10-и этажного дома.Общая площадь 54 м.кв., жилая 29,8 м.кв., кухня 9,3 м.кв. Отопление в квартире центральное, установлен бойлер.Дом расположен в тихом спальном районе города, рядом школа, магазин.До рынка и большой транспортной развязки 7 мин пешком.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира в г.Алушта по ул.Виноградная, дом 26.',	'Продается 2-х комнатная квартира в г.Алушта по ул.Виноградная, дом 26.',	'Продается 2-х комнатная квартира в г.Алушта по ул.Виноградная, дом 26.',	'Продается 2-х комнатная квартира в г.Алушта по ул.Виноградная, дом 26.',	'Продам, Алушта,квартира,куплю, улица Виноградная'),
(790,	1,	'Продается просторная  2-х комнатная квартира в Алушта, ул.Пригородная, дом 5а.',	'&amp;lt;p&amp;gt;\r\n	Продается просторная&amp;amp;nbsp; 2-х комнатная квартира в Алушта, ул.Пригородная, дом 5а. Квартира рассположена на 9 этаже/12-ти этажного дома (есть лифт). Общая площадь 50 кв.м, жилая 30 кв.м, кухня 10 кв.м.Имеется большой балкон с шикарным видом на горы и город. Санузел раздельный.Квартира требует ремонта, но при небольших вложениях,Вы можете получить комфортное жилье для отдыха или сдачи. Дом расположен в экологически чистом районе,рядом детская площадка, магазин, автобусная остановка.Расстояние до центра города всего 5 мин езды на автомобиле. Все документы РФ готовы к сделки!&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается просторная  2-х комнатная квартира в Алушта, ул.Пригородная, дом 5а.',	'Продается просторная  2-х комнатная квартира в Алушта, ул.Пригородная, дом 5а.',	'Продается просторная  2-х комнатная квартира в Алушта, ул.Пригородная, дом 5а.',	'Продается просторная  2-х комнатная квартира в Алушта, ул.Пригородная, дом 5а.',	'Продам, Алушта,квартира,куплю,район Мирный,улица Пригородная'),
(792,	1,	'Продается хороший земельный участок 8 соток г. Алушта в районе санатория Ветеран',	'&amp;lt;p&amp;gt;\r\n	Продается хороший земельный участок 8 соток г. Алушта, возле санатория Ветеран. Если Вы хотите приобрести землю в тихом и в то же время видном месте, то это то что Вам надо! Участок имеет правильную и прямоугольную форму, незначительный перепад высоты в 5 метров. Подъездная хорошая асфальтная дорога, проведены земельные работы, залит фундамент под дом. Дома рядом уже застраиваются, хорошие соседи, с участка открывается отличный вид на город, горы и частично море. Коммуникации уже заведены на соседние участки, все централизованное, свет, вода, газ, мощности хорошие. Район хорошо застраиваемый, хорошая транспортная развязка, до остановке в город 1-2 минуты на машине, пешком до остановки 7-10 минут.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается хороший земельный участок 8 соток г. Алушта в районе санатория Ветеран',	'Продается хороший земельный участок 8 соток г. Алушта в районе санатория Ветеран',	'Продается хороший земельный участок 8 соток г. Алушта в районе санатория Ветеран',	'Продается хороший земельный участок 8 соток г. Алушта в районе санатория Ветеран',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта'),
(793,	1,	'Продается земельный участок 5.13 соток г. Алушта, район санатория Ветеран',	'&amp;lt;p&amp;gt;\r\n	Вы мечтаете купить недвижимость в Алуште в тихом и в то же время видном месте, то это то что Вам надо! Участок видовой, ровный, незначительный перепад высоты, отличное место для застройки жилого дома. Подъездная хорошая асфальтированная дорога, проведены земельные работы, выложена хорошая качественная опорная стена бутовая. Дома рядом уже застраиваются, хорошее соседство, из участка открывается отличный панорамный вид на город, горы и море. Коммуникации уже заведены на соседние участки, свет, вода, газ, мощности хорошие. Район быстро застраиваемый, удобная транспортная развязка, до остановке в город 1-2 минуты на автомобиле, пешком до остановки общественного транспорта 10 минут ходьбы.&amp;lt;br /&amp;gt;\r\n	Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 5.13 соток г. Алушта, район санатория Ветеран',	'Продается земельный участок 5.13 соток г. Алушта, район санатория Ветеран',	'Продается земельный участок 5.13 соток г. Алушта, район санатория Ветеран',	'Продается земельный участок 5.13 соток г. Алушта, район санатория Ветеран',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта'),
(794,	1,	'Продаётся участок 1.2 гектара в г. Алушта село Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 1.2 гектара в г. Алушта село Лучистое. Ровный, хороший приусадебный участок личного подсобного хозяйства, отлично подойдет под застройку частного поместья. Газ и электричество по границе участка. Участок расположился немного ниже от центра села. В селе есть все необходимое для постоянного проживания садик, школа, магазины. Общественный транспорт доставит Вас в город всего за 20 минут. Личным транспортом до города 8-9 км.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 1.2 гектара в г. Алушта село Лучистое',	'Продаётся участок 1.2 гектара в г. Алушта село Лучистое',	'Продаётся участок 1.2 гектара в г. Алушта село Лучистое',	'Продаётся участок 1.2 гектара в г. Алушта село Лучистое',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лучистое'),
(795,	1,	'Продаётся земельный участок 1.4 гектара в г. Алушта село Лучистое',	'&amp;lt;p&amp;gt;\r\n	Ровный приусадебный участок личного подсобного хозяйства со своим озером на территории, отлично подойдет под застройку частного именного поместья. Газопровод и электричество проходят по границе участка. В селе есть все необходимое для постоянного проживания: садик, школа, магазины. Общественный транспорт доставит Вас в город всего за 20 минут. Личным транспортом до города 8-9 км.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся земельный участок 1.4 гектара в г. Алушта село Лучистое',	'Продаётся земельный участок 1.4 гектара в г. Алушта село Лучистое',	'Продаётся земельный участок 1.4 гектара в г. Алушта село Лучистое',	'Продаётся земельный участок 1.4 гектара в г. Алушта село Лучистое',	'Продам, продажа, куплю, купить, участок, землю, земля, поместье, Алушта, Лучистое'),
(796,	1,	'Продаётся участок 2 гектара в г. Алушта село Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 2 гектара в г. Алушта село Лучистое. Участок раскинулся у подножья под одной из красивейших гор Крыма «Демерджи». Участок представляет собой ровное поле, правильной прямоугольной формы, приусадебный участок личного подсобного хозяйства, отлично подойдет под застройку частного именного поместья. Подъездная хорошая накатанная грунтовая дорога, (800 метров) до асфальтированной дороги. Хороший вид на горы, море и город. В этом месте продаются 4 участка по 2Га., по 700 долларов за сотку, так же есть возможность купить смежные участки. До города всего 9 км., до центра села 1.5 км., само село развитое, школа, садик, магазины, общественный транспорт, газ, вода.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 2 гектара в г. Алушта село Лучистое',	'Продаётся участок 2 гектара в г. Алушта село Лучистое',	'Продаётся участок 2 гектара в г. Алушта село Лучистое',	'Продаётся участок 2 гектара в г. Алушта село Лучистое',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лучистое'),
(797,	1,	'Срочно! Продается однокомнатная квартира на ул. Ялтинская',	'&amp;lt;p&amp;gt;\r\n	Срочно! Продается однокомнатная квартира на ул. Ялтинская, 17. Общая площадь 33 кв.м.Квартира находится на 5эт\\5 этажного дома. В квартире сделан хороший ремонт, стоят энергосберегающие стеклопакеты, кондиционер,лоджия переоборудована в комнату. Продается с мебелью и техникой! Дом расположен в хорошем р-не, рядом школа, дет. сад, магазин. Все документы РФ готовы к сделки.&amp;lt;br /&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Срочно! Продается однокомнатная квартира на ул. Ялтинская',	'Срочно! Продается однокомнатная квартира на ул. Ялтинская',	'Срочно! Продается однокомнатная квартира на ул. Ялтинская',	'Срочно! Продается однокомнатная квартира на ул. Ялтинская',	'Продам, Алушта,квартира,куплю, Ялтинская'),
(798,	1,	'Продается участок 15 соток в г. Алушта с. Лазурное',	'&amp;lt;p&amp;gt;\r\n	Продается участок 15 соток в г. Алушта с. Лазурное по ул. Кастельская. Хороший участок в тихом месте с видом на море, до моря всего 1 км по дороги и Вы на пляже., хороший подъездной путь асфальтированная дорога к участку, этой же дорогой до центра г. Алушта 7 км., если ехать в другую сторону 3 км., выезжаем на Федеральную трассу «Севастополь-Ялта-Алушта-Симферополь». В селе стоит знаменитый Вино-коньячный завод «Маглив». Место хорошо застраиваемое, соседи рядом уже строятся, все коммуникации рядом (свет, газ, вода), отлично подойдет для застройки загородного дома, вид не перекроют!&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 15 соток в г. Алушта с. Лазурное',	'Продается участок 15 соток в г. Алушта с. Лазурное',	'Продается участок 15 соток в г. Алушта с. Лазурное',	'Продается участок 15 соток в г. Алушта с. Лазурное',	'Продается, продам, участок, землю, купить, куплю, Алушта, Лазурное'),
(799,	1,	'Продается участок 8 соток в г. Алушта с. Малый Маяк',	'&amp;lt;p&amp;gt;\r\n	Продается участок 8 соток в г. Алушта с. Малый Маяк. Земля находится выше федеральной трассы «Симферополь-Алушта-Ялта-Севастополь» подъездная дорога асфальт + 300 метров накатанная грунтовая дорога. С участка открывается прекрасный вид на горы и моря, участок ровный, получена кадастровая выписка с уточненными границами земельного участка. Коммуникации в доступности, до города 8 км.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 8 соток в г. Алушта с. Малый Маяк',	'Продается участок 8 соток в г. Алушта с. Малый Маяк',	'Продается участок 8 соток в г. Алушта с. Малый Маяк',	'Продается участок 8 соток в г. Алушта с. Малый Маяк',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Малый МАяк'),
(800,	1,	'Продаётся коммерческая недвижимость в Партените',	'&amp;lt;p&amp;gt;\r\n	Продаётся коммерческая недвижимость в Партените, на земельном участке в 11.5 соток., само здание 1760 кв.м. Хорошее месторасположение, замечательный вид на море и горы. Отлично подойдет как под офисно-торговые помещения, а так и под застройку многоэтажного жилого дома. Документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся коммерческая недвижимость в Партените',	'Продаётся коммерческая недвижимость в Партените',	'Продаётся коммерческая недвижимость в Партените',	'Продаётся коммерческая недвижимость в Партените',	'Продаётся, упить, коммерция, Партенит, Алушта, земля, участок, продажа, куплю'),
(801,	1,	'Продаётся участок 2.32 Га в г. Алушта село Лазурное',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 2.32 Га в г. Алушта село Лазурное. Участок ровный, развернут на Юг с видом на море и горы, разместился в одном из экологически чистом месте на южной стороне подножья горы «Кастель». Место отлично подойдет под застройку отеля общественного курортно-туристического комплекса, базу коттеджного типа. Площадка свободна от застройки и покрыта зарослями кустарника и подлесками. Расстояния от участка до моря 120 метров. Транспортная инфраструктура сформирована улично-дорожной сетью, имеющий выход на Ялтинское шоссе. В поселке центральное газоснабжения, канализация, водоснабжения, электроснабжения.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 2.32 Га в г. Алушта село Лазурное',	'Продаётся участок 2.32 Га в г. Алушта село Лазурное',	'Продаётся участок 2.32 Га в г. Алушта село Лазурное',	'Продаётся участок 2.32 Га в г. Алушта село Лазурное',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лазурное'),
(802,	1,	'Продаётся участок 10 соток в г. Алушта село Лазурное',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 10 соток в г. Алушта село Лазурное. Основной участок представляет собой ровную поляну в 2 Га., разбитую на равные и правильной формы 20 участков по 10 соток. При необходимости можно увеличить площадь участка купив смежные рядом. Так же есть возможность приобрести всю поляну в 2 Га., под застройку эко-городка, коттеджного поселка или отеля. Находится в экологически чистом месте, у подножья горы «Кастель» с видом на море. К участку ведет хорошая накатанная лесная дорога 300 метров. До моря на прямую 600 метров, по дороге всего 1100 метров.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 10 соток в г. Алушта село Лазурное',	'Продаётся участок 10 соток в г. Алушта село Лазурное',	'Продаётся участок 10 соток в г. Алушта село Лазурное',	'Продаётся участок 10 соток в г. Алушта село Лазурное',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лазурное'),
(803,	1,	'Продаётся участок 8 соток в г. Алушта, село Малый Маяк',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 8 соток в г. Алушта, село Малый Маяк. Земельный участок находится ниже федеральной трассы «Ялта-Алушта-Симферополь-Севастополь», участок ровный и правильной формы с видом на море, находится у асфальтированной дороги, по ней же вниз к морю всего 2000 метров все коммуникации рядом. Ходит общественный маршрутный транспорт в город. До города Алушта 8 км.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 8 соток в г. Алушта, село Малый Маяк',	'Продаётся участок 8 соток в г. Алушта, село Малый Маяк',	'Продаётся участок 8 соток в г. Алушта, село Малый Маяк',	'Продаётся участок 8 соток в г. Алушта, село Малый Маяк',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Малый Маяк'),
(804,	1,	'Продаётся участок 60 соток г. Алушта село Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 60 соток г. Алушта село Лучистое. Участок находиться у подножья горы «Демерджи», участок ровный правильной формы, к участку ведет хорошая грунтовая накатанная дорога 200 метров. С участка открывается отличный вид на горы. Коммуникации рядом. Так же есть возможность увеличить площадь, купив смежные два участка по 60 соток.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 60 соток г. Алушта село Лучистое',	'Продаётся участок 60 соток г. Алушта село Лучистое',	'Продаётся участок 60 соток г. Алушта село Лучистое',	'Продаётся участок 60 соток г. Алушта село Лучистое',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лучистое'),
(805,	1,	'Продается участок 57.5 соток г. Алушта село Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается участок 57.5 соток г. Алушта село Лучистое. Участок примыкает к проезжей части, коммуникации в доступности. Участок представляет собой ровную поляну с небольшим уклоном и незначительным перепадом высоты. С участка открывается панорамный вид на море, город и горы. До центра села всего 800 метров, где есть школа, садик, магазины, мед. Пункт., ходит общественный транспорт в город, который за 15-20 минут доставит Вас в центр г. Алушта. До города 8 км., на личном транспорте 10 минут. До федеральной трассы «Ялта-Симферополь» 3.5 км. Так же есть возможность увеличить площадь купив смежные два участка 56 и 53 сотки.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 57.5 соток г. Алушта село Лучистое',	'Продается участок 57.5 соток г. Алушта село Лучистое',	'Продается участок 57.5 соток г. Алушта село Лучистое',	'Продается участок 57.5 соток г. Алушта село Лучистое',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лучистое'),
(806,	1,	'Продается земельный участок 87 соток г. Алушта село Лучистое',	'&amp;lt;p&amp;gt;\r\n	Участок состоит из двух участков с разными кадастровыми номерами, общей площадью 42 и 45 соток. Целевое назначения земли - ЛПХ в землях населенных пунктов. Возможно приобрести как два участка вместе, так и по отдельности. Участок имеет умеренный уклон в сторону моря, и развернут на ЮГ. К участку ведет хорошая накатанная грунтовая дорога, рядом уже строятся соседи. С самого участка открывается панорамный вид на моря, город и горы.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 87 соток г. Алушта село Лучистое',	'Продается земельный участок 87 соток г. Алушта село Лучистое',	'Продается земельный участок 87 соток г. Алушта село Лучистое',	'Продается земельный участок 87 соток г. Алушта село Лучистое',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лучистое'),
(807,	1,	'Продается участок 4 сотки в г. Алушта село Лазурное',	'&amp;lt;p&amp;gt;\r\n	Продается участок 4 сотки в г. Алушта село Лазурное. Участок находится в «Кооперативе Лазурный» с видом на море, участок в собственности (не в кооперативе), форма участка квадрат, отлично подойдет под застройку мини-гостиницы или дома. Хорошая подъездная асфальтированная дорога, охраняемая территория. Коммуникации все централизованные, мощностя хорошие. К морю 200 метров. Есть возможность увеличить площадь купив смежный участок 4 сотки.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 4 сотки в г. Алушта село Лазурное',	'Продается участок 4 сотки в г. Алушта село Лазурное',	'Продается участок 4 сотки в г. Алушта село Лазурное',	'Продается участок 4 сотки в г. Алушта село Лазурное',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Лазурное'),
(808,	1,	'Продается участок 7.5 соток г. Алушта пгт. Партенит',	'&amp;lt;p&amp;gt;\r\n	Продается участок 7.5 соток г. Алушта пгт. Партенит. Асфальтированный подъезд, с видом на прекрасную гору «Аю-Даг» Медведь гору. Участок имеет умеренный рельеф. Коммуникации в доступности, инфраструктура рядом, магазины, рынок, аптека, остановка общественного транспорта. Хороший не перекрываемый вид на море. Так же есть возможность приобрести соседний участок 7.5 соток.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 7.5 соток г. Алушта пгт. Партенит',	'Продается участок 7.5 соток г. Алушта пгт. Партенит',	'Продается участок 7.5 соток г. Алушта пгт. Партенит',	'Продается участок 7.5 соток г. Алушта пгт. Партенит',	'Продам, продажа, куплю, купить, участок, землю, земля, Алушта, Партенит'),
(812,	1,	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'&amp;lt;p&amp;gt;\r\n	Общей площадью 46.3 кв.м., жилой 15.5 кв.м., кухня 14.3 кв.м., прихожая 9.5 кв .м., сан. узел 5.4 кв.м., балкон 4.8 кв .м. Квартира на 7-м этаже. Потолки 2.7 м. Состояние под отделку. Отопление индивидуальное, из окон открывается вид на парк, горы и море. Дом введен в эксплуатацию в сентябре 2016 года, 14-этажное здание, два лифта: грузовой, пассажирский. Закрытая придомовая территория. Хорошим преимуществом является невысокая цена за обслуживание квартир, 20 руб./кв.м. Многоквартирный дом расположен в 360 метрах от центральной набережной, рядом всё что необходима для комфортного проживания, развитая инфраструктура: магазины, рестораны, кафе, салоны красоты, детский парк, дельфинарий, пляжи, фитнес-центр. Покупая квартиру в этом доме сегодня, Вы удачно инвестируете свои средства на завтра.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 1-к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продается, купить, куплю, продажа, квартиру, квартира, новостройка, город Алушта,'),
