(814,	1,	'Продаётся 2-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Общей площадью 70.3 кв.м., жилой 31.7 кв.м., кухня 12.3 кв.м., прихожая 15.5 кв.м., сан. Узел раздельный 4.6 + 2.3 кв.м., лоджия 6.3 кв.м., балкон 3.8 кв.м. Квартира на 8-ом этаже. Потолки 2.7 м. Состояние под отделку. Отопление индивидуальное, из окон открывается вид на парк, горы и море. Дом введен в эксплуатацию в сентябре 2016 года, 14-этажное здание, два лифта: грузовой, пассажирский. Закрытая придомовая территория. Хорошим преимуществом является невысокая цена за обслуживание квартир, 20 руб./кв.м. Многоквартирный дом расположен в 360 метрах от центральной набережной, рядом всё что необходимо для комфортного проживания, развитая инфраструктура: магазины, рестораны, кафе, салоны красоты, детский парк, дельфинарий, пляжи, фитнес-центр. Покупая квартиру в этом доме сегодня, Вы удачно инвестируете свои средства на завтра.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 2-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 2-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 2-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 2-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продается, купить, куплю, продажа, квартиру, квартира, новостройка, город Алушта,'),
(909,	1,	'Продается квартира 3х-комнатная по улице Юбилейная, г. Алушты.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается квартира 3х-комнатная по улице Юбилейная, г. Алушты.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира расположена на восьмом этаже из девяти, общая площадь составляет 90 кв. м. из них 39 кв. м.- жилая,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	все комнаты изолированные, площади двух спален и кухни увеличены за счёт совмещения с утеплёнными лоджиями 8,8 кв. м. и 4,6 кв. м. и балконом в 3,3 кв. м. Продается со встроенной мебелью и техникой, сделан хороший ремонт, установлены кондиционеры, в квартире подключен природный газ. Из окон красивый вид на город и горы. Жилой дом расположен в 5-ти минутах ходьбы от района автовокзала, где есть школа, садик, рынок, магазины, супермаркеты.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается квартира 3х-комнатная по улице Юбилейная, г. Алушты.',	'Продается квартира 3х-комнатная по улице Юбилейная, г. Алушты.',	'Продается квартира 3х-комнатная по улице Юбилейная, г. Алушты.',	'Продается квартира 3х-комнатная по улице Юбилейная, г. Алушты.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Юбилейная'),
(815,	1,	'Продаётся 3-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Продаётся 3-х ком. Квартира с видом на море и центр г. Алушта по ул. Ленина, 21. Общей площадью 96.3 кв.м., жилой 47.6 кв.м., кухня 14.8 кв.м., прихожая 15.4 кв.м., сан. Узел раздельный 3.9 + 2.6 кв.м., лоджия 6.3 кв.м., балкон 3.8 кв.м. Квартира на 7-м этаже. Из всех окон комнат вид на море. Потолки 2.7 м. Состояние под отделку. Отопление индивидуальное, из окон открывается вид на парк, горы и море. Дом введен в эксплуатацию в сентябре 2016 года, 14-этажное здание, два лифта: грузовой, пассажирский. Закрытая придомовая территория. Хорошим преимуществом является невысокая цена за обслуживание квартир, 20 руб./кв.м. Многоквартирный дом расположен в 360 метрах от центральной набережной, рядом всё что необходимо для комфортного проживания, развитая инфраструктура: магазины, рестораны, кафе, салоны красоты, детский парк, дельфинарий, пляжи, фитнес-центр. Покупая квартиру в этом доме сегодня, Вы удачно инвестируете свои средства на завтра.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 3-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 3-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 3-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продаётся 3-х к. квартира в новостройке г. Алушта по ул. Ленина, 21',	'Продается, купить, куплю, продажа, квартиру, квартира, новостройка, город Алушта,'),
(817,	1,	'Продается квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Продаётся квартира в г. Алушта по ул. Ленина, 10 элитном доме «Дача Доктора Штейнгольца». Рядом с жилым комплексом приморский парк, что делает место расположения дома уникальным, 100 метров до центральной городской набережной, своя карта пляжа. Комплекс с закрытой охраняемой территорией, двухуровневый подземный паркинг. Это не апартаменты, а квартира есть возможность прописки. Квартира на 2-м этаже, общая площадью 100 кв.м., жилая 57.1 кв.м., кухня-столовая 13.3 кв.м., открытая лоджия 9.7 кв.м., с видом на черное море. Выполнен шикарный и дорогой ремонт. Есть свободные парко места, можно приобрести отдельно. Торопитесь стать счастливым владельцем элитной недвижимости на ЮБК.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Все документы РФ и к сделке готовы&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(818,	1,	'Продается 2-х комнатная квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Комплекс находиться рядом с приморским парком, что по истине делает место расположения уникальным. В шаговой доступности городская центральная набережная, пляжи. Территория комплекса закрыта от сторонних глаз, охраняемая территория, подземный двухуровневый паркинг, имеется свой пляж. Это не апартаменты, это квартира, что делает это комплекс более привлекательным, кто решил переехать на Южный Берег Крыма, так же плюсом есть возможность прописки. &amp;lt;/span&amp;gt;&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Квартира находиться на 4-м этаже, с общей площадью в 97 кв.м., жилая 58.2 кв.м., кухня-столовая 13.2 кв.м., лоджия с видом на Чёрное море 9.6 кв.м. Так же возможно приобрести парко место в подземном паркинге. Торопитесь стать счастливым правообладателем элитной недвижимости на на самом южном берегу Крыма.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Все документы РФ к сделке готовы.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается 2-х комнатная квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается 2-х комнатная квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается 2-х комнатная квартира в г. Алушта в элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(820,	1,	'Продаётся 3-х комнатные апартаменты в шикарном Клубном доме &amp;quot;Дача Доктора Штейнгольца &amp;quot; г. Алушта',	'&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Продаётся апартаменты в шикарном Клубном доме &amp;quot;Дача Доктора Штейнгольца &amp;quot;. Дом находится в г . Алушта, ул. Парковая, 5а. 2-й этаж, площадь апартаментов 152.2 кв.м., прихожая 20.1 кв.м., 2 санузла (9.2 кв.м., 2.8 кв.м.) кухня-столовая 12 кв.м., гостиная 29.7 м.кв., 2 спальни (22.2 кв.м., и 27.6 кв.м.), под внутреннею отделку. Вид из окон в сторону моря, парка и горы. До моря 3 минуты ходьбы . На сегодня в городе Алушта это единственный клубный дом “Дача Доктора Штейнгольца”. В комплекс входит: развитая инфраструктура, собственный ухоженный пляж, вечно зеленый парк, SPA центр, охраняемая закрытая территория от посторонних глаз. Территория комплекса 3560 кв.м. Придомовая благоустроенная зона отдыха оборудованная архитектурными образами (фонтан, беседка, скульптуры, зоны отдыха для взрослых, для детей оборудован современный детский комплекс. Собственный пляж протяженностью в 200 метров. Подземный двухуровневый паркинг.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Все документы РФ готовы к сделке.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся 3-х комнатные апартаменты в шикарном Клубном доме &amp;quot;Дача Доктора Штейнгольца &amp;quot; г. Алушта',	'Продаётся 3-х комнатные апартаменты в шикарном Клубном доме &amp;quot;Дача Доктора Штейнгольца &amp;quot; г. Алушта',	'Продаётся 3-х комнатные апартаменты в шикарном Клубном доме &amp;quot;Дача Доктора Штейнгольца &amp;quot; г. Алушта',	'Продаётся 3-х комнатные апартаменты в шикарном Клубном доме &amp;quot;Дача Доктора Штейнгольца &amp;quot; г. Алушта',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(708,	1,	'Продается шикарная 3 комнатная квартира в Алуште, ул. Платановая',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продаётся трёх комнатная квартира в г, Алушта по ул. Платановая 1.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Комплекс закрытого типа, расположен в центральной части города Алушта. В элитном комплексе круглосуточная охрана, постоянное видеонаблюдение, детская площадка, ухоженный двор. Продаваемая квартира расположена на пятом этаже, пятиэтажного жилого дома, площадью 98 кв.м. С окон квартиры вид на горы и море. В квартире дорогостоящий современный ремонт, сделан теплый пол, установлен двухконтурный газовый котёл. Также квартира включает в себя три полноценные комнаты, два балкона, два сан.узла, отдельно распложенный гардероб. Вокруг дома развитая инфраструктура, удобное расположения дома позволит за 3 минуты добраться пешком как до супермаркета, так и до остановки.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается шикарная 3 комнатная квартира в Алуште, ул. Платановая',	'Продается шикарная 3 комнатная квартира в Алуште, ул. Платановая',	'Продается шикарная 3 комнатная квартира в Алуште, ул. Платановая',	'Продается шикарная 3 комнатная квартира в Алуште, ул. Платановая',	'продажа, квартира, Алушта, купить, ЮБК, центр.'),
(821,	1,	'Продается 3-х комнатная квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p&amp;gt;\r\n	Продается великолепная квартира в единственном Клубном Доме «Дача Доктора Штейнгольца». Квартира находиться на втором этаже, дом в центральной части города, в районе центральной набережной города Алушта по ул. Парковая 5а. Это полноценная шикарная квартира, не апартаменты! Возможность прописки. Вся площадь продаваемой квартиры составляет 110.9 кв.м., в доме всего 9 этажей. Продается с современным ремонтом и мебелью, 3 отдельные комнаты, большая кухня студия. Есть тех.помещения, вид в сторону моря и парк. Современный дом, ресепшн, круглосуточная охрана, развитая инфраструктура, городская набережная города в 2 минутах ходьбы, парк, свой пляж, SPA центр, территория с зонной отдыха, детская зона, фонтан, крытый бассейн, спортзал.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается 3-х комнатная квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается 3-х комнатная квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается 3-х комнатная квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается 3-х комнатная квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(822,	1,	'Продаются апартаменты в г. Алушта в самом элитном клубном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p align=&amp;quot;left&amp;quot; lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm;&amp;quot;&amp;gt;\r\n	&amp;lt;font face=&amp;quot;Times New Roman, serif&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12pt&amp;quot;&amp;gt;Продаётся великолепные апартаменты в городе Алуште, в единственном Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;. Клубный дом расположен по адресу г .Алушта, ул. Парковая, 5а. Этаж 2, общая площадь 156.3 м.кв., прихожая 25.2.м.кв., гардероб 11.6 м.кв., два санузла [8 м .кв. и 2.5 м.кв.], кухня столовая 12 м .кв., гостиная 40.9 м.кв., 2-е спальни [19 м .кв. и 22.8 м.кв.], 3 лоджии [6.2 м.кв., 4.4 м.кв., 3.7 м.кв.,] Апартамент под отделку. Вид из окон в сторону моря, парка и на горы. До моря не спеша всего 2 минуты ходьбы. Инфраструктура дома по принципу &amp;quot;город в городе&amp;quot;. Территория всего комплекса составляет 3560 м.кв. Придомовой парк оборудован архитектурными формами (фонтан, беседка, скульптуры), предусмотрены зоны отдыха для взрослых, так же для детей оборудован современная детская зона. Круглогодично для жильцов работает два крытых бассейна, SPA-центр, тренажерный зал, свой пляж, подземный паркинг, охрана круглосуточно, рецепция.&amp;lt;/font&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p align=&amp;quot;left&amp;quot; lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm;&amp;quot;&amp;gt;\r\n	&amp;lt;font face=&amp;quot;Times New Roman, serif&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12pt&amp;quot;&amp;gt;Весь пакет документов РФ к сделке готовы.&amp;lt;/font&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты в г. Алушта в самом элитном клубном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаются апартаменты в г. Алушта в самом элитном клубном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаются апартаменты в г. Алушта в самом элитном клубном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаются апартаменты в г. Алушта в самом элитном клубном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(823,	1,	'Продаётся 3-х к. квартира в г. Алушта, по ул.Парковая, 5а в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Продаётся 3-х к. квартира в г. Алушта, по ул. Парковая 5а. Общая площадь 151.1 кв.м., жилая 75.2 кв.м., кухня — столовая в 12 кв.м., лоджия 3.7 кв.м., терраса с видом на парк 28.6 кв.м. Квартира расположена на 3/9 этажного Клубного Дома «Дача Доктора Штейнгольца». Три раздельные спальни, 2 сан.узла, ванная с джакузи, сделаны теплые полы, ламинат, вся проводка проведена. Возможность прописки! Сделан дорогостоящий и качественный ремонт, с панорамных окон открывается великолепный вид на горы и город. До моря и центральной городской набережной 3 мин. прогулочным шагом, до центра города 5 минут пешком. Развитая инфраструктура, закрытая охраняемая территория, рецепция, СПА салон, крытый бассейн (детский и взрослый), свой пляж, подземный паркинг двухуровневый, на территории своя зеленая зона отдыха, беседки, фонтан, детская современная площадка. В доме установлена система автономной вентиляции и кондиционирования воздуха, своя котельная.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Весь пакет документов РФ и готов к сделке.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся 3-х к. квартира в г. Алушта, по ул.Парковая, 5а в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся 3-х к. квартира в г. Алушта, по ул.Парковая, 5а в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся 3-х к. квартира в г. Алушта, по ул.Парковая, 5а в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся 3-х к. квартира в г. Алушта, по ул.Парковая, 5а в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(824,	1,	'Продаётся хорошие 3-х комнатные апартаменты в г. Алушта, в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p&amp;gt;\r\n	Продаётся хорошие 3-х комнатные апартаменты в г. Алушта, по ул. Парковая 5а. Вся площадь апартамента в 109 кв.м., лоджия 1.7 кв.м., с видом на парковую зеленую зону. Квартира расположена на третьим этаже 9-и этажного Клубного Дома «Дача Доктора Штейнгольца». Две спальные комнаты раздельные, 2 сан.узла, кухня — студия. В квартире выполнен современный, качественный и дорогостоящий ремонт. До моря и городской набережной 3 мин. пешком, к центру города 5 минут прогулочным шагом. Развитая инфраструктура, закрытая охраняемая территория, рецепция, SPA салон, 2 крытых бассейна (детский и взрослый), собственный пляж, подземный паркинг, на территории своя зеленая зона для отдыха, беседки, фонтан, современная детская площадка. На дом установлена система автономной вентиляции и кондиционирования воздуха, собственная котельная.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Весь пакет документов РФ и готов к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продаётся хорошие 3-х комнатные апартаменты в г. Алушта, в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся хорошие 3-х комнатные апартаменты в г. Алушта, в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся хорошие 3-х комнатные апартаменты в г. Алушта, в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся хорошие 3-х комнатные апартаменты в г. Алушта, в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(825,	1,	'Продаётся шикарные двух комнатные апартаменты г. Алушта в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p&amp;gt;\r\n	Продаётся шикарные двух комнатные апартаменты в г. Алушта, по ул.Парковая, 5. Общая площадь в 126,4 кв.м., жилая составляет 31,9 кв.м., большая кухня-столовая 40,2 кв.м., площадь балкона сотовляет 10,6 кв.м., с прекрасным видом на постоянно зеленый парк. Квартира расположена на 3 этаже/9 этажного здания. Две раздельные хорошие спальни, два сан.узла, сделан дизайнерский и качественный ремонт. До моря всего 3 минуты пешком, до центра 7 минут. Хорошая и развитая инфраструктура, закрытая от сторонних глаз охраняемая территория, две рецепции, SPA-салон, два закрытых бассейна (взрослый и детский), собственный ухоженный пляж, двухуровневый подземный паркинг, для жильцов комплекса на территории своя зеленая зона отдыха, множество беседок, фонтан, детская площадка. На весь жилой комплекс установлена система автономной вентиляции и кондиционирования, собственная котельная. В стоимость апартаментов входит вся техника и мебель.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Полный пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся шикарные двух комнатные апартаменты г. Алушта в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся шикарные двух комнатные апартаменты г. Алушта в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся шикарные двух комнатные апартаменты г. Алушта в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продаётся шикарные двух комнатные апартаменты г. Алушта в Клубном Доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(827,	1,	'Продаётся 3-х комнатные апартаменты в г. Алушта по ул. Парковая, 5',	'&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Продаётся трёх комнатные апартаменты в г. Алушта по ул. Парковая, 5а. 5-й этаж/9-го дома. Площадь всего объекта в 150 кв.м., большая терраса 29.6 кв.м., с которой открывается панорамный вид на горы и восхитительное Чёрное море. Состояние под отделку, что даст Вам воплотить все свои дизайнерские желания. Апартаменты расположились в единственном на сегодняшний день в городе своем стиле и подобию Клубном Доме «Дача Доктора Штейнгольца», с шаговой и развитой инфраструктурой. Охрана территории круглосуточно, два бассейна закрытых, придомовая парковая зона для отдыха (современная детская площадка, фонтан, беседки, пляж свой,SPA центр больщой). Комплекс состоит: 1) Гостиничный комплекс 66 апартаментов; 2) Жилой дом 18 квартир; 3) Паркинг подземный на 64 парко места. Автономная система вентиляции, кондиционирования воздуха.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Полный пакет документов РФ готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 3-х комнатные апартаменты в г. Алушта по ул. Парковая, 5',	'Продаётся 3-х комнатные апартаменты в г. Алушта по ул. Парковая, 5',	'Продаётся 3-х комнатные апартаменты в г. Алушта по ул. Парковая, 5',	'Продаётся 3-х комнатные апартаменты в г. Алушта по ул. Парковая, 5',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(828,	1,	'Продаётся трёх комнатные апартаменты в Алуште по ул. Паркова, 5а',	'&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Продаётся трёх комнатные апартаменты в Алуште по ул. Паркова, 5а, в единственном клубном доме города «Дача Доктора Штейнгольца». Комплекс расположен 150 метров от центральной набережной, в самом сердце города. Апартаменты находятся на 5/9 этажного здания, площадь предлагаемой квартиры составляет 116.2 кв.м., имеет два сан.узла, две спальни, большая гостиная комната, кухня-столовая. Выполнен современный дизайнерский ремонт с привлечением дорогостоящих материалов. Апартаменты продаются с мебелью. Открывается замечательный вид на город, парк, горы и море. До моря 2 минуты ходьбы, собственный пляж. На территории самого комплекса круглогодично работают SPA центр, рецепция, два крытых бассейна (детский и взрослый), бильярдная, тренажорный зал, кафе, своя охраняемая закрытая от внешних глаз парковая зона для Вашего отдыха, детская площадка. На весь комплекс стоит система кондиционирования и вентиляции воздуха.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Все документы РФ и готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продаётся трёх комнатные апартаменты в Алуште по ул. Паркова, 5а',	'Продаётся трёх комнатные апартаменты в Алуште по ул. Паркова, 5а',	'Продаётся трёх комнатные апартаменты в Алуште по ул. Паркова, 5а',	'Продаётся трёх комнатные апартаменты в Алуште по ул. Паркова, 5а',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(829,	1,	'Продаётся хорошие апартаменты в г. Алушта по ул. Парковая, 5а',	'&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;font color=&amp;quot;#462014&amp;quot;&amp;gt;&amp;lt;font face=&amp;quot;Times New Roman, serif&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12pt&amp;quot;&amp;gt;&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Продаётся хорошие апартаменты в г. Алушта по ул. Парковая, 5а. Предлагаемые апартаменты находятся в Клубном Доме «Дача Доктора Штейнгольца» на 6 этаже/9-го дома. Продаются под внутреннюю отделку, что даст Вам воплотить все свои дизайнерские видения своего уютного жилья. Общая площадб 115.9кв.м., два сан.узла (9.5 кв.м., + 1.8 кв.м.,), две спальни (16.4 кв.м.,+ 14.9 кв.м.,) с видом на город и внутренний благоустроенный двор, одна из спален с выходом на лоджию (5.4 кв.м.,) с видом на море, гардеробная (2.4 кв.м.,), прихожая (24 кв.м.,), большая светлая гостиная в (35 кв.м.,). Комплекс представляет собой закрытую охраняемую территорию с подземным двухуровневым паркингом, закрытым бассейном, тренажорный зал, собственным ухоженным парком и беседками для отдыха, детской площадкой, удобное месторасположения комплекса в сердце города позволит Вам в шаговой доступности без труда добраться к любой инфраструктуре за считанные минуты.&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;font color=&amp;quot;#462014&amp;quot;&amp;gt;&amp;lt;font face=&amp;quot;Times New Roman, serif&amp;quot;&amp;gt;&amp;lt;font style=&amp;quot;font-size: 12pt&amp;quot;&amp;gt;&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Все документы РФ к сделке готовы.&amp;lt;/span&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/font&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся хорошие апартаменты в г. Алушта по ул. Парковая, 5а',	'Продаётся хорошие апартаменты в г. Алушта по ул. Парковая, 5а',	'Продаётся хорошие апартаменты в г. Алушта по ул. Парковая, 5а',	'Продаётся хорошие апартаменты в г. Алушта по ул. Парковая, 5а',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(830,	1,	'Продаётся шикарные 2-х комнатные апартаменты в г. Алушта по ул. Парковая, 5а ',	'&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Продаётся шикарные 2-х комнатные апартаменты в г. Алушта по ул. Парковая, 5а в Клубном Доме и единственным на сегодня в городе «Дача Доктора Штейнгольца». Апартаменты находятся на 7-ом этаже/9-го дома, выполнен качественный и современный ремонт с привлечением дорогостоящих материалов. Продается вместе с дорогой техникой и шикарной мебелью! Общая площадь предлагаемых апартаментов составляет 51 кв.м., кухня-столовая, отдельная спальня, лоджия. Для жителей комплекса круглый год функционирует SPA центр, бильярдная, кафе, круглосуточно охрана, рецепция, подземный паркинг на 64 парко места, закрытый собственный парк для отдыха и детской площадкой.&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;ru-RU&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	Все документы РФ к сделке готовы&amp;lt;/p&amp;gt;\r\n',	'Продаётся шикарные 2-х комнатные апартаменты в г. Алушта по ул. Парковая, 5а',	'Продаётся шикарные 2-х комнатные апартаменты в г. Алушта по ул. Парковая, 5а',	'Продаётся шикарные 2-х комнатные апартаменты в г. Алушта по ул. Парковая, 5а',	'Продаётся шикарные 2-х комнатные апартаменты в г. Алушта по ул. Парковая, 5а',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(831,	1,	'Продаётся трёх комнатные апартаменты г. Алушта по ул. Парковая, 5а',	'&amp;lt;p&amp;gt;\r\n	Продаётся трёх комнатные апартаменты в г. Алушта по ул. Парковая, 5а. 7-й этаж/9-го дома. Площадь всего объекта в 136.3 кв.м., большая терраса 20.2 кв.м., с которой открывается панорамный вид на горы и восхитительное Чёрное море. Состояние под отделку, что даст Вам воплотить все свои дизайнерские желания. Апартаменты расположились в единственном на сегодняшний день в городе своем стиле и подобию Клубном Доме «Дача Доктора Штейнгольца», с шаговой и развитой инфраструктурой. Охрана территории круглосуточно, два бассейна закрытых, придомовая парковая зона для отдыха (современная детская площадка, фонтан, беседки, пляж свой, SPA центр большой). Комплекс состоит: 1) Гостиничный комплекс 66 апартаментов; 2) Жилой дом 18 квартир; 3) Паркинг подземный на 64 парко места. Автономная система вентиляции, кондиционирования воздуха. Звоните или пишите, ответим на все Ваши вопросы.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Полный пакет документов РФ готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продаётся трёх комнатные апартаменты  г. Алушта по ул. Парковая, 5а',	'Продаётся трёх комнатные апартаменты  г. Алушта по ул. Парковая, 5а',	'Продаётся трёх комнатные апартаменты г. Алушта по ул. Парковая, 5а',	'Продаётся трёх комнатные апартаменты г. Алушта по ул. Парковая, 5а',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(832,	1,	'Продаётся апартаменты в г. Алушта, по ул. Парковая, дом 5',	'&amp;lt;p&amp;gt;\r\n	Продаётся апартаменты в г. Алушта, по ул. Парковая, дом 5, в закрытом Клубном Доме «Дача Доктора Штейнгольца». В комплексе своя закрытая от внешних глаз роскошная парковая зона для отдыха: беседки, фонтан, современная детская площадка. Так же на территории для жильцов круглогодично работают: SPA центр, бильярдная, кафе, два закрытых бассейна (взрослый и детски), круглосуточная охрана комплекса, паркинг подземный на (64 парко места). Общая площадь предлагаемых апартаментов составляет 35 кв.м., находятся на 2-м этаже 9-го дома, сделан хороший ремонт, продаётся вместе с мебелью. Развитая инфраструктура, к центральной Алуштинской набережной 150 метров.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся апартаменты в г. Алушта, по ул. Парковая, дом 5',	'Продаётся апартаменты в г. Алушта, по ул. Парковая, дом 5',	'Продаётся апартаменты в г. Алушта, по ул. Парковая, дом 5',	'Продаётся апартаменты в г. Алушта, по ул. Парковая, дом 5',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(833,	1,	'Продаётся 2-х комнатные апартаменты в комплексе «Дача Доктора Штейнгольца»',	'&amp;lt;p&amp;gt;\r\n	Расположены на 2м этаже 9-этажного монолитного дома. Площадь предлагаемых апартаментов составляет-98.5 кв.м., из которых: прихожая -16.5кв.м., гостиная комната-24.7 кв.м. с выходом на террасу в 4.5 кв.м. [+ 3.7 кв.м. гардеробная], кухня-16.4 кв.м., так же с выходом на террасу 5 кв.м., коридор-7.5 кв.м., спальная комната в 12.1 кв.м., 2 сан.узла (1.5 кв.м., гостевой и 6.6 кв.м., хозяйский). В доме 2 лифта фирмы ThyssenKrupp. На территории комплекса площадью 1 га — детские игровые площадки европейской компании Lappset, 2 крытых бассейна, спортзал, двухуровневый подземный паркинг на 64 мест, в стоимость входит 1 парко место, парковая придомовая территория с извилистыми аллеями, фонтан, беседки, зеленная растительность, SPA-комплекс с 7-ю видами бань.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 2-х комнатные апартаменты в комплексе «Дача Доктора Штейнгольца»',	'Продаётся 2-х комнатные апартаменты в комплексе «Дача Доктора Штейнгольца»',	'Продаётся 2-х комнатные апартаменты в комплексе «Дача Доктора Штейнгольца»',	'Продаётся 2-х комнатные апартаменты в комплексе «Дача Доктора Штейнгольца»',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(834,	1,	'Продаётся шикарные трёх комнатные апартаменты в г. Алуште по ул. Паркова, 5',	'&amp;lt;p&amp;gt;\r\n	Продаётся шикарные трёх комнатные апартаменты в г. Алуште по ул. Паркова, 5, в единственном клубном доме города «Дача Доктора Штейнгольца». Комплекс расположен 150 метров от центральной набережной, в самом сердце города. Предлагаемые Вашему вниманию апартаменты находятся на 10/10 этажного здания, вся площадь данных апартаментов составляет 196.2 кв.м., имеет 2 сан.узла, две светлые спальни, просторная &amp;amp;nbsp;комната для гостей, кухня-столовая, терраса в 80 кв.м., где можно принимать солнечные ванны и любоваться превосходным видом на море, горы и центральную набережную. Выполнен современный дизайнерский ремонт с привлечением дорогостоящих и качественных материалов. Данные апартаменты продаются полностью со всей мебелью и техникой. До моря не спеша 2 минуты ходьбы, собственный пляж. На территории самого комплекса в 1-Га., круглогодично работают SPA центр с 7-ю видами различных бань, рецепция, два закрытых бассейна (детский и взрослый), бильярдный зал, тренажорный зал, кафетерий, своя охраняемая круглосуточно закрытая от сторонних глаз замечательная парковая зона для Вашего отдыха, детская площадка. На весь комплекс стоит система кондиционирования и вентиляции воздуха.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ и готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продаётся шикарные трёх комнатные апартаменты в г. Алуште по ул. Паркова, 5',	'Продаётся шикарные трёх комнатные апартаменты в г. Алуште по ул. Паркова, 5',	'Продаётся шикарные трёх комнатные апартаменты в г. Алуште по ул. Паркова, 5',	'Продаётся шикарные трёх комнатные апартаменты в г. Алуште по ул. Паркова, 5',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(835,	1,	'Продается дом в поселке Малый Маяк г. Алушта',	'&amp;lt;p&amp;gt;\r\n	Общая площадь предлагаемого дома составляет 570 кв.м., строение представляет собой 4-х этажное монолитное здание, стены которого заполнены ракушечником (природный, экологически чистый камень), на первом этаже здания два гаража на 4 автомобиля, дом под внутреннюю отделку, фасад дома утеплен, дом стоит на участке 9 соток, с прекрасным видом на Чёрное Море. На автотранспорте к морю всего 5 минут, рядом остановка общественного транспорта. Предлагаемый нами Дом можно рассматривать как для собственного проживания и отдыха всей Вашей Семьи, а так - же под частную мини - гостиницу, которая будет приносить Вам дополнительный капитал.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Пакет документов РФ, к сделке готов.&amp;lt;/p&amp;gt;\r\n',	'Продается дом в поселке Малый Маяк г. Алушта',	'Продается дом в поселке Малый Маяк г. Алушта',	'Продается дом в поселке Малый Маяк г. Алушта',	'Продается дом в поселке Малый Маяк г. Алушта',	'Продаётся, купить, куплю, продажа, дом, гостиница, Малый Маяк, Алушта'),
(907,	1,	'Продаются два частных дома на участке 13 соток в пос. Изобильное, г. Алушты.',	'&amp;lt;p&amp;gt;\r\n	Продаются два частных дома на участке 13 соток в пос. Изобильное, г. Алушты. На участке с шикарным видом на город Алушту, море, Крымские горы и водохранилище, возведены: двухэтажный дом общей площадью в 98,8 кв. м., без внутренней отделки, с возможностью сделать отдельный вход на второй этаж, а также дом старой постройки под реконструкцию общей площадью в 62,1 кв. м. На территории возведено помещение под баню и сделан небольшой бетонный бассейн. Центр посёлка, магазины, амбулатория, школа в нескольких минутах ходьбы.&amp;lt;/p&amp;gt;\r\n',	'Продаются два частных дома на участке 13 соток в пос. Изобильное, г. Алушты.',	'Продаются два частных дома на участке 13 соток в пос. Изобильное, г. Алушты.',	'Продаются два частных дома на участке 13 соток в пос. Изобильное, г. Алушты.',	'Продаются два частных дома на участке 13 соток в пос. Изобильное, г. Алушты.',	'Продам, продажа, дом с участком, загородный дом, частный дом, с видом на море, с видом на озеро'),
(836,	1,	'Продаётся просторная 1-а комнатная квартира в г. Алушта, по ул. Чатырдагская 1а',	'&amp;lt;p&amp;gt;\r\n	Продаётся просторная 1-а комнатная квартира в г. Алушта, по ул. Чатырдагская 1а. Предлагаемая квартира находиться на 9-ом этаже/10-го дома. Квартира с общей площадью в 60 м.кв., с отличным видом на весь город и горы. Квартира под внутреннюю отделку, так же есть возможность переделать данную квартиру в 2-х комнатную, площадь квартиры свободной планировки. В доме консьерж, ухоженный подъезд, два лифта. Хорошая транспортная развязка, до моря и центральной городской набережной 7 минут пешком.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Все документы РФ к сделке готовы&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся просторная 1-а комнатная квартира в г. Алушта, по ул. Чатырдагская 1а',	'Продаётся просторная 1-а комнатная квартира в г. Алушта, по ул. Чатырдагская 1а',	'Продаётся просторная 1-а комнатная квартира в г. Алушта, по ул. Чатырдагская 1а',	'Продаётся просторная 1-а комнатная квартира в г. Алушта, по ул. Чатырдагская 1а',	'Продается, купить, куплю, продажа, квартиру, квартира, новостройка, город Алушта,'),
(839,	1,	'Продаётся двухкомнатная квартира по улице Платановая 1 в Алуште.',	'&amp;lt;div&amp;gt;\r\n	Уютная квартира площадью 67,6 кв.м., расположена в центральной части города Алушта, на 4 этаже пятиэтажного жилого дома. Включает в себя две светлые комнаты, просторную кухню, и полностью оборудованный сан.узел. Квартира газифицирована, установлен двухконтурный газовый котёл и отопительные радиаторы, уложены тёплые полы, сделана вся разводка по электрике, установлены кондиционеры. Так же полностью сделаны потолки и освещение, стены отделаны шёлковой декоративной штукатуркой, на кухне уложена плитка. Жилой дом расположен в зоне развитой городской инфраструктуры.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продаётся двухкомнатная квартира по улице Платановая 1 в Алуште.',	'Продаётся двухкомнатная квартира по улице Платановая 1 в Алуште.',	'Продаётся двухкомнатная квартира по улице Платановая 1 в Алуште.',	'Продаётся двухкомнатная квартира по улице Платановая 1 в Алуште.',	'продажа, квартира, Алушта, купить, ЮБК, центр, платановая'),
(840,	1,	'Продаётся 3-х комнатная квартира в Алуште по улице Платановая, 1.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продаётся 3-х комнатная квартира в Алуште по улице Платановая, 1.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Просторная квартира расположена на 5 этаже, общей площадью 80,5 кв.м. Жилой пяти этажный дом находится в центральной части города, территория закрытого типа, двор под круглосуточной охраной, ведётся постоянное видео наблюдение. На внутреннем дворе есть детская площадка, а так же зона для отдыха. Продаваемая квартира состоит из двух спальных комнат и совмещённых кухни и гостинной, есть возможность сделать 3 изолированные спальных комнаты. В квартире сделан дорогостоящий ремонт, сан.узел полностью оборудован, в кухне есть встроенная мебель, газовая плита, также установлено автономное газовое отопление и положен тёплый пол.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продаётся 3-х комнатная квартира в Алуште по улице Платановая, 1.',	'Продаётся 3-х комнатная квартира в Алуште по улице Платановая, 1.',	'Продаётся 3-х комнатная квартира в Алуште по улице Платановая, 1.',	'Продаётся 3-х комнатная квартира в Алуште по улице Платановая, 1.',	'куплю, продам, квартира, Алушта, Платановая, центр, элитная'),
(841,	1,	'Продается 3-х комнатная квартира в городе Алушта по ул. Платановая.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается 3-х комнатная квартира в городе Алушта по ул. Платановая.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Площадь квартиры, которая расположена на 5-м этаже, составляет 151,5 кв.м. В квартире три просторных и светлых комнаты, кухня,две лоджии также два сан. узла. Подключен газ, установлен двухконтурный газовый котёл, сделаны тёплые полы. Во всей квартире сделан дорогостоящий ремонт, стены отделаны декоративной шёлковой штукатуркой, потолок подвесной с дорогими светильниками. Жилой дом находится в центральном районе, с развитой инфраструктурой. Закрытая территория, наличие видеонаблюдения по периметру и охрана. Возле дома есть школа, магазин, аптека.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается 3-х комнатная квартира в городе Алушта по ул. Платановая.',	'Продается 3-х комнатная квартира в городе Алушта по ул. Платановая.',	'Продается 3-х комнатная квартира в городе Алушта по ул. Платановая.',	'Продается 3-х комнатная квартира в городе Алушта по ул. Платановая.',	'Продается, купить, куплю, продажа, квартиру, квартира, новостройка, город Алушта, Платановая, центр.'),
(844,	1,	'Продаётся земельный участок 8 соток в Алуште, Малый Маяк.',	'&amp;lt;p&amp;gt;\r\n	Участок предназначен под индивидуальное жилищное строительство, территориально расположен в посёлке Малый Маяк по ул. Таврической. Форма участка неправильная, небольшой уклон в сторону моря. Вдоль участка проходит асфальтированная дорога, также с другой стороны есть грунтовый подъезд. По соседству уже расположены жилые дома. Есть возможность подключения ко всем коммуникациям, вода есть на участке. Расстояние до центра около 200 метров, а до моря около 800 метров. С территории участка открывается прекрасный вид на горы море. Весь пакет документов РФ к сделке подготовлен.&amp;lt;/p&amp;gt;\r\n',	'Продаётся земельный участок 8 соток в Алуште, Малый Маяк.',	'Продаётся земельный участок 8 соток в Алуште, Малый Маяк.',	'Продаётся земельный участок 8 соток в Алуште, Малый Маяк.',	'Продаётся земельный участок 8 соток в Алуште, Малый Маяк.',	'Продам, куплю, участок, возле моря, ЮБК, Алушта, Малый Маяк'),
(862,	1,	'СРОЧНО!!! Продаётся дом г. Алушта поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	СРОЧНО!!! Продаётся дом г. Алушта поселок Лучистое. Дом ссобщей площадью в 200 кв.м., стоит на участке в 25 соток, назначение земли (ИЖС), дом строился для себя, строение представляет собой 2-х этажный дом, хороший монолитный каркас с заполнением ракушечника, экологически чистого природного камня, хорошая дорогая крыша, высокие потолки. С окон и участка открывается панорамный вид на горы, море и город, хорошая подъездная дорога к дому. Дом расположился у подножья горы «Демерджи» где всегда кристально чистейший и полезный воздух. Сделано остекление, вода подведена к участку, получены технические условия на воду, рядом газ и электроэнергия. Поселок газифицирован, есть школа, построили новый современный детский садик, магазин, ходит общественный транспорт в город. До города Алушта 8 км., личным транспортом 10 минут езды. Цена занижена изначально!!! Срочно!!!! Документы РФ к сделке готовы.&amp;amp;nbsp; &amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'СРОЧНО!!! Продаётся дом г. Алушта поселок Лучистое',	'СРОЧНО!!! Продаётся дом г. Алушта поселок Лучистое',	'СРОЧНО!!! Продаётся дом г. Алушта поселок Лучистое',	'СРОЧНО!!! Продаётся дом г. Алушта поселок Лучистое',	'Продается, продам, купить, куплю, дом, Лучистое, Алушта'),
(842,	1,	'Продаётся дом в городе Алушта посёлок Лавровое.',	'&amp;lt;div&amp;gt;\r\n	Дом площадью 260 м2, расположен на земельном участке размером 15 соток. Дом новой постройки в современном стиле,включает в себя 4 уютные спальни и 3 сан.узла, кухню совмещённую с просторной гостинной, также есть два балкона и подсобное помещение с прачечной. Помимо внутренней лестницы, дом также имеет отдельный вход для верхнего этажа. Высота потолков 3,2 метра, в районе лестницы высота полтолка достигла 10 метров. Дизайн всего интерьера сделан в стиле минимализм. В комнатах панорамные окна, из мрамора сделаны подоконники, столешницы, оформлен камин. Дом подключен ко всем коммуникациям, установлено отопление и газовый двухконтурный котёл. Двор облагорожен, также на территории есть места для парковки. Участок озеленён и огорожен по периметру. На участке сделан ландшафтный дизайн, высажены декоративные и фруктовые деревья. Из окон дома открывается шикарный панорамный вид в сторону моря и гор. Все документы к сделке готовы, в доме никто не прописан.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продаётся дом в городе Алушта посёлок Лавровое.',	'Продаётся дом в городе Алушта посёлок Лавровое.',	'Продаётся дом в городе Алушта посёлок Лавровое.',	'Продаётся дом в городе Алушта посёлок Лавровое.',	'продам, куплю, дам, Гурзуф, Партенит, Алушта, Лавровое, у моря, коттедж, Аю-Даг.'),
(843,	1,	'Продается трехкомнатная квартира в центре города Алушта.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается трехкомнатная квартира в центре города Алушта. Площадь продаваемой квартиры 76 кв.м., расположенной по улице Платановой 1, на первом этаже в пятиэтажном доме. В квартире две раздельные спальные комнаты, кухня совмещенная с уютной гостинной и просторная прихожая, сан.узел совмещённый. Есть автономное отопление, установлен газовый двухконтурный котёл, положен тёплый пол. Установлены кондиционеры. По всей квартире сделан хороший ремонт и установлена мебель. Из окон гостинной открывается вид на виноградники и горы. Дом находится в зоне развитой городской инфраструктуры, возле дома расположены магазин и школа.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается трехкомнатная квартира в центре города Алушта.',	'Продается трехкомнатная квартира в центре города Алушта.',	'Продается трехкомнатная квартира в центре города Алушта.',	'Продается трехкомнатная квартира в центре города Алушта.',	'продажа, квартира, Алушта, ЮБК, центр, Платановая, куплю'),
(816,	1,	'Продается квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;СРОЧНО! На две недели цена снижена. Продаётся квартира в г. Алушта в самом элитном доме «Дача Доктора Штейнгольца». Комплекс находится рядом с приморским парком, что по истине делает место расположения уникальным. В шаговой доступности городская центральная набережная, пляж. Территория комплекса закрыта от внешних глаз и находиться под круглосуточной охраной, есть двухуровневый подземный паркинг, имеется свой пляж. Это не апартаменты, это квартира, что делает этот комплекс более привлекательным, кто решил переехать на Южный Берег Крыма, возможна прописки. Квартира находиться на 2-м этаже, с общей площадью в 100 кв.м., из которых 9.7 кв.м., открытая лоджия, квартира под отделку, в стоимость входит парковочное место в подземном паркинге(15 кв.м.). Так же возможно приобрести дополнительное еще парко места. Все документы на квартиру и паркинг РФ готовы к сделке. Сделка свободная, 1 собственник, прописанных нет. Торопитесь стать счастливым владельцем элитной недвижимости на ЮБК.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p lang=&amp;quot;zxx&amp;quot; style=&amp;quot;margin-bottom: 0cm&amp;quot;&amp;gt;\r\n	&amp;lt;span lang=&amp;quot;ru-RU&amp;quot;&amp;gt;Все документы РФ к сделке готовы.&amp;amp;nbsp;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается  квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается квартира в г. Алушта в самом элитном доме &amp;quot;Дача Доктора Штейнгольца&amp;quot;',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(845,	1,	'Продается 3-х комнатная квартира в Алуште по ул. Ленина 41.',	'&amp;lt;p&amp;gt;\r\n	Продается 3-х комнатная квартира в Алуште по ул. Ленина 41. Квартира, площадь которой 55 кв. м., имеет стандартную планировку и расположена на 1-м этаже, дом 5-ти этажный. В квартире есть газ и центральное отопление. Подключена газовая колонка. На кухне установлена техника, плита газовая, есть стиральная машина. Установлен кондиционер. Окна и двери по всей квартире из натурального дерева. Также есть металлические решетки, установленные на окнах. Сан. узел раздельный. Подъезд жилого дома чистый, входная дверь имеет кодовый замок. Дворик дома ухожен. Дом расположен в центральном районе, рядом магазины, школа и детский сад, почтовое и банковское отделения, не далеко рынок. Городская инфраструктура района хорошо развита.&amp;lt;/p&amp;gt;\r\n',	'Продается 3-х комнатная квартира в Алуште по ул. Ленина 41.',	'Продается 3-х комнатная квартира в Алуште по ул. Ленина 41.',	'Продается 3-х комнатная квартира в Алуште по ул. Ленина 41.',	'Продается 3-х комнатная квартира в Алуште по ул. Ленина 41.',	'Продам, куплю, квартира, Алушта, улица Ленина, центр'),
(846,	1,	'Продается 2-х комнатная квартира по ул . Пионерская 17',	'&amp;lt;p&amp;gt;\r\n	Продается 2-х комнатная квартира по ул . Пионерская 17 в центре Алушты. Общая площадь предлагаемой квартиры составляет 44 кв.м., расположена на 5-м этаже в 5-ти этажном доме в центральной части города. Квартира под ремонт. Планировка квартиры предусматривает раздельные комнаты и раздельный сан. узел. Из кухни и комнаты есть выходы на большую лоджию, из квартиры прекрасный вид на горы и море, также хорошо просматривается сверху восточная часть города. В квартире газ, установлен бойлер. Дом расположен в тихом районе, при этом все объекты городской инфраструктуры расположены по близости.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира по ул . Пионерская 17',	'Продается 2-х комнатная квартира по ул . Пионерская 17',	'Продается 2-х комнатная квартира по ул . Пионерская 17',	'Продается 2-х комнатная квартира по ул . Пионерская 17',	'Продается, продажа, купить, куплю, квартиру, квартиры, Алушта'),
(847,	1,	'Продаётся четырёхэтажный дом гостиничного типа в Алуште.',	'&amp;lt;p&amp;gt;\r\n	Строение площадью в 400 кв. м. на участке в 6,5 соток, под отделку, расположено на улице Сергеева-Ценского. Дом спланирован под две половины хозяйскую и гостевую. Гостевая насчитывает 9 номеров, также можно рассматривать всё строение под гостиницу, примерно 15 гостиничных номеров. Строение представляет собой монолитный каркас с заполнением ракушечника, экологически чистого природного камня. Выполнен согласно всем сейсмическим нормам, сейсмоустойчивостью 8-9 баллов. Вкруговую установлены металлопластиковые окна, в хозяйской части также уже установлены балконные блоки, металлические ограждения балконов установлены. Все коммуникации централизованные, хорошие мощности. Территория двора ограждена и граничит с хвойным лесом. С гостиницы открывается панорамный вид на город, горы и море, к морю 700 метров.&amp;lt;/p&amp;gt;\r\n',	'Продаётся четырёхэтажный дом гостиничного типа в Алуште.',	'Продаётся четырёхэтажный дом гостиничного типа в Алуште.',	'Продаётся четырёхэтажный дом гостиничного типа в Алуште.',	'Продаётся четырёхэтажный дом гостиничного типа в Алуште.',	'продам, продаётся, продажа, куплю, купить, гостиница, дом, Алушта'),
(848,	1,	'Продаётся четырёхкомнатная квартира по улице Платановой 1 в г. Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продаётся четырёхкомнатная квартира по улице Платановой 1 в г. Алушта. Продаваемая квартира с площадью 88 кв. м. и расположена на третьем этаже в пятиэтажном доме, постройка 2007 года, рядом с центром города. Планировка этой большой квартиры включает в себя три спальни, совмещённую просторную гостиную-кухню, два сан. узла, также есть лоджия и гардеробная. В квартире сделан дорогой ремонт, мебель и техника установлены. Жилой дом газифицирован, установлено автономное газовое отопление, есть теплые полы, кондиционеры по всей квартире. Из уютной гостиной открывается шикарный вид на виноградники и гору Чатырдаг. Территория дома закрытого типа, видеонаблюдение ведётся круглосуточно, есть охрана. На территории свой внутренний ухоженный дворик с детской площадкой. &amp;amp;nbsp;Рядом с жилым домом расположены магазины, школы, детский сад.&amp;lt;/p&amp;gt;\r\n',	'Продаётся четырёхкомнатная квартира по улице Платановой 1 в г. Алушта.',	'Продаётся четырёхкомнатная квартира по улице Платановой 1 в г. Алушта.',	'Продаётся четырёхкомнатная квартира по улице Платановой 1 в г. Алушта.',	'Продаётся четырёхкомнатная квартира по улице Платановой 1 в г. Алушта.',	'продам, куплю, продаётся, квартира, Алушта, центр, Платановая'),
(849,	1,	'Продаётся 1-комнатная квартира в центре города Алушта.',	'&amp;lt;p&amp;gt;\r\n	Квартира-студия находится по улице Платановая 1, на втором этаже девятиэтажного нового здания. На площади в 33,8 кв. м. расположена одна просторная комната, вход в сан. узел из прихожей. В квартире выполнена черновая отделка, установлен газовый двухконтурный котёл и отопительные радиаторы. Территория нового дома закрытого типа, есть охрана, ведётся круглосуточное видеонаблюдение. Двор облагорожен, внутри есть обустроенная зона для отдыха с детьми. Магазин, две школы, детский садик расположены в непосредственной близости от новостройки. Так же неподалёку находятся фитнес клубы, аптеки, теннисный корт, бассейн и другие объекты городской инфраструктуры. К морю и парку можно пройти за 5 минут.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся 1-комнатная квартира в центре города Алушта.',	'Продаётся 1-комнатная квартира в центре города Алушта.',	'Продаётся 1-комнатная квартира в центре города Алушта.',	'Продаётся 1-комнатная квартира в центре города Алушта.',	'квартира, Алушта, Платановая, куплю, продам, центр'),
(851,	1,	'Продаётся квартира однокомнатная в центре города Алушты',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира однокомнатная в центре города Алушты. Расположена квартира, общей площадью 50,9 кв. м., на 2-м этаже нового девятиэтажного жилого дома по адресу Платановая 1. Квартира типа студия, имеет просторную, светлую кухонно-гостиную зону, предусмотрена и спальная зона с большими окнами, которую при желании можно выделить отдельную спальную комнату. Жилой дом газифицирован, предусмотрено и установлено автономное газовое отопление, подключен двухконтурный котёл. Окна квартиры выходят на виноградное поле и Крымские горы. Территория нового дома закрытого типа, из чистого и ухоженного подъезда выход на внутренний озеленённый двор с детской площадкой. По периметру круглосуточное видеонаблюдение, есть охрана. Новостройка расположена в оживлённом районе, недалеко от моря.&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира однокомнатная в центре города Алушты',	'Продаётся квартира однокомнатная в центре города Алушты',	'Продаётся квартира однокомнатная в центре города Алушты',	'Продаётся квартира однокомнатная в центре города Алушты',	'Купить, куплю, продается, квартира, квартиру, Алушта, платановая '),
(852,	1,	'Продается однокомнатная квартира в г. Алуште, улица Платановая',	'&amp;lt;p&amp;gt;\r\n	Продается однокомнатная квартира в Алуште, улица Платановая. Продаваемая квартира площадью в 39 .7 кв. м., расположена в современном элитном комплексе в центральной части города. Комплекс закрытого типа, с двумя заездами на территорию, возле каждого заезда пульт охраны, по периметру камеры видеонаблюдения. На территории комплекса расположены два здания, одно 6-ти этажное, другое 9-ти этажное. Предлагаемая квартира расположена в 9-ти этажном доме на третьем этаже. В квартире сделан современный ремонт, положены тёплые полы в сан. узле, сделана разводка электрики, подключен газовый двухконтурный котёл итальянской сборки, установлен кондиционер. Окна тёплой и светлой квартиры выходят на юг. В доме установлен современный лифт, с электронным ключом. Инфраструктура развитая, рядом школа и садик, у дома магазин, остановка городского транспорта в ста метрах. Все документы к сделке готовы, продажа свободная.&amp;lt;/p&amp;gt;\r\n',	'Продается однокомнатная квартира в г. Алуште, улица Платановая',	'Продается однокомнатная квартира в г. Алуште, улица Платановая',	'Продается однокомнатная квартира в г. Алуште, улица Платановая',	'Продается однокомнатная квартира в г. Алуште, улица Платановая',	'Купить, куплю, квартиру, квартира, продам, продается, город Алушта, платановая'),
(853,	1,	'Продаётся 1-комнатная квартира на Платановой улице в Алуште',	'&amp;lt;p&amp;gt;\r\n	Квартира расположена в новом доме на 3-м этаже, в центральной части города. Территория девятиэтажной новостройки закрытого типа, со своим внутренним двором. В квартире площадью 50,9 кв. м., есть спальная комната, кухня условно поделена на кухонную и столовую зоны. Окна с видом на виноградное поле, часть города и горы. В квартире сделан хороший ремонт, комбинированные потолки из натяжного полотна и гипсокартона, встроены светильники, подключен котёл газовый двухконтурный, установлены кондиционеры. Кухня подготовлена под установку мебели, из техники есть холодильник и стиральная машина. Пакет документов РФ готов к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 1-комнатная квартира на Платановой улице в Алуште',	'Продаётся 1-комнатная квартира на Платановой улице в Алуште',	'Продаётся 1-комнатная квартира на Платановой улице в Алуште',	'Продаётся 1-комнатная квартира на Платановой улице в Алуште',	'Купить, куплю, квартиру, квартира, продам, продается, город Алушта, платановая'),
(850,	1,	'Продается квартира двухкомнатная на Платановой, в Алуште',	'&amp;lt;p&amp;gt;\r\n	Продается квартира двухкомнатная на Платановой, в Алуште. Квартира с общей площадью 64,3 кв. м. находится в 9-ти этажном новом доме на улице Платановой 1, этаж 2-й, двор закрытого типа, есть охрана, ведётся видеонаблюдение по территории. Из окон 2-го этажа, на котором расположена квартира открывается шикарный вид на виноградники и Чатыградагскую горную гряду и Демерджи. Просторная светлая квартира представлена как совмещённая кухня плюс столовая, и отдельная комната. Черновая отделка выполнена, квартира подготовлена под ремонт. Система автономного газового отопления установлена, подключен газовый двухконтурный котел. Новый жилой дом расположен в центральной зоне города, рядом с домом находятся общеобразовательные школы, детский сад, и магазины, инфраструктура района развитая, до моря около 700 метров.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира двухкомнатная на Платановой, в Алуште',	'Продается квартира двухкомнатная на Платановой, в Алуште',	'Продается квартира двухкомнатная на Платановой, в Алуште',	'Продается квартира двухкомнатная на Платановой, в Алуште',	'Купить, куплю, продается, продам, квартиру, квартира, двухкомнатная, Алушта, платановая'),
(854,	1,	'Продаётся квартира 2- х комнатная в центре Алушты.',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира 2- х комнатная в центре Алушты. Видовая квартира общей площадью в 118,9 м2, расположена на 5-м этаже, девятиэтажной новостройки с закрытой территорией, охраной и видеонаблюдением по улице Платановая 1. Квартира включает в себя две отдельные комнаты с видом в сторону моря, одна из комнат имеет выход в отдельный сан. узел, которых в квартире два, во второй комнате кроме вида в сторону моря, открывается ещё и прекрасный вид на горы. Большая кухня-столовая также видовая. Квартира подготовлена под отделку, уложен тёплый пол, сделана разводка труб под отопительные радиаторы и установлен настенный двухконтурный газовый котёл. Район, в котором расположен жилой дом, очень удобен, в шаге расположен магазин и школа, в пяти минутах ходьбы дет. садик и городская администрация. Банки, спортзал, бассейн всё расположено поблизости.&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира 2- х комнатная в центре Алушты.',	'Продаётся квартира 2- х комнатная в центре Алушты.',	'Продаётся квартира 2- х комнатная в центре Алушты.',	'Продаётся квартира 2- х комнатная в центре Алушты.',	'Продам ,продажа, куплю, квартира, Алушта, Платановая, центр'),
(855,	1,	'Продаётся квартира двухкомнатная на улице Платановая 1, центр. ',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира двухкомнатная на улице Платановая 1, центр. Просторная квартира с хорошим видом, площадью 110,3 м2, расположена 5 этаже, девятиэтажного нового жилого дома в Алуште. Квартира с выполненной черновой отделкой, подключена к газовому снабжению, установлен газовый счётчик и настенный двухконтурный котёл, система автономного отопления подготовлена к установке отопительных водяных радиаторов. В квартире одна большая светлая комната с окнами, выходящими на город в сторону моря и отдельным сан. узлом, вторая комната поменьше с видом на горные склоны Чатырдага и Демерджи, просторная кухня так же видовая. Двор новостройки закрытого типа, охраняется, видеонаблюдение ведётся круглосуточно, также на территории установлена запасная автономная электроподстанция. Дом находится в тихом зелёном районе рядом с центром, детский садик, лицей и школа в 2-х минутах ходьбы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира двухкомнатная на улице Платановая 1, центр. ',	'Продаётся квартира двухкомнатная на улице Платановая 1, центр. ',	'Продаётся квартира двухкомнатная на улице Платановая 1, центр. ',	'Продаётся квартира двухкомнатная на улице Платановая 1, центр. ',	'продажа, квартира, купить, Алушта, центр, Платановая, продам, куплю'),
(856,	1,	'Продаётся квартира 3-х комнатная в центре города Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира 3-х комнатная в центре города Алушта. Просторная видовая квартира, площадью 120,1 м2, расположена в 9-ти этажной жилой новостройке на улице Платановой 1, этаж 7-й. В квартире хороший ремонт, с использованием качественных строительных материалов. Встроена кухонная мебель, по всей квартире частично установлена новая мебель, сделана разводка под установку светильников. Два полностью обустроенных сан. узла. Отопление газовое автономное, установлен итальянский двухконтурный котёл. Из всех окон квартиры захватывающий вид горы и близлежащие посёлки, так же хорошо видно море и прибрежную сторону города. Внутренний дворик озеленен, для детей предусмотрена игровая площадка. Есть охрана, видеонаблюдение, территория закрыта. У дома есть своя электроподстанция. Район развитый, дет. сад и школа, рядом магазинчик, аптека неподалёку.&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира 3-х комнатная в центре города Алушта.',	'Продаётся квартира 3-х комнатная в центре города Алушта.',	'Продаётся квартира 3-х комнатная в центре города Алушта.',	'Продаётся квартира 3-х комнатная в центре города Алушта.',	'продажа, продам, куплю, Алушта, квартира, центр, Платановая'),
(857,	1,	'Продаётся однокомнатная квартира, видовая в г. Алушта по ул. Школьная 19',	'&amp;lt;p&amp;gt;\r\n	Продаётся однокомнатная квартира, видовая в г. Алушта по ул. Школьная 19. Квартира находится на 10-м этаже 12-и этажного монолитного здания, площадь данной квартиры составляет 45 кв.м., с восхитительным видом на город и горы. Предлагаемая квартира под черновую отделку с индивидуальной планировкой. В доме есть магазин, парикмахерская, развивающий центр для детей дошкольного возраста, закрытая охраняемая территория, паркинг подземный, в доме установлены два лифта (грузовой и пассажирский), на территории дома детская зона отдыха, ухоженная территория. Развитая инфраструктура, рядом, детский садик, школа в 10 минутах ходьбы, автовокзал, несколько супермаркетов, рыночек.&amp;lt;/p&amp;gt;\r\n',	'Продаётся однокомнатная квартира, видовая в г. Алушта по ул. Школьная 19',	'Продаётся однокомнатная квартира, видовая в г. Алушта по ул. Школьная 19',	'Продаётся однокомнатная квартира, видовая в г. Алушта по ул. Школьная 19',	'Продаётся однокомнатная квартира, видовая в г. Алушта по ул. Школьная 19',	'Купить, куплю, квартиру, квартира, продам, продается, город Алушта, однокомнатная, школьная 19'),
(858,	1,	'Продаётся участок 13.5 соток г. Алушта, в поселке Кипарисное, ул. Карасановская',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 13.5 соток г. Алушта, в поселке Кипарисное, ул. Карасановская. Участок ровный у асфальтированной дороги, соседи рядом уже построились, участки находятся в районе санатория «Карасан». С участка открывается вид на моря, по левую сторону участка виноградники, рядом протекает речка, до моря всего 500 метров. Все коммуникации рядом. Отличное место для строительства загородной виллы или частной гостиницы. Так же есть возможность увеличить площадь, купив два смежные участка по 13.5 соток.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 13.5 соток г. Алушта, в поселке Кипарисное, ул. Карасановская',	'Продаётся участок 13.5 соток г. Алушта, в поселке Кипарисное, ул. Карасановская',	'Продаётся участок 13.5 соток г. Алушта, в поселке Кипарисное, ул. Карасановская',	'Продаётся участок 13.5 соток г. Алушта, в поселке Кипарисное, ул. Карасановская',	'Продам, продается, купить, куплю, участок, город Алушта, поселок Кипарисное, Карасан'),
(859,	1,	'Продаётся земельный участок 6 соток в Изобильном, Алушта',	'&amp;lt;p&amp;gt;\r\n	Участок с видом на море, часть села Изобильное города Алушты и Крымские горы, расположен на большой поляне без зелёных насаждений, с небольшим уклоном, в сторону горного ручья. За границей участка расположен дубовый лес, неподалёку виноградники. К магазину в селе Изобильном можно дойти за 10 минут, до ближайшей автобусной остановки 7 минут ходьбы. До города всего несколько километров. Участок имеет назначение под индивидуальное жилищное строительство. Ближайшие дома газифицированы, есть возможность подвести газ. На другой стороне поляны, на которой расположен участок есть столбы линий электропередач. Грунтовая дорога проходит до участка.&amp;lt;/p&amp;gt;\r\n',	'Продаётся земельный участок 6 соток в Изобильном, Алушта',	'Продаётся земельный участок 6 соток в Изобильном, Алушта',	'Продаётся земельный участок 6 соток в Изобильном, Алушта',	'Продаётся земельный участок 6 соток в Изобильном, Алушта',	'Продается, продам, купить, куплю, участок, Алушта, Изобильное'),
(860,	1,	'Продаётся участок 6 соток видовой г. Алушта поселок Изобильное',	'&amp;lt;p&amp;gt;\r\n	Продается участок, видовой, 6 соток г. Алушта в поселке Изобильное, переулок Фруктовый. Участок видовой, с участка открывается прекрасный вид на море, город и горы, а так же и на водохранилище. Место хорошо застраиваемое. Коммуникации рядом, свет, вода (газ в перспективе, год), сам поселок газифицирован. К участку ведет хорошая грунтовая подъездная дорога 400 метров, до города 4 км. В поселке школа, магазины, амбулаторный пункт.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 6 соток видовой г. Алушта поселок Изобильное',	'Продаётся участок 6 соток видовой г. Алушта поселок Изобильное',	'Продаётся участок 6 соток видовой г. Алушта поселок Изобильное',	'Продаётся участок 6 соток видовой г. Алушта поселок Изобильное',	''),
(861,	1,	'Продаётся дом в Алуште, центр п.Изобильное. ',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;background-color: rgb(245, 245, 245); color: rgb(51, 51, 51); font-family: &amp;amp;quot;Trebuchet MS&amp;amp;quot;, &amp;amp;quot;Helvetica Neue&amp;amp;quot;, Helvetica, Arial, sans-serif; font-size: 13px;&amp;quot;&amp;gt;Дом 300 кв.м. стоит на участке 15 соток категории земель (ИЖС). С территории участка открывается прекрасный вид на нижнюю часть посёлка, море, гору Кастель и высочайшую крымскую Бабуган-Яйлу. Участок граничит с небольшим дубовым лесом, а выход имеет на центральную улицу Изобильного, здесь же расположено здание, непосредственно выходящее на улицу, которое при желании можно использовать даже под коммерцию. Во дворе есть площадка для парковки автомобилей. Внешне дом выполнен с использованием элементов викторианского стиля, здесь и высокие сводчатые окна, и просторная веранда, и мансарда, и комбинирование отделочных материалов фасада здания.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом в Алуште, центр п.Изобильное. ',	'Продаётся дом в Алуште, центр п.Изобильное. ',	'Продаётся дом в Алуште, центр п.Изобильное. ',	'Продаётся дом в Алуште, центр п.Изобильное. ',	'купить, дом, алушта, изобильное, продажа, центр'),
(863,	1,	'Продаётся гараж пл. в 13 кв. м. в Алуште, ул. Кипарисная. ',	'&amp;lt;p&amp;gt;\r\n	На участке в 19 кв. м. выстроен капитальный гараж. Размер гаража 2,6 метра на 5 метров. Есть освещение. Расположен в центральной части города, коммуникации рядом, соседние гаражи построены.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся гараж пл. в 13 кв. м. в Алуште, ул. Кипарисная.',	'Продаётся гараж пл. в 13 кв. м. в Алуште, ул. Кипарисная.',	'Продаётся гараж пл. в 13 кв. м. в Алуште, ул. Кипарисная.',	'Продаётся гараж пл. в 13 кв. м. в Алуште, ул. Кипарисная.',	'продажа, продам, куплю, гараж, Алушта, в центре'),
(864,	1,	'Продается участок 4 сотки в г. Алушта на восточной набережной в районе «Дельфина»',	'&amp;lt;p&amp;gt;\r\n	Продается участок 4 сотки в г. Алушта на восточной набережной. Участок видовой, берег моря (100 метров). Вид не перекрываемый, ухоженый галечный пляж, в летнее время работают магазины, аптека, ходит общественный транспорт. Так же есть тельфер (кран) для спуска на воду водного транспорта. Расстояние до центра города 4 км, 70% участка без растительности. Возможность подключения коммуникаций есть. Дополнительные вопросы по телефону.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 4 сотки в г. Алушта на восточной набережной в районе «Дельфина»',	'Продается участок 4 сотки в г. Алушта на восточной набережной в районе «Дельфина»',	'Продается участок 4 сотки в г. Алушта на восточной набережной в районе «Дельфина»',	'Продается участок 4 сотки в г. Алушта на восточной набережной в районе «Дельфина»',	'Куплю, купить, продажа, продаётся, участок, Алушта, Дельфин'),
(865,	1,	'Продаётся дом на участке в 12 соток г. Алушта поселок Лазурное',	'&amp;lt;p&amp;gt;\r\n	Дом двух этажный на 100 кв.м., второй этаж мансарда, на участке есть несколько отдельно стоящих строений, которые в летнее время сдаются как номера. С участка открывается замечательный не перекрываемый вид на море. Одна половина участка абсолютно ровная и не застроена 6 соток. Все коммуникации подключены и заведены. Хорошая подъездная дорога, есть гараж. Предлагаемая недвижимость находится в экологически чистом месте у подножья горы «Костель». На участке так же растут плодово-ягодные деревья. Район хорошо застраиваемый, до моря 500 метров.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом на участке в 12 соток г. Алушта поселок Лазурное',	'Продаётся дом на участке в 12 соток г. Алушта поселок Лазурное',	'Продаётся дом на участке в 12 соток г. Алушта поселок Лазурное',	'Продаётся дом на участке в 12 соток г. Алушта поселок Лазурное',	'Купить, куплю, продажа, продам, продаётся, дом, Алушта, Лазурное'),
(866,	1,	'Продаётся участок земельный 6 соток в с. Изобильном гор. Алушты.',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок земельный 6 соток в с. Изобильном гор. Алушты. Участок расположен на улице Изобильненской на умеренном уклоне в восточном направлении, с шикарным видом на гору Демерджи и частично на море. С предназначением под индивидуальное жилищное строительство. Рядом с участком проходит автомобильная дорога с тротуаром. Соседние участки застраиваются, также есть уже полностью построенные дома. Возможность подключения к коммуникациям есть, газификация района в перспективе, сам посёлок газифицирован. Инфраструктура посёлка Изобильное развитая, есть школа, библиотека, амбулаторный пункт, хозяйственные, продуктовые магазины. В нескольких минутах ходьбы расположена автобусная остановка, неподалёку трасса и троллейбусные остановки, за несколько минут можно доехать до соседнего пос. Нижняя Кутузовка, где есть детский садик. До города Алушта поездка на авто займёт не более 7 минут.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок земельный 6 соток в с. Изобильном гор. Алушты.',	'Продаётся участок земельный 6 соток в с. Изобильном гор. Алушты.',	'Продаётся участок земельный 6 соток в с. Изобильном гор. Алушты.',	'Продаётся участок земельный 6 соток в с. Изобильном гор. Алушты.',	'Продаётся, продам, куплю, купить, участок, Изобильное, Алушта'),
(867,	1,	'Продаётся квартира двух комнатная в г. Алушта в районе центральной набережной',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира двух комнатная в г. Алушта в районе центральной набережной. Дом находится в 50 метровой береговой зоне, в районе центральной набережной города. Первая береговая линия! Продаваемая квартира представляет собой часть дома, общей площадью 52.7 кв.м., жилая площадь составляет 25 кв.м., и кухня 2 кв.м. Очень хорошее и перспективное место для постоянного места проживания, а так же под сдачу номеров. Сама квартира спроектирована как две отдельные однокомнатные номера с отдельными входами. Первая комната с отдельным входом спальня с площадью 13.1 кв.м., кухня 1.6 кв.м., сан. Узел с душевой 1.8 кв.м. Вторая отдельная комната спальня 8.9 кв.м., широкий коридор с витражными окнами и видом на моря 6.3 кв.м., так же с отдельным входом и площадкой для отдыха, сан. Узел душевая 3 кв.м. Предлагаемая квартира полностью оборудована всей необходимой мебелью и техникой (стиральная машина, телевизор, кондиционеры, камин, установлен двухконтурный газовый котел) год назад был сделан капитальный ремонт полов и стен, проведено собственное отопление от газового котла, в душевых комнатах положен кафель, заезжай и живи! Так же к продаже отдается сарай (времянка) на 16 кв.м., оборудованная мебелью, заведен свет, вода, есть сан. Узел, так же используется в летнее время для проживания, есть возможность поднять второй этаж. Место расположение действительно уникальное, центральная набережная Алушты 50 метров, все в шаговой доступности, пляжи, множественные развлечения, кафе и рестораны, кинотеатр, зеленый парк для отдыха, чистый и полезный морской воздух, а самое главное все это у Вас под боком.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира двух комнатная в г. Алушта в районе центральной набережной',	'Продаётся квартира двух комнатная в г. Алушта в районе центральной набережной',	'Продаётся квартира двух комнатная в г. Алушта в районе центральной набережной',	'Продаётся квартира двух комнатная в г. Алушта в районе центральной набережной',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, часть дома, город Алушта,  '),
(868,	1,	'Продаётся участок 7.5 соток г. Алушта поселок Малый Маяк',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 7.5 соток г. Алушта поселок Малый Маяк. Участок находится выше трасы Ялта-Симферополь с хорошими подъездными путями, асфальтированный подъезд + 150 метров грунтовой хорошей дороги к участку. Участок правильной прямоугольной формы, абсолютно ровный, по границам участка проходят все коммуникации включая (газ, электричество и централизованную воду). Участок находится в дали от городской суеты, всего в 8 км. от города, тихое место с видом на море и чистым воздухом, закрыто от господствующих ветров, так же плюсом является расположение участка в зоне не подверженной оползням. Еще одним из плюсов данного участка, рядом протекает горный родник, как дополнительный источник водоснабжения кристально чистой природной водой. Место хорошо застраиваемое, рядом расположены такие же участки на которых уже построились соседи. Просто отличное место для загородного дома, коттеджа или Вилы. Вид не перекроют!!!&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 7.5 соток г. Алушта поселок Малый Маяк',	'Продаётся участок 7.5 соток г. Алушта поселок Малый Маяк',	'Продаётся участок 7.5 соток г. Алушта поселок Малый Маяк',	'Продаётся участок 7.5 соток г. Алушта поселок Малый Маяк',	'Продаётся, купить, куплю, продажа, участок, продам, Малый Маяк, Алушта'),
(869,	1,	'Продаётся 2-х комнатная квартира в Алуште, мр-н 60 лет СССР.',	'&amp;lt;p&amp;gt;\r\n	Видовая квартира общей площадью 62,5 кв. м. расположена на 12-м этаже двенадцатиэтажного дома. Из окон квартиры открывается шикарный вид в юго-восточном направлении, виноградники, гора Демержди, Чёрное море и центральная часть города. В квартире две изолированные комнаты, одна из них с выходом на большую и светлую лоджию, раздельный сан. узел и просторная кухня объединённая с балконом. В доме два грузовых лифта, над квартирой расположено кладовое помещение, сушильная комната на несколько квартир. Рядом с домом есть детская площадка, неподалёку рынок, магазины, детский сад, школа.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся 2-х комнатная квартира в Алуште, мр-н 60 лет СССР.',	'Продаётся 2-х комнатная квартира в Алуште, мр-н 60 лет СССР.',	'Продаётся 2-х комнатная квартира в Алуште, мр-н 60 лет СССР.',	'Продаётся 2-х комнатная квартира в Алуште, мр-н 60 лет СССР.',	'Продам, куплю, продажа, продаётся, Алушта, автовокзал'),
(870,	1,	'Продаётся видовой участок 10 соток г. Алушта поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	Участок имеет правильную форму, расположен на ровной местности, по границам участка проходят линии электропередач, газовая труба. С земельного участка открывается замечательный панорамный вид в сторону города, Чёрного моря и гор. Хорошо застраиваемое место, рядом уже построены дома. К данному земельному участку ведёт хорошо накатанная грунтовая дорога 200 метров, за ней уже асфальтированная дорога которая ведет в центр поселка и в город. Поселок с развитой инфраструктурой, новый детский сад, школа общего образования, несколько магазинов, остановки общественного транспорта. До города 8 километров. Поселок расположен у подножья горы «Демерджи» которая привлекает к себе массу туристов, с уникальными маршрутами (Джип туры, конные прогулки, квадроциклы и многое другое). Чистый горный воздух и кристально чистая горная вода.&amp;amp;nbsp;&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся видовой участок 10 соток г. Алушта поселок Лучистое',	'Продаётся видовой участок 10 соток г. Алушта поселок Лучистое',	'Продаётся видовой участок 10 соток г. Алушта поселок Лучистое',	'Продаётся видовой участок 10 соток г. Алушта поселок Лучистое',	'Продаётся видовой участок 10 соток г. Алушта поселок Лучистое'),
(871,	1,	'Продаётся участок 10 соток ИЖС г. Алушта в поселке Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 10 соток ИЖС г. Алушта в поселке Лучистое. Участок имеет прямоугольную правильную форму, немного продолговатую. Участок развернут на Юг с видом на море, горы и город. Рядом есть уже строения, к которым заведены коммуникации. Есть возможность подключения к свету и газу. Хорошие подъездные пути к участку. Вид не перекроют 100%. В поселке есть все необходимое для постоянного проживания, чистый воздух, горная вода, магазины, школа, новый детский садик, общественный транспорт. До города 8 км.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 10 соток ИЖС г. Алушта в поселке Лучистое',	'Продаётся участок 10 соток ИЖС г. Алушта в поселке Лучистое',	'Продаётся участок 10 соток ИЖС г. Алушта в поселке Лучистое',	'Продаётся участок 10 соток ИЖС г. Алушта в поселке Лучистое',	'Продаётся, купить, куплю, продажа, продам, участок, Алушта, поселок Лучистое'),
(872,	1,	'Продается квартира двухкомнатная на Юбилейной ул., Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира двухкомнатная на Юбилейной ул., Алушта. Квартира с хорошим видом на горы и море, расположена на 8-м этаже в 10-ти этажном здании. Общая площадь продаваемой квартиры составляет 41,3 кв. м. состоит из двух полноценных комнат, кухни, раздельного сан. узла. В комнате установлен кондиционер, есть бойлер в кухне. Дополнительно есть выход на общий балкон. Непосредственно возле дома расположена остановка общественного транспорта и магазин самообслуживания. Жилой дом расположен в спальном районе, в двух минутах ходьбы от автовокзала, рядом супермаркеты, рынок, школа, детский сад, почта и банковские отделения. Расстояние до центральной набережной и моря около километра.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира двухкомнатная на Юбилейной ул., Алушта.',	'Продается квартира двухкомнатная на Юбилейной ул., Алушта.',	'Продается квартира двухкомнатная на Юбилейной ул., Алушта.',	'Продается квартира двухкомнатная на Юбилейной ул., Алушта.',	'продаётся, продам, купить, куплю, Алушта, Юбилейная'),
(873,	1,	'СРОЧНО!!! Продается дом 109 кв.м. г. Алушта в поселке Лучистое',	'&amp;lt;p&amp;gt;\r\n	СРОЧНО!!! Продается дом 109 кв.м. г. Алушта в поселке Лучистое. Дом построен совсем недавно, строение представляет собой монолитный каркас с заполнением ракушечника, под чистовую отделку. Дом спланирован следующим образом: кухня 14.1 кв.м., гостиная 24.5 кв.м., комната 18.8 кв.м., вторая комната 13.1 кв.м., сан. Узел 8.2 кв.м., кладовая 7 кв.м. Жилой площади 56.4 кв.м. В дом заведены все коммуникации, включая воду, газ, электроэнергию, установлена автономная система очистки (Септик). В доме установлен двухконтурный газовый котел, установлены батареи, сделана разводка по всему дому электропроводки, заведены водяные теплые полы в сан. Узле и кухни, полностью выровнены и отштукатурены стены внутри, установлены стеклопакеты. Дом стоит на участке в 19.5 соток (ИЖС), абсолютно ровный. Так же на участке иметься хоз. Постройка (сарай), с участка открывается вид на горы и море. Хорошие подъездные пути к дому. В поселке есть все необходимое для комфортной жизни, современный детский сад, общеобразовательная школа, магазины, мед. Пункт (фельдшер), остановка общественного транспорта. Сам поселок раскинулся у подножья одной из самой красивой горы Южного побережья «Демерджи». До города всего 8 километров.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'СРОЧНО!!! Продается дом 109 кв.м. г. Алушта в поселке Лучистое',	'СРОЧНО!!! Продается дом 109 кв.м. г. Алушта в поселке Лучистое',	'СРОЧНО!!! Продается дом 109 кв.м. г. Алушта в поселке Лучистое',	'СРОЧНО!!! Продается дом 109 кв.м. г. Алушта в поселке Лучистое',	'Продам, продажа, продаётся, купить, куплю, дом, Алушта, поселок Лучистое '),
(874,	1,	'Продаётся участок земельный 6 соток г. Алушта в пос. Малый Маяк',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок земельный 6 соток г. Алушта в пос. Малый Маяк. Участок расположен выше трассы Алушта-Ялта, подъездная дорога грунтовая. Место хорошо застраиваемое, рядом соседи уже построились. Есть возможность подключиться к центральным сетям, свет, газ, вода. Назначение земли ИЖС, участок без оползневой. До города 8 километров.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок земельный 6 соток г. Алушта в пос. Малый Маяк',	'Продаётся участок земельный 6 соток г. Алушта в пос. Малый Маяк',	'Продаётся участок земельный 6 соток г. Алушта в пос. Малый Маяк',	'Продаётся участок земельный 6 соток г. Алушта в пос. Малый Маяк',	'Продам, продается, купить, куплю, продажа, участок, Алушта, село Малый Маяк'),
(875,	1,	'Продаётся участок видовой 10 соток г. Алушта в поселке Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок видовой 10 соток г. Алушта в поселке Лучистое. Участок Абсолютно ровный с видом на Черное море, город и горы. На участок уже заведено 15 кВт света и вода, на границе участка проходит газ. Подъездные пути хорошие, асфальтированная дорога + 100 м. грунтовая дорога к участку. Замечательный вид, чистый горный воздух. Рядом соседи построились, место хорошо застраиваемое. До города Алушта всего 8 километров, в поселке есть садик, школа, магазины, остановка общественного транспорта.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок видовой 10 соток г. Алушта в поселке Лучистое',	'Продаётся участок видовой 10 соток г. Алушта в поселке Лучистое',	'Продаётся участок видовой 10 соток г. Алушта в поселке Лучистое',	'Продаётся участок видовой 10 соток г. Алушта в поселке Лучистое',	'Продается, продам, купить, куплю, продажа, участок, Лучистое, Алушта'),
(876,	1,	'Продаётся участок 10.5 соток г. Алушта, Профессорский уголок',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 10.5 соток г. Алушта, Профессорский уголок. Участок ровный с видом на море, по границе участка линия электропередач, возможность подключения света. К участку ведет асфальтированная дорога + 100 метров хорошая грунтовая дорога. Место тихое, спрятанное от господствующих ветров, рядом с участком протекает горная река. Место хорошо застраиваемое. 70% участка без насаждений. Земельный участок по назначению ИЖС.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 10.5 соток г. Алушта, Профессорский уголок',	'Продаётся участок 10.5 соток г. Алушта, Профессорский уголок',	'Продаётся участок 10.5 соток г. Алушта, Профессорский уголок',	'Продаётся участок 10.5 соток г. Алушта, Профессорский уголок',	'Продается, купить, куплю, продажа, квартиру, участок, город Алушта, Профессорский уголок'),
(877,	1,	'Продам однокомнатную квартиру в Малом Маяке, г. Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продам однокомнатную квартиру в Малом Маяке, г. Алушта. Квартира с прекраснейшим видом на море и гору Кастель, находится на 2-м из 2-х этажей ул. Южнобережной недалеко от центра посёлка. Квартира включает в себя изолированную комнату 16,5 кв. м., проходную кухню такой же площадью и веранду с собственным выходом во двор, непосредственно за двором начинаются виноградники. В квартире подключен интернет кабельное ТВ, водоснабжение центральное, природный газ, автономное газовое отопление и горячая вода, есть возможность оборудования сан. узла в квартире и подключения к канализации.&amp;lt;/p&amp;gt;\r\n',	'Продам однокомнатную квартиру в Малом Маяке, г. Алушта.',	'Продам однокомнатную квартиру в Малом Маяке, г. Алушта.',	'Продам однокомнатную квартиру в Малом Маяке, г. Алушта.',	'Продам однокомнатную квартиру в Малом Маяке, г. Алушта.',	'Малый Маяк, продам, куплю, Алушта, часть дома,'),
(878,	1,	'Продаётся земельный участок площадью 5,5 соток в г. Алушта. ',	'&amp;lt;p&amp;gt;\r\n	Участок площадью 5,5 соток расположен в районе 4-го микрорайона (недалеко от улицы Юбилейной) на относительно ровной поляне, частично покрыт кустарником. Участок имеет целевое назначение ИЖС, рядом с границей участка проходит ровная подъездная грунтовая дорога. С территории участка открывается вид на дубовый лесок за которым расположена река и виноградники, так же хороший панорамный вид на горы и часть города. Есть возможность увеличения участка до 11 соток путём приобретения аналогичного смежного участка.Продаётся земельный участок площадью 5,5 соток в г. Алушта. Участок площадью 5,5 соток расположен в районе 4-го микрорайона (недалеко от улицы Юбилейной) на относительно ровной поляне, частично покрыт кустарником. Участок имеет целевое назначение ИЖС, рядом с границей участка проходит ровная подъездная грунтовая дорога. С территории участка открывается вид на дубовый лесок за которым расположена река и виноградники, так же хороший панорамный вид на горы и часть города. Есть возможность увеличения участка до 11 соток путём приобретения аналогичного смежного участка.&amp;lt;/p&amp;gt;\r\n',	'Продаётся земельный участок площадью 5,5 соток в г. Алушта. ',	'Продаётся земельный участок площадью 5,5 соток в г. Алушта. ',	'Продаётся земельный участок площадью 5,5 соток в г. Алушта. ',	'Продаётся земельный участок площадью 5,5 соток в г. Алушта. ',	'продажа, продам, куплю, Алушта, участок в городе'),
(879,	1,	'Продаётся квартира 1 комнатная в пос. Малый Маяк, г. Алушта. ',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира 1 комнатная в пос. Малый Маяк, г. Алушта. Уютная квартира общей площадью 15,3 кв. м. расположена на 3 этаже 5- этажного здания по ул. Морской, оформлена виде студии, кухонное отделение вынесено на утепленную лоджию, сан. узел совмещён. В квартире сделан ремонт, установлен кондиционер и электрический водонагреватель. Окна выходят юг, в сторону моря. Дом расположен рядом с центром посёлка, школа, магазины, остановка общественного транспорта в нескольких минутах ходьбы, к морю около 15 минут.&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира 1 комнатная в пос. Малый Маяк, г. Алушта. ',	'Продаётся квартира 1 комнатная в пос. Малый Маяк, г. Алушта. ',	'Продаётся квартира 1 комнатная в пос. Малый Маяк, г. Алушта. ',	'Продаётся квартира 1 комнатная в пос. Малый Маяк, г. Алушта. ',	'Продам, продажа, куплю, Малый Маяк, Алушта'),
(880,	1,	'Продаётся дом в городе Алушта, р-он санатория «Ветеран».',	'&amp;lt;p&amp;gt;\r\n	Трёхэтажный современный дом расположен в тихом, видом районе на 2-х сотках земли. Дом общей площадью в 180 кв.м., включает в себя четыре изолированные комнаты, два смежных сан. узла на 1-ом и на 2-ом этаже. В доме сделан ремонт, установлена мебель и техника, спутниковое телевидение, подключено автономное отопление, кондиционеры во всех комнатах. Панорамные окна выходят на просторную веранду в южном направлении. Монолитный дом возведён согласно всем сейсмологическим нормам, дворик оформлен четырьмя террасами с двумя зонами отдыха. С территории двора, окруженного хвойным лесом, и окон дома просматривается вся горная гряда от г. Кастель до г. Демерджи, хорошо просматривается вся центральная часть города. Поездка в центр города на авто займёт всего несколько минут.&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом в городе Алушта, р-он санатория «Ветеран».',	'Продаётся дом в городе Алушта, р-он санатория «Ветеран».',	'Продаётся дом в городе Алушта, р-он санатория «Ветеран».',	'Продаётся дом в городе Алушта, р-он санатория «Ветеран».',	'Продажа, дом, Алушта, частный дом, продам , куплю'),
(908,	1,	'Продается дом на земельном участке 6,5 соток в Изобильном, Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается дом на земельном участке 6,5 соток в Изобильном, Алушта. Дом одноэтажный, расположен рядом с центральной улицей. С территории участка открывается красивый вид, на город Алушту, море, горную территорию Крымского заповедника и Изобильненское водохранилище. Общая площадь дома под ремонт, составляет 62 м2, из них жилая площадь 38 м2 и вспомогательная 24 м2. Рядом с домом построено здание из ракушечника под сауну и сделан бетонированный бассейн. Есть возможность увеличения территории, за счёт покупки смежного участка с домом. Посёлок развитый: школа, магазины, амбулатория, аптечный пункт, СТО, шиномонтаж.&amp;lt;/p&amp;gt;\r\n',	'Продается дом на земельном участке 6,5 соток в Изобильном, Алушта.',	'Продается дом на земельном участке 6,5 соток в Изобильном, Алушта.',	'Продается дом на земельном участке 6,5 соток в Изобильном, Алушта.',	'Продается дом на земельном участке 6,5 соток в Изобильном, Алушта.',	'Продам, продажа, куплю, купить, участок с домом, дом с видом, видом на море, видом на озеро, в Изобильном '),
(881,	1,	'Продается квартира 1-комнатная в гор. Алушта, элитный дом по улице Горького.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 1-комнатная в гор. Алушта, элитный дом по улице Горького. Квартира площадью в 33,9 кв. м. с подготовкой под отделку расположена на четвёртом этаже элитного дома, по улице Горького, в непосредственной близости от центральной набережной. Предусмотрена свободная планировка, с двумя выходами на балкон, расположенного со стороны зеленого парка с хвойными деревьями, сквозь ветки которых просматриваются Крымские горы. При строительстве элитного 16-ти этажного дома Status House премиум класса предусмотрены хорошая звукоизоляция, высококачественные лифты, а также автономное газовое отопление. Все объекты городской и развлекательной инфраструктур находятся рядом.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 1-комнатная в гор. Алушта, элитный дом по улице Горького.',	'Продается квартира 1-комнатная в гор. Алушта, элитный дом по улице Горького.',	'Продается квартира 1-комнатная в гор. Алушта, элитный дом по улице Горького.',	'Продается квартира 1-комнатная в гор. Алушта, элитный дом по улице Горького.',	'Продам ,продажа, куплю, квартира, Алушта, возле моря, элитная, новая'),
(882,	1,	'Продается квартира 1-а комнатная по ул. Горького, г. Алушта. ',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 1-а комнатная по ул. Горького, г. Алушта. Квартира под отделку, площадью в 33,5 кв. м., расположена в элитном 16-ти этажном доме Status House на 5 этаже. В квартире предусмотрена свободная планировка, на просторный балкон два отдельных выхода. Из окон квартиры и балкона открывается вид на парк, город, и Крымские склоны гор. Дом построен согласно всем современным требованиям, качественная звукоизоляция, лифты, собственная котельная. Расположен элитный дом в парковой вечнозелёной зоне, в нескольких шагах от центральной городской набережной. В доме премиум класса предусмотрен весь комплекс сервисных услуг, детская площадка, бассейн, а также круглосуточная охрана территории.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 1-а комнатная по ул. Горького, г. Алушта. ',	'Продается квартира 1-а комнатная по ул. Горького, г. Алушта. ',	'Продается квартира 1-а комнатная по ул. Горького, г. Алушта. ',	'Продается квартира 1-а комнатная по ул. Горького, г. Алушта. ',	'Продам ,продажа, куплю, квартира, Алушта, элитная, новая, возле моря, Статус Хаус'),
(883,	1,	'Продаётся 1-но комнатная квартира в элитном доме в Алуште.',	'&amp;lt;p&amp;gt;\r\n	Квартира расположена на 11 этаже из 16-ти элитного дома Status House на ул. Горького. На общей площади в 44,3 кв. м. уже отделена полноценная комната с выходом на балкон, кухня разделена на зоны и так же имеет выход на балкон, с которого открывается шикарный вид на Алушту и Крымские горы. Новый жилой дом возведен согласно всем нормам безопасности, уделено большое внимание звукоизоляции, так как расположен дом вблизи от центральной набережной, установлены высококачественные лифты, предусмотрена собственная котельная с автономным отоплением. Элитный дом находится в парковой зоне среди кедров и сосен, во дворике, над небольшой речкой Улу-Узень, размещена зона отдыха с бассейном и детской игровой площадкой. Управляющей компанией обеспечен комплекс сервисных и эксплуатационных услуг для максимального комфорта жителей дома Status House&amp;lt;/p&amp;gt;\r\n',	'Продаётся 1-но комнатная квартира в элитном доме в Алуште.',	'Продаётся 1-но комнатная квартира в элитном доме в Алуште.',	'Продаётся 1-но комнатная квартира в элитном доме в Алуште.',	'Продаётся 1-но комнатная квартира в элитном доме в Алуште.',	''),
(884,	1,	'Продаётся квартира 1-но комнатная в элитном доме г. Алушты, Status House.',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира 1-но комнатная в элитном доме г. Алушты, Status House. Квартира находится на 13 этаже, шестнадцатиэтажного нового дома, расположенного в зелёной парковой зоне, в нескольких шагах от набережной по улице Горького. Квартира с площадью в 44,3 кв. м., имеет свободную планировку и подготовлена под отделку, есть два отдельных выхода на один просторный балкон, с которого открывается прекрасный панорамный вид на Алушту и окружающие её восточные и южнобережные склоны Крымских гор. Элитный дом построен в соответствии со всеми требованиями норм безопасности, обеспечена хорошая звукоизоляция, установлены современные и надежные лифты. Во дворе дома, расположенного в тени вековых кедров и сосен предусмотрена детская площадка, есть зона отдыха и бассейн. Так же предусмотрено обеспечение оказания сервисных услуг для комфортного пребывания в доме, охрана территории круглосуточная.&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира 1-но комнатная в элитном доме г. Алушты, Status House.',	'Продаётся квартира 1-но комнатная в элитном доме г. Алушты, Status House.',	'Продаётся квартира 1-но комнатная в элитном доме г. Алушты, Status House.',	'Продаётся квартира 1-но комнатная в элитном доме г. Алушты, Status House.',	'Продам ,продажа, куплю, квартира, Алушта, набережная, ЮБК'),
(885,	1,	'Продаётся квартира 1-комнатная в элитном доме по улице Горького в Алуште. ',	'&amp;lt;p&amp;gt;\r\n	Продаётся квартира 1-комнатная в элитном доме по улице Горького в Алуште. Просторная, светлая квартира расположена на 14 этаже, нового 16-этажного дома Status House. Общая площадь, квартиры со свободной планировкой и подготовленной к отделке, составляет 58,1 кв. м. Панорамные окна с выходом на балкон, открывают прекраснейший вид на просторы Чёрного моря и восточное горное побережье. Элитный дом расположен в парковой зоне, рядом с городской набережной и является самым высоким зданием этого района, возведённым согласно современных норм безопасности, так же в процессе строительства предусмотрено создание хорошей звукоизоляции. Отопление дома автономное, есть своя котельная. Управление и оказание услуг по эксплуатации здания предоставляется профессиональной компанией. Дом имеет выход на собственный дворик, окружённый вечнозелёными деревьями, с бассейном и зоной отдыха для взрослых и детей. Обеспечена круглосуточная охрана территории.&amp;lt;/p&amp;gt;\r\n',	'Продаётся квартира 1-комнатная в элитном доме по улице Горького в Алуште. ',	'Продаётся квартира 1-комнатная в элитном доме по улице Горького в Алуште. ',	'Продаётся квартира 1-комнатная в элитном доме по улице Горького в Алуште. ',	'Продаётся квартира 1-комнатная в элитном доме по улице Горького в Алуште. ',	'продажа, квартира, Алушта, купить, ЮБК, центр, берег моря, набережная, Статус Хаус'),
(886,	1,	'Продаётся участок 5 соток ИЖС г. Алушта мик-н Дельфин',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок 5 соток ИЖС г. Алушта мик-н Дельфин. Участок правильной формы, находится в экологически чистом месте, с видом на море, горы и восточное побережье. Район хорошо застраиваемый, соседи рядом уже построились. Из коммуникации, рядом свет, вода централизованная. До моря 100 метров по бетонной дорожке. Все документы РФ к сделке готовы&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок 5 соток ИЖС г. Алушта мик-н Дельфин',	'Продаётся участок 5 соток ИЖС г. Алушта мик-н Дельфин',	'Продаётся участок 5 соток ИЖС г. Алушта мик-н Дельфин',	'Продаётся участок 5 соток ИЖС г. Алушта мик-н Дельфин',	'Продается, продам,  купить, продажа, продам, участок, микрорайон Дельфин, город Алушта '),
(887,	1,	'Продаётся видовой участок 10 соток г. Алушта микрорайон Дельфин',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-size: 10.5pt; line-height: 107%; font-family: mpR, serif; color: rgb(73, 72, 72); background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&amp;quot;&amp;gt;С данного земельного участка отличный вид на море и горы, просматривается вся южная сторона аж до Медведь горы, участок расположен в микрорайоне «Дельфин», назначение земли ИЖС, сто метров до моря по бетонной дорожке. Рядом участки уже застроены, коммуникации в доступности свет, вода, газ в перспективе. Автомобилем до города всего 7 минут. К участку ведет асфальтированная дорога.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продаётся видовой участок 10 соток г. Алушта микрорайон Дельфин',	'Продаётся видовой участок 10 соток г. Алушта микрорайон Дельфин',	'Продаётся видовой участок 10 соток г. Алушта микрорайон Дельфин',	'Продаётся видовой участок 10 соток г. Алушта микрорайон Дельфин',	'Продаётся, продам, продажа, купить, куплю, участок, Алушта, Семидворье, микрорайон Дельфин'),
(888,	1,	'Продаётся участок в городе 10 соток г. Алушта ИЖС',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок в городе 10 соток г. Алушта ИЖС. Участок имеет правильную прямоугольную форму, находиться на абсолютно ровной поляне. Коммуникации в доступности, рядом дома уже построились, участок хорошо застраиваемый. С земельного участка открывается вид на горы и виноградники. На участок ведет хорошая грунтовая дорога, тихое и уютное место для строительства жилого дома. Участок стоит по срочной продаже! Полный пакет документов РФ, и к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок в городе 10 соток г. Алушта ИЖС',	'Продаётся участок в городе 10 соток г. Алушта ИЖС',	'Продаётся участок в городе 10 соток г. Алушта ИЖС',	'Продаётся участок в городе 10 соток г. Алушта ИЖС',	'Продается, купить, куплю, продажа, продам, участок, город Алушта'),
(889,	1,	'Продаются апартаменты Алушта, набережная. ',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты Алушта, набережная. Апартаменты общей площадью в 39 кв. м., расположены на 6-м этаже, в современном элитном 10-ти этажном комплексе ALUSHTA ROYAL APARTAMENTS. Дом расположен по улице Краснофлотской, в районе набережной. Дом оснащён охранной системой и пожарной сигнализацией, автономным отоплением. Просторная, светлая комната с дизайнерским ремонтом, мебелью и кондиционером. Из окон и балкона открывается шикарный вид на зелёный парк, море. Возле здания есть парковка, магазин. Неподалёку расположились: тренажёрный зал, бассейн, магазины, салон красоты, банк, почтовое отделение, кафе и рестораны, а также аквапарк. К морю всего минута ходьбы. До центра города несколько минут на машине.&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты Алушта, набережная. ',	'Продаются апартаменты Алушта, набережная. ',	'Продаются апартаменты Алушта, набережная. ',	'Продаются апартаменты Алушта, набережная. ',	'продам, апартаменты, в центре, куплю, Алушта, элитная, возле моря'),
(890,	1,	'Продаются апартаменты в Партените в районе автостанции. ',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты в Партените в районе автостанции. Светлые апартаменты, свободной планировки и под отделку, общей площадью в 47 кв. м. и шикарным видом на море, часть Партенита, расположены на 6-ом этаже, с балкона в 3,6 кв. м. открывается прекрасный вид на расположенную вблизи гору Аю-Даг. В девятиэтажном здании установлен качественный грузопассажирский лифт. Территория закрытого типа с круглосуточной охраной и видеонаблюдением. Путь к морю займёт всего несколько минут пешком через парк санатория «Крым».&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты в Партените в районе автостанции. ',	'Продаются апартаменты в Партените в районе автостанции. ',	'Продаются апартаменты в Партените в районе автостанции. ',	'Продаются апартаменты в Партените в районе автостанции. ',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, Партенит, Аю Даг'),
(891,	1,	'Продаётся помещение с назначением под коммерцию в пгт. Партенит. ',	'&amp;lt;p&amp;gt;\r\n	Большое помещение площадью в 221 кв. м., есть подвал, расположено на участке в 3,8 соток в центральном районе посёлка, земля в собственности, неподалёку от автовокзала. Помещение под реконструкцию, все коммуникации подключены, рядом есть место под парковку, помещение с возможностью использования под магазин.&amp;lt;/p&amp;gt;\r\n',	'Продаётся помещение с назначением под коммерцию в пгт. Партенит. ',	'Продаётся помещение с назначением под коммерцию в пгт. Партенит. ',	'Продаётся помещение с назначением под коммерцию в пгт. Партенит. ',	'Продаётся помещение с назначением под коммерцию в пгт. Партенит. ',	'Продам, продажа, куплю, магазин, коммерческое, Алушта, Партенит, центр'),
(894,	1,	'Продаётся 1-комнатная квартира ул. Краснофлотская, район центральной набережной гор. Алушты.',	'&amp;lt;p&amp;gt;\r\n	Квартира расположена на втором этаже 2-х этажного, шести квартирного дома. Уютная квартира состоит из комнаты размером 26&amp;amp;nbsp; кв. м., светлой кухни -прихожей и совмещённого сан. узла. Предусмотрено автономное газовое отопление, установлен кондиционер. Квартира полностью готова как для постоянного проживания, так и под сдачу. Рядом с домом расположена зелёная парковая зона, до моря около двухсот метров пешком, центральная набережная, банк, аптека, салон красоты, тренажёрный зал, бассейн в минуте ходьбы. К району автовокзала и центру города можно доехать за несколько минут.&amp;lt;/p&amp;gt;\r\n',	'Продаётся 1-комнатная квартира ул. Краснофлотская, район центральной набережной гор. Алушты.',	'Продаётся 1-комнатная квартира ул. Краснофлотская, район центральной набережной гор. Алушты.',	'Продаётся 1-комнатная квартира ул. Краснофлотская, район центральной набережной гор. Алушты.',	'Продаётся 1-комнатная квартира ул. Краснофлотская, район центральной набережной гор. Алушты.',	'продажа, квартира, Алушта, купить, ЮБК, центр, берег моря, набережная'),
(893,	1,	'Продам участок земельный 15 соток, в пос. Малом Маяке, г. Алуште.',	'&amp;lt;p&amp;gt;\r\n	Продам участок земельный 15 соток, в пос. Малом Маяке, г. Алуште. Земельный участок с прекрасным видом на море, в аренде, территория ограждена, вокруг- вечнозелёные насаждения. Расположен участок неподалёку от моря. Тех. условия на электроэнергию получены, все коммуникации проходят по границе участка, а соседние дома уже построены.&amp;lt;/p&amp;gt;\r\n',	'Продам участок земельный 15 соток, в пос. Малом Маяке, г. Алуште.',	'Продам участок земельный 15 соток, в пос. Малом Маяке, г. Алуште.',	'Продам участок земельный 15 соток, в пос. Малом Маяке, г. Алуште.',	'Продам участок земельный 15 соток, в пос. Малом Маяке, г. Алуште.',	'продажа, Алушта, купить, ЮБК, центр, берег моря, участок, земля'),
(892,	1,	'Продается участок земельный 10 соток в пос. Малом Маяке, г. Алушты. ',	'&amp;lt;p&amp;gt;\r\n	Продается участок земельный 10 соток в пос. Малом Маяке, г. Алушты. Участок правильной формы под индивидуальное строительство, расположен на склоне в ста метрах от моря, прямо над набережной. С шикарным видом на море и горы, по соседству уже построены дома. Получены тех. условия на газ, электроэнергию, есть градостроительный план земельного участка.&amp;lt;/p&amp;gt;\r\n',	'Продается участок земельный 10 соток в пос. Малом Маяке, г. Алушты. ',	'Продается участок земельный 10 соток в пос. Малом Маяке, г. Алушты. ',	'Продается участок земельный 10 соток в пос. Малом Маяке, г. Алушты. ',	'Продается участок земельный 10 соток в пос. Малом Маяке, г. Алушты. ',	'продажа, земля, участок, Алушта, купить, ЮБК, берег моря, набережная, Малый Маяк'),
(895,	1,	'Продаётся участок видовой 4 сотки в г. Алушта по ул. Б. Хмельницкого',	'&amp;lt;p&amp;gt;\r\n	Продаётся участок видовой 4 сотки в г. Алушта по ул. Б. Хмельницкого. Участок имеет правильную форму, с замечательным видом на море, горы и город. Хорошо застраиваемое место (40% земельного участка ровный, остальные 60% небольшой уклон), отличные подъездные пути (асфальтированная дорога), участок расположен в жилом спальном районе, на соседний участок заведен свет, соседи планируют строиться. Рядом находятся многоквартирные жилые дома, магазины, остановка общественного транспорта. До центра города пешим шагом всего 5 минут ходьбы.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся участок видовой 4 сотки в г. Алушта по ул. Б. Хмельницкого',	'Продаётся участок видовой 4 сотки в г. Алушта по ул. Б. Хмельницкого',	'Продаётся участок видовой 4 сотки в г. Алушта по ул. Б. Хмельницкого',	'Продаётся участок видовой 4 сотки в г. Алушта по ул. Б. Хмельницкого',	'Продаётся, продажа, продам, купить, куплю, участок, город Алушта'),
(896,	1,	'Продаётся земельный участок 800 кв.м. г. Алушта, пгт. Партенит',	'&amp;lt;p&amp;gt;\r\n	Участок состоит из двух смежных участков, каждый из которых с площадью по 4 сотки. Участки расположены в зеленом массиве с видом на горы, море и виноградники. Продаваемый участок с небольшим уклоном в сторону моря. К участкам ведет хорошая грунтовая дорога через лесную зону. Из коммуникаций в доступности свет и водоснабжения данного земельного участка.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаётся земельный участок 800 кв.м. г. Алушта, пгт. Партенит',	'Продаётся земельный участок 800 кв.м. г. Алушта, пгт. Партенит',	'Продаётся земельный участок 800 кв.м. г. Алушта, пгт. Партенит',	'Продаётся земельный участок 800 кв.м. г. Алушта, пгт. Партенит',	'Продаётся, продам, продажа, купить, куплю, участок, Алушта, пгт. Партенит'),
(897,	1,	'Продается земельный участок 5 соток в г. Алушта, пгт. Партенит',	'&amp;lt;p&amp;gt;\r\n	Участок находиться в жилом зеленом массиве с замечательным видом на море, город и Медведь гору. Участок с умеренным рельефом, коммуникации в доступности, рядом вся инфраструктура города, магазины, рынок, аптека, общественный транспорт. Отличный не перекрываемый вид. Есть возможность приобрести соседние участки по 7.5 соток.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 5 соток в г. Алушта, пгт. Партенит',	'Продается земельный участок 5 соток в г. Алушта, пгт. Партенит',	'Продается земельный участок 5 соток в г. Алушта, пгт. Партенит',	'Продается земельный участок 5 соток в г. Алушта, пгт. Партенит',	'Продаётся, продам, продажа, купить, куплю, участок, Алушта, пгт. Партенит'),
(898,	1,	'Продаётся видовой участок 5 с. в Алуште, выше санатория «Ветеран». ',	'&amp;lt;p&amp;gt;\r\n	Земельный участок площадью 5 соток, с прекрасным панорамным видом расположен по ул. Л. Кучмы, в нескольких минутах езды от центра города. На расстоянии ста метров уже построены жилые дома, форма участка правильная, рельеф умеренный, вокруг хвойные деревья. Есть возможность увеличения площади за счёт покупки смежного участка площадью 5 соток.&amp;lt;/p&amp;gt;\r\n',	'Продаётся видовой участок 5 с. в Алуште, выше санатория «Ветеран». ',	'Продаётся видовой участок 5 с. в Алуште, выше санатория «Ветеран». ',	'Продаётся видовой участок 5 с. в Алуште, выше санатория «Ветеран». ',	'Продаётся видовой участок 5 с. в Алуште, выше санатория «Ветеран». ',	'Продам, продажа, куплю, купить, участок, землю, земля, поселок Лучистое, Алушта, в черте города, с видом на море'),
(899,	1,	'Продается 2-комнатная квартира на улице Фрунзенское шоссе, Партенит. ',	'&amp;lt;p&amp;gt;\r\n	Квартира с общей площадью 53,3 кв. м., расположена на 12 этаже в 12 этажном доме. Квартира с ремонтом и мебелью, состоит из двух комнат, просторной кухни, и двух лоджий из которых открывается отличный вид на горы, посёлок Партенит и гору Аю- Даг. Сверху над квартирой на 13 этаже, есть пустое помещение размером 20 кв. м., можно использовать как второй этаж квартиры.Инфраструктура посёлка развитая,школа, детский сад, магазины, кафе, пансионаты.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-комнатная квартира на улице Фрунзенское шоссе, Партенит. ',	'Продается 2-комнатная квартира на улице Фрунзенское шоссе, Партенит. ',	'Продается 2-комнатная квартира на улице Фрунзенское шоссе, Партенит. ',	'Продается 2-комнатная квартира на улице Фрунзенское шоссе, Партенит. ',	'продажа, квартира, Алушта, купить, ЮБК, Партенит, Аю Даг, в Партените'),
(900,	1,	'Продается квартира 1- комнатная в Ялте. ',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 1- комнатная в Ялте. Квартира площадью в 23 кв. м. расположена на 2 этаже 2 этажного жилого дома в Ялте в районе Массандры. Квартира с ремонтом и мебелью, установлен двухконтурный газовый котёл, жилая площадь 14,1 кв. м., кухня площадью 5 кв. м., сан. узел раздельный. Отдельный вход в квартиру со двора.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 1- комнатная в Ялте. ',	'Продается квартира 1- комнатная в Ялте. ',	'Продается квартира 1- комнатная в Ялте. ',	'Продается квартира 1- комнатная в Ялте. ',	'продажа, квартира, Алушта, купить, ЮБК, Ялта, Массандра, срочно куплю, срочно продам'),
(901,	1,	'Продается 1 комнатная квартира на 60 лет СССР в гор. Алушта. ',	'&amp;lt;p&amp;gt;\r\n	Квартира с площадью в 25 м2, расположена на 13 этаже в 15 этажном доме, из окон открывается красивый вид на горы, город Алушту, море. В квартире свободной планировки, сделана черновая отделка, отопление центральное. В доме два грузовых лифта, есть охрана на входе и видеонаблюдение. Возле дома магазин, есть места для парковки автомобилей, неподалёку автобусная остановка. Район автовокзала в 5-ти минутах ходьбы.&amp;lt;/p&amp;gt;\r\n',	'Продается 1 комнатная квартира на 60 лет СССР в гор. Алушта. ',	'Продается 1 комнатная квартира на 60 лет СССР в гор. Алушта. ',	'Продается 1 комнатная квартира на 60 лет СССР в гор. Алушта. ',	'Продается 1 комнатная квартира на 60 лет СССР в гор. Алушта. ',	'Продается, купить, куплю, продажа, квартиру, студия, квартира, город Алушта, свободная планировка, срочно куплю, срочно продам'),
(903,	1,	'Продается шикарный земельный участок 6 соток г. Алушта, поселок Изобильное',	'&amp;lt;p&amp;gt;\r\n	Продается шикарный земельный участок 6 соток г. Алушта, поселок Изобильное. Предлагаемый участок имеет правильную форму, развернут на Юг. По границам земельного участка проходит электричество и водопровод. С участка открывается прекрасный панорамный вид на город, Изобильненское водохранилище, горы, и море. Вид с данного земельного участка не перекрываемый 100%. К участку ведет хорошая грунтовая дорога, так же есть возможность сделать два заезда на участок (снизу и сверху). Поселок газифицирован, перспектива поднятия газа к участку примерно год. В поселке есть общеобразовательная школа, магазины, больница. До города всего 5 километров.&amp;lt;/p&amp;gt;\r\n',	'Продается шикарный земельный участок 6 соток г. Алушта, поселок Изобильное',	'Продается шикарный земельный участок 6 соток г. Алушта, поселок Изобильное',	'Продается шикарный земельный участок 6 соток г. Алушта, поселок Изобильное',	'Продается шикарный земельный участок 6 соток г. Алушта, поселок Изобильное',	'Продам, продается, продажа, купить, куплю, земельный участок, Алушта, оселок Изобильное'),
(904,	1,	'Продаются апартаменты 1 комнатные в г. Алушта, на набережной.',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты 1 комнатные в г. Алушта, на набережной. Апартаменты типа студия с общей площадью в 38,6 м2 и балкончиком в 3 м2, расположены на втором этаже из 10 современного комплекса Alushta Royal Apartments, в ста метрах от центральной набережной города Алушта. В апартаментах предусмотрено отопление (у дома своя котельная), установлены кондиционеры, встроена кухонная мебель. Окна выходят на узкую улочку и зелёный парк. Дом расположен рядом с морем, неподалёку оживлённый район с магазинами, кафе, ресторанами, салонами красоты, отделения банка и почты, фитнесс центр, бассейн. Центр города и район автовокзала в нескольких минутах езды.&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты 1 комнатные в г. Алушта, на набережной.',	'Продаются апартаменты 1 комнатные в г. Алушта, на набережной.',	'Продаются апартаменты 1 комнатные в г. Алушта, на набережной.',	'Продаются апартаменты 1 комнатные в г. Алушта, на набережной.',	'Продается, продам, продажа, Алушта, возле моря, набережная, ЮБК'),
(905,	1,	'Продаются апартаменты 2-х комнатные в элитном комплексе гор. Алушты.',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты 2-х комнатные в элитном комплексе гор. Алушты. Апартаменты с площадью в 57,5 кв. м., состоят из просторной комнаты: кухни объединённой с гостиной, совмещённого сан. узла, также отдельной светлой спальной комнаты с выходом на балкон с площадью 5,3 кв. м. Предлагаются апартаменты к продаже с оборудованной мебелью кухней, кондиционерами и сан. узлом полностью обустроенным. Элитный дом оснащён автономным отоплением, системами пожарной сигнализации, охраны. Расположен всего в двухстах метрах от моря, рядом с центральной набережной, всё что необходимо для отдыха и жизни находится в непосредственной близости от современного комплекса.&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты 2-х комнатные в элитном комплексе гор. Алушты.',	'Продаются апартаменты 2-х комнатные в элитном комплексе гор. Алушты.',	'Продаются апартаменты 2-х комнатные в элитном комплексе гор. Алушты.',	'Продаются апартаменты 2-х комнатные в элитном комплексе гор. Алушты.',	'Продажа, продам, куплю, апартаменты, возле моря, набережная, ЮБК, Алушта'),
(906,	1,	'Продаются однокомнатные апартаменты в Алуште, элитный комплекс возле моря.',	'&amp;lt;p&amp;gt;\r\n	Продаются однокомнатные апартаменты в Алуште, элитный комплекс возле моря. Апартаменты площадью в 40,1 кв. м. и расположенные на 10 этаже из 12 современного комплекса, имеют хороший вид на море и озеленённую приморскую зону. Планировка апартаментов типа студия включает в себя объединённый сан. узел с пл.&amp;amp;nbsp; 2,6 кв. м., прихожую-4,8 кв. м., кухню-8,5 кв. м. и светлую комнату с панорамными окнами в 24,2 кв. м. Жилой комплекс расположен в ста метрах от центральной набережной, все необходимые объекты инфраструктуры находятся в несколько минутной доступности, центр города и автовокзал в нескольких минутах езды автомобилем.&amp;lt;/p&amp;gt;\r\n',	'Продаются однокомнатные апартаменты в Алуште, элитный комплекс возле моря.',	'Продаются однокомнатные апартаменты в Алуште, элитный комплекс возле моря.',	'Продаются однокомнатные апартаменты в Алуште, элитный комплекс возле моря.',	'Продаются однокомнатные апартаменты в Алуште, элитный комплекс возле моря.',	'продам, апартаменты, в центре, куплю, Алушта, элитная, возле моря, ЮБК'),
(910,	1,	'Продается квартира 3-х комнатная в г. Алушта по ул. Б. Хмельницкого 23',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 3-х комнатная в г. Алушта по ул. Б. Хмельницкого 23. Квартира находиться на втором этаже, 9-ти этажного дома новострой «СК Консоль». Квартира светлая с ремонтом, с каждой комнаты выход на балкон, вид на море и горы. Комнаты раздельные 9/18/12, раздельный сан. Узел в кафеле, большая прихожая, установлен электрический бойлер. Дом газифицирован, весь фасад дома утеплен. Площадь продаваемой квартиры составляет под 75 кв.м. Продается данная квартира частично с мебелью. Микрорайон тихий, спальный, с развитой инфраструктурой. До центра города и набережной две остановки. Хороший ухоженный двор с озеленениями, детской площадкой, много свободного места возле дома для стоянки личного транспорта. Рядом с домом остановка общественного транспорта, три гастронома, церковь.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 3-х комнатная в г. Алушта по ул. Б. Хмельницкого 23',	'Продается квартира 3-х комнатная в г. Алушта по ул. Б. Хмельницкого 23',	'Продается квартира 3-х комнатная в г. Алушта по ул. Б. Хмельницкого 23',	'Продается квартира 3-х комнатная в г. Алушта по ул. Б. Хмельницкого 23',	'Продается, продам, купить, куплю, продажа, квартира, город Алушта, Богдана Хмельницкого'),
(912,	1,	'Продаются 3-х комнатные апартаменты в современном комплексе по ул. Краснофлотской.',	'&amp;lt;p&amp;gt;\r\n	Продаются 3-х комнатные апартаменты в современном комплексе по ул. Краснофлотской. Апартаменты с общей площадью в 71,6 кв. м., расположены на 2-м из 12-ти, нового комплекса Alushta Royal Apartments, в минуте ходьбы от центральной набережной города Алушты. Апартаменты включают в себя две отдельные спальни по 10 и 11 кв. м., просторную кухню-гостиную-21 кв. м, из гостиной и спальни выход на просторный балкон в 12 кв. м. Предлагаются со встроенной кухонной мебелью оформленной мраморными элементами. Кондиционеры установлены, отопление в доме автономное, системы пожарной сигнализации и охрана предусмотрены.&amp;lt;/p&amp;gt;\r\n',	'Продаются 3-х комнатные апартаменты в современном комплексе по ул. Краснофлотской.',	'Продаются 3-х комнатные апартаменты в современном комплексе по ул. Краснофлотской.',	'Продаются 3-х комнатные апартаменты в современном комплексе по ул. Краснофлотской.',	'Продаются 3-х комнатные апартаменты в современном комплексе по ул. Краснофлотской.',	'продам, апартаменты, в центре, куплю, Алушта, элитная, возле моря, купить, продажа'),
(913,	1,	'Продается трёх комнатная квартира г. Алушта по ул. Ялтинская 1',	'&amp;lt;p&amp;gt;\r\n	Продается трёх комнатная квартира г. Алушта по ул. Ялтинская 1. Квартира находиться на 4-м этаже 5-ти этажного жилого дома. Площадь продаваемой квартира составляет 67 кв.м., квартира с ремонтом, три раздельные комнаты, две лоджие с видом на море и город, во внутренний двор с детской площадкой и детский садик, один балкон совмещен с кухней. Дом газифицирован, стоит колонка новая газовая, кафель в прихожей и сан узлах., сан. Узел раздельный, стоят стеклопакеты. Хорошая планировка, в спальном районе. До школы три минуты ходьбы, детский садик 50 метров, развитая инфраструктура, супермаркет круглосуточный, аптеки, общественный транспорт. До моря и центральной набережной 10-15 минут ходьбы. Стоит домофон, чистый подъезд, хорошие и тихие соседи.&amp;lt;/p&amp;gt;\r\n',	'Продается трёх комнатная квартира г. Алушта по ул. Ялтинская 1',	'Продается трёх комнатная квартира г. Алушта по ул. Ялтинская 1',	'Продается трёх комнатная квартира г. Алушта по ул. Ялтинская 1',	'Продается трёх комнатная квартира г. Алушта по ул. Ялтинская 1',	'Продается, купить, куплю, продажа, продам, квартиру, квартира, город Алушта, улица Ялтинская 1'),
(914,	1,	'Продается не жилое помещение г. Алушта, ул. Б. Хмельницкого',	'&amp;lt;p&amp;gt;\r\n	Продается не жилое помещение г. Алушта, ул. Б. Хмельницкого. Помещение общей площадью в 27.6 кв.м., прихожая 6.1 кв.м., две комнаты 9.2 и 9.5 кв.м., сан. Узел 2.8 кв.м. Выполнен ремонт, оштукатурены стены, окрашены, заведено свет, вода, канализация. Полы выровнены и положен линолеум. Помещение находиться в 9-ти этажном жилом доме, застраиваемый микрорайон, во круг много жилых 9-ти этажных домов. Можно рассматривать как под сдачу или коммерцию.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается не жилое помещение г. Алушта, ул. Б. Хмельницкого',	'Продается не жилое помещение г. Алушта, ул. Б. Хмельницкого',	'Продается не жилое помещение г. Алушта, ул. Б. Хмельницкого',	'Продается не жилое помещение г. Алушта, ул. Б. Хмельницкого',	'Продается, продажа, купить, куплю, продам, цокольное помещение, не жилое помещение, город Алушта'),
(911,	1,	'Продаются апартаменты 3-х комнатные в Алуште, элитный комплекс возле моря. ',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты 3-х комнатные в Алуште, элитный комплекс возле моря. Апартаменты общей площадью в 58,9 кв. м., расположены на 2 этаже из 12 элитного комплекса Alushta Royal Apartments, и включают в себя просторную кухню- гостиную в 20 кв. м. и две отдельные спальни, большой балкон, который выходит на улочку в сторону зелёного парка. К продаже предлагаются со встроенной мебелью и встроенной техникой. Комплекс расположен в минуте ходьбы к морю, рядом с центральной набережной.&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты 3-х комнатные в Алуште, элитный комплекс возле моря. ',	'Продаются апартаменты 3-х комнатные в Алуште, элитный комплекс возле моря. ',	'Продаются апартаменты 3-х комнатные в Алуште, элитный комплекс возле моря. ',	'Продаются апартаменты 3-х комнатные в Алуште, элитный комплекс возле моря. ',	'продам, апартаменты, в центре, куплю, Алушта, элитная, возле моря, купить, продажа'),
(915,	1,	'Продаются апартаменты 3х-комнатные в элитном доме, ул. Краснофлотская г. Алушты.',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты 3х-комнатные в элитном доме, ул. Краснофлотская г. Алушты. Апартаменты общей площадью в 58,7 кв. м. находятся на 11 из 12-ти этажей элитного современного комплекса Alushta Royal Apartment, рядом с центральной набережной, из окон открывается шикарный вид на море и парковую зону побережья. Площадь апартаментов включает в себя две раздельные спальни по 10 кв. м., кухню, совмещенную с гостиной площадью в 21 кв. м. и летний балкон в 10 кв. м. К продаже апартаменты предлагаются со встроенной техникой и кухней.&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты 3х-комнатные в элитном доме, ул. Краснофлотская г. Алушты.',	'Продаются апартаменты 3х-комнатные в элитном доме, ул. Краснофлотская г. Алушты.',	'Продаются апартаменты 3х-комнатные в элитном доме, ул. Краснофлотская г. Алушты.',	'Продаются апартаменты 3х-комнатные в элитном доме, ул. Краснофлотская г. Алушты.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Алушта Роял, возле моря'),
(918,	1,	'Продается хороший участок 25 соток земли ИЖС г. Алушта поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается хороший участок 25 соток земли ИЖС г. Алушта поселок Лучистое. Большая часть земельного участка находится на ровной поляне. Замечательный вид на море, горы и город. Хорошая подъездная дорога, активно застраиваемое место, дома рядом уже построены и живут соседи. Вид не перекрываемый! Коммуникации все рядом, электроэнергия, газ, центральное водоснабжения. К участку ведет асфальтированная дорога, плюс 50 метров грунт.&amp;lt;/p&amp;gt;\r\n',	'Продается хороший участок 25 соток земли ИЖС г. Алушта поселок Лучистое',	'Продается хороший участок 25 соток земли ИЖС г. Алушта поселок Лучистое',	'Продается хороший участок 25 соток земли ИЖС г. Алушта поселок Лучистое',	'Продается хороший участок 25 соток земли ИЖС г. Алушта поселок Лучистое',	'Продается, продам, купить, куплю, продажа, участок, Лучистое, Алушта'),
(919,	1,	'Продается два смежных участка по 10 соток г. Алушта в поселке Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается два смежных участка по 10 соток г. Алушта в поселке Лучистое. С участков открывается превосходный вид на море, горы и город. Имеются хорошие подъездные пути, до асфальтированной дороги всего 100 метров. На каждые 10 соток земельного участка подключены 15 кВт света. Слева и справа строятся соседи, хорошо застраиваемое место. В 150 метрах от продаваемых земельных участков проходит газопровод. Так же возможно приобрести земельные участки как вместе, так и раздельно. Замечательный вид, чистый воздух, кристально чистая горная вода. В поселке есть все необходимое для Вашей жизни: магазины, мед. Пункт, современный детский садик 2016 года постройки, среднеобразовательная школа, сельский совет, библиотека, остановки общественного транспорта. До города всего 7 километров.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается два смежных участка по 10 соток г. Алушта в поселке Лучистое',	'Продается два смежных участка по 10 соток г. Алушта в поселке Лучистое',	'Продается два смежных участка по 10 соток г. Алушта в поселке Лучистое',	'Продается два смежных участка по 10 соток г. Алушта в поселке Лучистое',	'Продается, продам, купить, куплю, продажа, участок, Лучистое, Алушта'),
(920,	1,	'Продаётся двухкомнатная квартира в Алуште, ул. Судакская 26. ',	'&amp;lt;p&amp;gt;\r\n	Продаётся двухкомнатная квартира в Алуште, ул. Судакская 26. Просторная квартира с шикарным видом на горы и виноградники, общ. площадью 62 кв. м., расположена на 12 этаже из 13. Квартира состоит из двух спален, большой гостиной и кухни вынесенной на просторную и видовую, утеплённую лоджию. В квартире сделан хороший ремонт, положен тёплый пол, кондиционер, вся мебель и техника установлена, бойлер установлен в техническом этаже над квартирой, которое можно использовать как кладовое помещение, помимо в квартире есть две кладовые по 1,5 кв. метра, просторная прихожая с вместительными шкафами, вторая лоджия с видом на город и горы, оформлена как рабочая зона. В квартире установлен домофон и сигнализация. В многоэтажном доме есть грузовой лифт. Рядом школа, остановка общественного транспорта, магазины, детский сад. К центру города и морю можно дойти за 5-7 минут.&amp;lt;/p&amp;gt;\r\n',	'Продаётся двухкомнатная квартира в Алуште, ул. Судакская 26. ',	'Продаётся двухкомнатная квартира в Алуште, ул. Судакская 26. ',	'Продаётся двухкомнатная квартира в Алуште, ул. Судакская 26. ',	'Продаётся двухкомнатная квартира в Алуште, ул. Судакская 26. ',	'Продается, купить, куплю, продажа, квартиру, трёхкомнатная, 3 комнатная,  в Алуште, видом на горы'),
(921,	1,	'Продается квартира 3 х комнатная в Партените по ул. Нагорной. ',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 3 х комнатная в Партените по ул. Нагорной. Квартира видовая с шикарным видом на горы, гору Медведь и море, с дизайнерским ремонтом, мебелью и техникой площадью в 76,5 кв. м., расположена по улице Нагорная, на 3-м этаже, в 12 этажном доме, и включает в себя две отдельных спальных комнаты, просторную гостиную соединённую с кухней, раздельный сан. узел. В квартире установлены кондиционеры, сделан тёплый пол, горячая вода дополнительно обеспечена бойлером. Предусмотрена охранная сигнализация, снаружи на окнах установлены рольставни. Дом находится в 10 минутах ходьбы от моря, рядом есть магазины. Посёлок городского типа Партенит замечательное место как для отдыха, так и для жизни: есть школа, детский садик, спортивные клубы, магазины, супермаркеты, кафе, аптеки; развита курортная и туристическая инфраструктура.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 3 х комнатная в Партените по ул. Нагорной. ',	'Продается квартира 3 х комнатная в Партените по ул. Нагорной. ',	'Продается квартира 3 х комнатная в Партените по ул. Нагорной. ',	'Продается квартира 3 х комнатная в Партените по ул. Нагорной. ',	'Продам, купить, куплю, продажа, квартиру, город Алушта, Партенит, с видом на море'),
(922,	1,	'Продается квартира 3-х комнатная на улице Нагорная, пгт. Партенит.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 3-х комнатная на улице Нагорная, пгт. Партенит. Просторная квартира с прекраснейшим видом на море и побережье, на гору Аю- Даг, площадью в 76 кв. м., расположена на 11 этаже многоквартирного двенадцатиэтажного дома в 10-ти минутах ходьбы от моря, в тихом видовом районе пгт Партенит. Продаваемая квартира с хорошим дизайнерским ремонтом, мебелью и техникой, полностью подготовлена для комфортного проживания: установлены кондиционеры, сделан тёплый пол, предусмотрены наружные рольставни на окна, также охранная сигнализация, кодовый замок в подъезде на две квартиры. В посёлке есть все необходимое как для жизни, так и для отдыха, развитая городская и курортная инфраструктура.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 3-х комнатная на улице Нагорная, пгт. Партенит.',	'Продается квартира 3-х комнатная на улице Нагорная, пгт. Партенит.',	'Продается квартира 3-х комнатная на улице Нагорная, пгт. Партенит.',	'Продается квартира 3-х комнатная на улице Нагорная, пгт. Партенит.',	'Продам ,продажа, куплю, купить, квартира, Алушта, Партенит, с видом на море'),
(923,	1,	'Продаются видовые апартаменты 61,8 кв.м. в Алуште.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продаются видовые апартаменты 61,8 кв.м. в Алуште.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Общая площадь продаваемых апартамемнтов составляет 61.8 кв.м., планировка свободная.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Комплекс представляем собой 5 этажное здание, на территории бассейн, свой подземный и наземная парковка, детская площадка. Апартаменты расположены на 4 этаже, из панорамных окон открывается не перекрываемый панорамный вид в сторону моря. Сделано разводка электричества, установлен кондиционер, сделана стяжка, заведены коммуникации.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Стоимость обслуживания 84,25 руб. за 1 кв.м.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продаются видовые апартаменты 61,8 кв.м. в Алуште.',	'Продаются видовые апартаменты 61,8 кв.м. в Алуште.',	'Продаются видовые апартаменты 61,8 кв.м. в Алуште.',	'Продаются видовые апартаменты 61,8 кв.м. в Алуште.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Фуджия, Жасмин'),
(924,	1,	'Продаются апартаменты 70.3 кв.м. в городе Алушта, Вилла Фуджия.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продаются апартаменты 70.3 кв.м. в городе Алушта, Вилла Фуджия.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Площадь апартаментов 70.3 кв.м., находятся на 1 этаже, есть свой дворик.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Комплекс представляет собой 3 здание, между которыми территория для отдыха и открытый бассейн,&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	у комплекса свой подземный паркинг, так же есть остевая парковка и на территории детская площадка.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	В апартаментах сделана стяжка, заведены коммуникации, установлено панорамное остекление.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Стоимость обслуживание в месяц 84,25 руб. за 1 кв.м.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продаются апартаменты 70.3 кв.м. в городе Алушта, Вилла Фуджия.',	'Продаются апартаменты 70.3 кв.м. в городе Алушта, Вилла Фуджия.',	'Продаются апартаменты 70.3 кв.м. в городе Алушта, Вилла Фуджия.',	'Продаются апартаменты 70.3 кв.м. в городе Алушта, Вилла Фуджия.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Фуджия, Жасмин'),
(925,	1,	'Продается апартамент 90,3 кв.м. в Алуште, Вилла Вуджия.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается апартамент 90,3 кв.м. в Алуште, Вилла Вуджия.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Общая площадь продаваемого апартамента 90.3 кв.м., этаж 2, всего в комплексе 3 здания по 5 этажей, между которыми расположен открытый плавательный бассейн. Есть свой подземный паркинг, с тремя въездами, отапливаемый и вентилируемый. Комплекс под круглосуточной охраной, на въезде КПП с охранной. С окон открывается не перекрываемый вид в сторону моря. Стоимость обслуживания на сегодняшний день составляет 84,25 руб. за 1 кв.м.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается апартамент 90,3 кв.м. в Алуште, Вилла Вуджия.',	'Продается апартамент 90,3 кв.м. в Алуште, Вилла Вуджия.',	'Продается апартамент 90,3 кв.м. в Алуште, Вилла Вуджия.',	'Продается апартамент 90,3 кв.м. в Алуште, Вилла Вуджия.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Фуджия, Жасмин'),
(996,	1,	'Продается 2-х комнатная квартира с ремонтом в новостройке г. Алушта, ул. Красноармейская.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается 2-х комнатная квартира с ремонтом в новостройке г. Алушта, ул. Красноармейская.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира расположена на 3 этаже в новом 5-и этажном доме 2016 года, со своей закрытой территорией, подземной парковкой, ухоженый двор.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Общая площадь квартиры 73,7 кв. м., 2 лоджии с видом на улицу и во двор, совмещеный санузел, просторная кухня с новой мебелью и техникой.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	В квартире выполнен хороший ремонт, полы паркет, автономное отопление, установлен двухконтурный газовый кател.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Хороший район, до моря пешим ходом 15 минут, до центра города 10 минут. Рядом школа, детский сад, супермаркеты, детская площадка, остановка, басейн, через дорогу спортивный комплекс.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Все документы РФ,&amp;amp;nbsp; к сделке готовы. Подходит для ипотеки.&amp;amp;nbsp;&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается 2-х комнатная квартира с ремонтом в новостройке г. Алушта, ул. Красноармейская.',	'Продается 2-х комнатная квартира с ремонтом в новостройке г. Алушта, ул. Красноармейская.',	'Продается 2-х комнатная квартира с ремонтом в новостройке г. Алушта, ул. Красноармейская.',	'Продается 2-х комнатная квартира с ремонтом в новостройке г. Алушта, ул. Красноармейская.',	'продам квартиру, куплю квартиру, квартира в алуште, квартира  крыму, квартира в новостройке'),
(926,	1,	'Продается 1-а комнатная квартира в новостройке г. Алушта по ул. Ленина 24',	'&amp;lt;p&amp;gt;\r\n	Продается 1-а комнатная квартира в новостройке г. Алушта по ул. Ленина 24. Жилой дом 2017 года застройки, введен в эксплуатацию в марте 2018 года. Продаваемая квартира расположена на 8-м этаже, 11-ти этажного высотного жилого дома. Общая площадь данной квартиры составляет 59 кв.м., строение представляет собой монолитное здание, сейсмоустойчивость в 8-9 баллов, в доме предусмотрены 2 лифта (грузовой и пассажирский), из окон квартиры открывается замечательный вид на море и парк. Квартира полностью под внутреннюю отделку, с индивидуальным проектом, установлены счетчики водоснабжения. Рядом с домом находится спортивный центр СПАРТАК, приморский парк, пешком к морю 5 мин. вся инфраструктура в шаговой доступности, центр города.&amp;lt;/p&amp;gt;\r\n',	'Продается 1-а комнатная квартира в новостройке г. Алушта по ул. Ленина 24',	'Продается 1-а комнатная квартира в новостройке г. Алушта по ул. Ленина 24',	'Продается 1-а комнатная квартира в новостройке г. Алушта по ул. Ленина 24',	'Продается 1-а комнатная квартира в новостройке г. Алушта по ул. Ленина 24',	'Продается, продам, продажа, купить, куплю, квартира, город Алушта, улица Ленина 24'),
(927,	1,	'Продается двухкомнатная квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'&amp;lt;p&amp;gt;\r\n	Продается двухкомнатная квартира в новом жилом доме в г. Алушта по ул. Ленина 24. Новостройка 2017 года застройки, введен в эксплуатацию март 2018 года. Квартира находится на 7-м этаже, 11-ти этажного дома. Площадь продаваемой квартиры 82 кв.м., здание монолитное, с сейсмоустойчивостью в 8-9 баллов, в доме установлено 2 лифта, грузовой и пассажирский, окна квартиры смотрят на ЮГ с превосходным видом на моря, горы и парк. Квартира полностью под внутреннюю отделку с индивидуальным проектом, установлены счетчики на воду. Рядом расположен спортивный центр «СПАРТАК», приморский парк, дельфинарий, к морю 5 мин. пешком, центр города, хорошая развитая инфраструктура.&amp;lt;/p&amp;gt;\r\n',	'Продается двухкомнатная квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается двухкомнатная квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается двухкомнатная квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается двухкомнатная квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается, продам, продажа, купить, куплю, квартиру, город Алушта, улица Ленина'),
(928,	1,	'Продается 1 комнатная квартира, ул. Ялтинская 19, гор. Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается 1 комнатная квартира, ул. Ялтинская 19, гор. Алушта. Квартира общ. площадью в 36 кв. м. с учётом лоджии в 5,7 кв. м., расположена третьем из пяти этажей. В квартире отопление центральное, установлен бойлер, подключен газ. Квартира включает в себя просторную комнату в 17,1 кв. м. с видом на облагороженную школьную территорию город и гору Демерджи, и выходом на лоджию, кухня в 6 кв. м. и совмещенный сан. узел. Жилой дом расположен в районе автовокзала, рядом со школой и лицеем, неподалеку детский сад, почтовое, банковское отделения, рынок, магазины и супермаркеты.&amp;lt;/p&amp;gt;\r\n',	'Продается 1 комнатная квартира, ул. Ялтинская 19, гор. Алушта.',	'Продается 1 комнатная квартира, ул. Ялтинская 19, гор. Алушта.',	'Продается 1 комнатная квартира, ул. Ялтинская 19, гор. Алушта.',	'Продается 1 комнатная квартира, ул. Ялтинская 19, гор. Алушта.',	'продажа, квартира, Алушта, купить, ЮБК, центр, автовокзал,купить, куплю, продам'),
(929,	1,	'Продается 2-х комнатная квартира в новом доме в г. Алушта по ул. Ленина 24',	'&amp;lt;p&amp;gt;\r\n	Продается 2-х комнатная квартира в новом доме в г. Алушта по ул. Ленина 24. Здание 2017 года постройке, введен в эксплуатацию в март 2018 г. Квартира находится на 2-м этаже, 11 этажного жилого, многоэтажного дома. Общая площадь продаваемой квартиры составляет 82.2 кв.м., здание монолитное, с сейсмоустойчивостью 8-9 баллов, в доме 2 лифта (грузовой, пассажирский), из окон квартиры вид на город, внутренний двор и стадион. Квартира под черновую внутреннюю отделку, с индивидуальным проектом, установлены счетчики на воду. Рядом огромный спортивный центр СПАРТАК, парк приморский, детские развлечения, дельфинарий, к морю 5 мин. пешком, центр города, развитая хорошая инфраструктура, магазины, отделения банков, детский садик, городская больница.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира в новом доме в г. Алушта по ул. Ленина 24',	'Продается 2-х комнатная квартира в новом доме в г. Алушта по ул. Ленина 24',	'Продается 2-х комнатная квартира в новом доме в г. Алушта по ул. Ленина 24',	'Продается 2-х комнатная квартира в новом доме в г. Алушта по ул. Ленина 24',	'Продается, продам, купить, куплю, продажа, квартира, квартиру, город Алушта, улица Ленина'),
(930,	1,	'Продается 2-х комнатная квартира в новостройке в г. Алушта по ул. Ленина 24',	'&amp;lt;p&amp;gt;\r\n	Продается 2-х комнатная квартира в новостройке в г. Алушта по ул. Ленина 24. Здание 2017 года постройке, дом введен в эксплуатацию в март 2018 г. Квартира расположена на 2-м этаже, 11 этажного жилого многоэтажного дома. Общая площадь составляет 82.2 кв.м., здание монолитное, с сейсмоустойчивостью в 8-9 баллов, в доме установлено 2 лифта (грузовой, пассажирский), из окон квартиры вид в на парк, южная сторона в сторону море, внутренний двор. Квартира под черновую внутреннюю отделку, с индивидуальным проектом, установлены счетчики на воду. Рядом огромный спортивный центр СПАРТАК, зеленый парк приморский с аттракционами, детские развлечения, дельфинарий, к морю 5 мин. пешком, центр города, развитая хорошая инфраструктура, несколько магазинов, отделения банка, детский садик, городская больница, все в шаговой доступности.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира в новостройке в г. Алушта по ул. Ленина 24',	'Продается 2-х комнатная квартира в новостройке в г. Алушта по ул. Ленина 24',	'Продается 2-х комнатная квартира в новостройке в г. Алушта по ул. Ленина 24',	'Продается 2-х комнатная квартира в новостройке в г. Алушта по ул. Ленина 24',	'Продается, продам, продажа, купить, куплю, квартира, город Алушта, улица Ленина 24'),
(1000,	1,	'Продается земельный участок 15 соток г. Алушта в поселке Малый Маяк',	'&amp;lt;p&amp;gt;\r\n	Продается земельный участок 15 соток г. Алушта в поселке Малый Маяк. Участок расположен в жилом, зеленом массиве. Перед участком стоят многолетние сосны и ели. Рядом находятся свет, вода, газ, хороший бетонный подъезд к участку. Соседи рядом уже построились, хорошее соседство. До моря 3 км. по дороге. Документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 15 соток г. Алушта в поселке Малый Маяк',	'Продается земельный участок 15 соток г. Алушта в поселке Малый Маяк',	'Продается земельный участок 15 соток г. Алушта в поселке Малый Маяк',	'Продается земельный участок 15 соток г. Алушта в поселке Малый Маяк',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Малый Маяк'),
(998,	1,	'Продается двух комнатная квартира по ул. Б. Хмельницкого 5, г. Алушта',	'&amp;lt;p&amp;gt;\r\n	Продается двух комнатная квартира по ул. Б. Хмельницкого 5, г. Алушта. Квартира на 2-м этаже, 6-ти этажного жилого дома, общей площадью 62 кв.м. Просторная прихожая, свое автономное газовое отопление, высокие потолки 3.2 м., большая кухня, две раздельные комнаты 20 кв.м., и 12 кв.м., совмещенный сан. Узел. В квартире ни кто не прописан, полностью готова к сделке. Все документы РФ. Есть свой гараж 18 кв.м. Срочно!!!&amp;lt;/p&amp;gt;\r\n',	'Продается двух комнатная квартира по ул. Б. Хмельницкого 5, г. Алушта',	'Продается двух комнатная квартира по ул. Б. Хмельницкого 5, г. Алушта',	'Продается двух комнатная квартира по ул. Б. Хмельницкого 5, г. Алушта',	'Продается двух комнатная квартира по ул. Б. Хмельницкого 5, г. Алушта',	'Продается, продам, продажа, купить, куплю, квартира, квартиру, город Алушта, улица Б. Хмельницкого 5'),
(999,	1,	'Продается уютный загородный дом из сруба 133 кв.м. на 12 сотках земли в поселке Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается уютный загородный дом из сруба 133 кв.м. на 12 сотках земли с панорамным видом на море, горы и город. Дом 2-х этажный, фактически 150 кв.м., 2016 года постройки (лес сосна, 24 диаметр), в доме четыре спальные комнаты, два сан. Узла. Дом полностью жилой, оборудован всей необходимой техникой и мебелью. Подключены все коммуникации свет, своя скважина, стоит локально-очистительная система, (получены тех. условия на газ). Находиться в одном из живописных мест г. Алушта в поселке Лучистое, 7 км. до города. Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается уютный загородный дом из сруба 133 кв.м. на 12 сотках земли в поселке Лучистое',	'Продается уютный загородный дом из сруба 133 кв.м. на 12 сотках земли в поселке Лучистое',	'Продается уютный загородный дом из сруба 133 кв.м. на 12 сотках земли в поселке Лучистое',	'Продается уютный загородный дом из сруба 133 кв.м. на 12 сотках земли в поселке Лучистое',	'Продается, продам, продажа, купить, куплю, дом, город Алушта, поселок Лучистое'),
(933,	1,	'Продается 3-х комнатная квартира в Нижней Кутузовке, гор. Алушта. ',	'&amp;lt;p&amp;gt;\r\n	Продается 3-х комнатная квартира в Нижней Кутузовке, гор. Алушта. Квартира с общей площадью в 64,8 из которых две раздельные спальни по 11,2 кв. м. с видом на город Алушту, море, горы, гостиная в 17,4 кв. м. и кухня в 5,2 кв. м. с выходом на лоджию в 8 кв. м. с видом на горы, расположена на 4-м этаже, пятиэтажного дома по ул. Алуштинское шоссе.&amp;amp;nbsp; Квартира с хорошим ремонтом, установлены мебель и техника, кондиционеры, подключен газ, горячая вода обеспечена газовой колонкой. Рядом с домом расположен супермаркет, магазин, остановка общественного транспорта и детский сад, в минуте ходьбы троллейбусная остановка, а сам посёлок расположен в нескольких минутах езды от города Алушта.&amp;lt;/p&amp;gt;\r\n',	'Продается 3-х комнатная квартира в Нижней Кутузовке, гор. Алушта. ',	'Продается 3-х комнатная квартира в Нижней Кутузовке, гор. Алушта. ',	'Продается 3-х комнатная квартира в Нижней Кутузовке, гор. Алушта. ',	'Продается 3-х комнатная квартира в Нижней Кутузовке, гор. Алушта. ',	'Продается, купить, куплю, продажа, квартиру, квартира, город Алушта, Нижняя Кутузовка, с ремонтом, в тихом районе, с видом на море'),
(934,	1,	'Продается видовая квартира 103 кв.м. в Алуште.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается видовая квартира 103 кв.м. в Алуште.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Общая площадь продаваемой квартиры 103 кв.м., терраса 9 кв.м.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира расположена на 4 этаже, над ней еще один этаж, большой пентхаус.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Заведены все коммуникации, установлено остекление с окон открывается вид на море.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира под ремонт, есть возможность прописаться.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается видовая квартира 103 кв.м. в Алуште.',	'Продается видовая квартира 103 кв.м. в Алуште.',	'Продается видовая квартира 103 кв.м. в Алуште.',	'Продается видовая квартира 103 кв.м. в Алуште.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(935,	1,	'Продается 2-х ком. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'&amp;lt;p&amp;gt;\r\n	Продается двухкомнатная квартира в новом жилом доме в г. Алушта по ул. Ленина 24. Новостройка 2017 года застройки, введен в эксплуатацию март 2018 года. Квартира находится на 4-м этаже, 10-ти этажного дома, минус 2 этажа вниз (торговые площадки, подземный паркинг) Площадь продаваемой квартиры 89 кв.м., здание монолитное, с сейсмоустойчивостью в 8-9 баллов, в доме установлено 2 лифта, грузовой и пассажирский, с превосходным видом на горы и парк. Квартира полностью под внутреннюю отделку с индивидуальным проектом. Рядом расположен спортивный центр «СПАРТАК», приморский парк, дельфинарий, к морю 5 мин. пешком, центр города, отделения банка, аптеки, детский садик, хорошая развитая инфраструктура.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х ком. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается 2-х ком. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается 2-х ком. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается 2-х ком. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается, продажа, продам, купить, куплю, квартира, квартиру, город Алушта, улица Ленина 24'),
(936,	1,	'Продается 3-х комн. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'&amp;lt;p&amp;gt;\r\n	Продается 3-х квартира в новом жилом доме в г. Алушта по ул. Ленина 24. Новостройка 2017 года застройки, введен в эксплуатацию март 2018 года. Квартира на 4-м этаже, 10-ти этажного дома, минус два этажа вниз (торговые площадки, подземный паркинг) Площадь квартиры 116 кв.м., дом представляет собой монолитное здание, с сейсмоустойчивостью в 8-9 баллов, в доме 2 лифта, грузовой, пассажирский, с видом на горы, парк, город и море. Квартира под внутреннюю черновую отделку с индивидуальным проектом. Рядом с домом находиться спортивный центр «СПАРТАК», вечно зеленый приморский парк, дельфинарий, к морю 5 мин. пешком, центр города, отделения банка, аптеки, детский садик, хорошая развитая инфраструктура.&amp;lt;/p&amp;gt;\r\n',	'Продается 3-х комн. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается 3-х комн. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается 3-х комн. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается 3-х комн. квартира в новом жилом доме в г. Алушта по ул. Ленина 24',	'Продается, продажа, продам, купить, куплю, квартиру, квартира, город Алушта, улица Ленина 24'),
(937,	1,	'Продается видовой земельный участок 5 соток г. Алушта, с. Нижняя-Кутузовка по ул. Садовая',	'&amp;lt;p&amp;gt;\r\n	Продается видовой земельный участок 5 соток г. Алушта, с. Нижняя-Кутузовка по ул. Садовая. Участок ровный, правильной формы, коммуникации по границе участка, газ, свет, вода централизованная. С земельного участка открывается панорамный вид на гору «Демерджи», водохранилище, море, город Алушту. Хорошие подъездные пути, дорога асфальт + накатанная грунтовая дорога к участку 80 метров. Участок расположен ниже трассы Ялта-Симферополь, до города 5 км, к остановке 50 метров, общественным транспортом 15 минут до центра города и центральной набережной. На участке есть капитальные хозяйственные постройки, (одноэтажное строение с хорошим фундаментом, баня и маленький бассейн 3*3), посажены фруктовые деревья, плодоносный орех фундук, кусты смородины, виноград, черешня, инжир. В центре поселка есть магазин, мед. Пункт фельдшер. Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается видовой земельный участок 5 соток г. Алушта, с. Нижняя-Кутузовка по ул. Садовая',	'Продается видовой земельный участок 5 соток г. Алушта, с. Нижняя-Кутузовка по ул. Садовая',	'Продается видовой земельный участок 5 соток г. Алушта, с. Нижняя-Кутузовка по ул. Садовая',	'Продается видовой земельный участок 5 соток г. Алушта, с. Нижняя-Кутузовка по ул. Садовая',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, село Нижняя Кутузовка, Нижняя Кутузовка'),
(938,	1,	'Продается квартира 3-х комнатная в новом доме по ул. Ленина, г. Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 3-х комнатная в новом доме по ул. Ленина, г. Алушта. Квартира с общей площадью в 96,3 кв. м под отделку, расположена на 11 этаже из 14. Включает в себя кухню, спальную и общую комнату с просторной застекленной лоджией с видом на море и спальню с балкончиком с видом на горы и город и церковь, а также раздельный сан. узел и кладовую в 5 кв. м. В доме, введённом в эксплуатацию в сентябре 2016 года, предусмотрено два лифта: и грузовой, и пассажирский. Закрытая придомовая территория. Преимуществом является невысокая стоимость обслуживания квартир 20 руб./ кв. м. &amp;amp;nbsp;Жилой дом расположен в центральной части города, в трёхстах метрах от набережной. Все необходимое для жизни и отдыха находится поблизости: магазины, кафе, салоны красоты, банковские отделения, детский парк, дельфинарий, пляжи, фитнес центры. Продается квартира 3-х комнатная в новом доме по ул. Ленина, г. Алушта.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 3-х комнатная в новом доме по ул. Ленина, г. Алушта.',	'Продается квартира 3-х комнатная в новом доме по ул. Ленина, г. Алушта.',	'Продается квартира 3-х комнатная в новом доме по ул. Ленина, г. Алушта.',	'Продается квартира 3-х комнатная в новом доме по ул. Ленина, г. Алушта.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Кутузовский, элитная'),
(939,	1,	'Продается однокомнатная квартира в центре Алушты в новом элитном комплексе.',	'&amp;lt;p&amp;gt;\r\n	Продается однокомнатная квартира в центре Алушты в новом элитном комплексе. Квартира под отделку, общая площадь которой составляет 45,1 кв. м. и включает в себя просторную прихожую, совмещенный сан. узел, кухня с выходом на балкон и общая комната с видом на церковь, горы и город Алушту. В доме, введённом в эксплуатацию в сентябре 2016 года, предусмотрено два лифта: и грузовой, и пассажирский. Закрытая придомовая территория. Преимуществом является невысокая стоимость обслуживания квартир 20 руб./ кв. м.&amp;amp;nbsp; Жилой дом расположен в центральной части города, в трёхстах метрах от набережной. Все необходимое для жизни и отдыха находится поблизости: магазины, кафе, салоны красоты, банковские отделения, детский парк, дельфинарий, пляжи, фитнес центры.&amp;lt;/p&amp;gt;\r\n',	'Продается однокомнатная квартира в центре Алушты в новом элитном комплексе.',	'Продается однокомнатная квартира в центре Алушты в новом элитном комплексе.',	'Продается однокомнатная квартира в центре Алушты в новом элитном комплексе.',	'Продается однокомнатная квартира в центре Алушты в новом элитном комплексе.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Кутузовский, элитном'),
(940,	1,	'Продается квартира двухкомнатная в Алуште, в элитном жилом комплексе. ',	'&amp;lt;p&amp;gt;\r\n	Продается квартира двухкомнатная в Алуште, в элитном жилом комплексе. Квартира общей площадью в 71,5 кв. м. расположена на 12 этаже, и включает в себя спальную и общую комнаты с выходами на террасу с видом на горы, город и море, кухню с видом на горы, раздельный сан. узел. В 14-ти этажном доме, введённом в эксплуатацию в сентябре 2016 года, предусмотрено два лифта: и грузовой, и пассажирский. Закрытая придомовая территория. Преимуществом является невысокая стоимость обслуживания квартир 20 руб./ кв. м.&amp;amp;nbsp; Жилой дом расположен в центральной части города, в трёхстах метрах от набережной. Все необходимое для жизни и отдыха находится поблизости: магазины, кафе, салоны красоты, банковские отделения, детский парк, дельфинарий, пляжи, фитнес центры.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира двухкомнатная в Алуште, в элитном жилом комплексе. ',	'Продается квартира двухкомнатная в Алуште, в элитном жилом комплексе. ',	'Продается квартира двухкомнатная в Алуште, в элитном жилом комплексе. ',	'Продается квартира двухкомнатная в Алуште, в элитном жилом комплексе. ',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Кутузовский'),
(941,	1,	'Продается пентхаус в элитном клубном доме, г.Алушта.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается пентхаус в элитном клубном доме, г.Алушта.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Общая площадь продаваемого пентхауса 407,2 кв.м., половина данной площади это открытые видовые террасы на город и море.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Клубный дом Дача Доктора Штейнгольца считается самым статусным местом в городу, имеет свою закрытую территорию со своей детской площадкой, шахматным клубом, зоной отдыха, крытым бассейном, а так же на территории фитнес зал, СПА, ресторан. Территория комплекса 24 часа в сутки под круглосуточной охраной. У комплекса есть подземный паркинг в несколько уровней. Клубный дом расположен на границы с Приморским парком города Алушты и в 100 метрах от пляжа и набережной города. Город Алушта и Клубный Дом &amp;quot;Дача Доктора Штейнгольца&amp;quot; - это потрясающие место для жизни и отдыха.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается пентхаус в элитном клубном доме, г.Алушта.',	'Продается пентхаус в элитном клубном доме, г.Алушта.',	'Продается пентхаус в элитном клубном доме, г.Алушта.',	'Продается пентхаус в элитном клубном доме, г.Алушта.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, Дача Доктора Штейнгольца'),
(943,	1,	'Продается 3-х этажный дом в г. Алушта по ул. Судакская',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-size: 11pt; line-height: 107%; font-family: Arial, sans-serif; color: black; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;&amp;quot;&amp;gt;Продается 3-х этажный дом в г. Алушта по ул. Судакская. Дом представляет собой монолитный каркас три этажа 157 кв.м., с мансардой, заполнением ракушечника Крымского природного экологического камня. Фасад дома и внутренние стены оштукатурены, по границе участка проходит все центральные коммуникации включая свет, вода, газ. Дом 2010 года введен в эксплуатацию и присвоен адрес. Строение стоит на земельном участке 3.5 сотки, дачного кооператива «Ветеран-3». Дачный кооператив (на сегодняшний день земля активно выводится из кооператива). Активно застраиваемое место, в шаговой доступности, школа, садик, магазины, супермаркет. Хорошие подъездные пути. Вид на город и горы, до моря пешком 20 минут, рядом остановка общественного транспорта.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается 3-х этажный дом в г. Алушта по ул. Судакская',	'Продается 3-х этажный дом в г. Алушта по ул. Судакская',	'Продается 3-х этажный дом в г. Алушта по ул. Судакская',	'Продается 3-х этажный дом в г. Алушта по ул. Судакская',	'Продается, продажа, продам, купить, куплю, дом, город Алушта'),
(944,	1,	'Продается квартира 2-х комнатная, гор. Алушта, ул. Симферопольская.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 2-х комнатная, гор. Алушта, ул. Симферопольская. Квартира общей площадью в 49,5 кв. м. с учётом лоджии, из которых: две жилые комнаты в 11,2 кв. м. и 17,2 кв. м., кухня 6 кв. м., раздельный сан. узел, прихожая. Отопление центральное, газ подключен, установлена газовая колонка. Расположена квартира на втором этаже 5-ти этажного дома в центральной части города Алушта, как к центру города, так и к автовокзалу всего несколько минут ходьбы, рядом школа, детский сад, рынок, магазины, городская больница.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 2-х комнатная, гор. Алушта, ул. Симферопольская.',	'Продается квартира 2-х комнатная, гор. Алушта, ул. Симферопольская.',	'Продается квартира 2-х комнатная, гор. Алушта, ул. Симферопольская.',	'Продается квартира 2-х комнатная, гор. Алушта, ул. Симферопольская.',	'Продается, купить, куплю, продажа, квартиру, город Алушта, в центре, центральный район'),
(945,	1,	'Продается 1-а ком. квартира г. Алушта, ул. Красноармейская',	'&amp;lt;p&amp;gt;\r\n	Продается 1-а ком. квартира г. Алушта, ул. Красноармейская. Однокомнатная квартира, расположена на третьем этаже, 5-ти этажного жилого дома, общей площадью в 45 кв.м., из которых: комната 21 кв.м. совмещенная с лоджией, большая светлая кухня 15 кв.м. так же совмещенная с лоджией, сан.узел совмещённый 4.6 кв.м. и прихожая 4 кв.м. В квартире выполнен хороший ремонт, по всей квартире уложен кафель (теплые полы по всей квартире), установлен двухконтурный газовый котел. Дом 2006 года постройки, представляет собой монолитный каркас с заполнением Крымского ракушечника. Выполнен согласно всем нормам, сейсмоустойчивость здания 8-9 баллов, дом газифицирован, закрытая территория, чистый и ухоженный собственный дворик. Тихий спальный район с развитой инфраструктурой в шаговой доступности: детский садик, школа, детская площадка, магазины, супермаркет, остановка общ. транспорта, бассейн, через дорогу спортивный комплекс с различными секциями как для взрослых, так и для детей. К морю прогулочным шагом, не спеша всего 15-20 минут. Дополнительно в летнее время ходит маршрутный транспорт на восточную набережную, на котором за считаные минуты доставит Вас на чистейшие и в тоже время свободные пляжи, с мелкой галькой.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается 1-а ком. квартира г. Алушта, ул. Красноармейская',	'Продается 1-а ком. квартира г. Алушта, ул. Красноармейская',	'Продается 1-а ком. квартира г. Алушта, ул. Красноармейская',	'Продается 1-а ком. квартира г. Алушта, ул. Красноармейская',	'Продам, продается, продажа, купить, куплю, квартиру, город Алушта, улица Красноармейская'),
(946,	1,	'Продается два смежных участка по 6 соток г. Алушта в п. Розовое',	'&amp;lt;p&amp;gt;\r\n	Продается два смежных участка по 6 соток г. Алушта в п. Розовое. Участки находятся в экологически чистом месте, в близи заповедника. Во круг лес, пение птиц и журчание воды. Рядом есть соседи, которые проживают постоянно. Есть возможность подключения электроэнергии и воды. Хорошие подъездные пути. Отличное место для загородного дома, где нет городской суеты, вокруг только живописная и не прикосновенная природа и Вы.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается два смежных участка по 6 соток г. Алушта в п. Розовое',	'Продается два смежных участка по 6 соток г. Алушта в п. Розовое',	'Продается два смежных участка по 6 соток г. Алушта в п. Розовое',	'Продается два смежных участка по 6 соток г. Алушта в п. Розовое',	'Продается, продажа, продам, купить, куплю, участок, город Алушта, поселок Розовое'),
(947,	1,	'Продается отличный земельный участок 17 соток г. Алушта п. Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается отличный земельный участок 17 соток г. Алушта п. Лучистое. Участок расположен в центре поселка, все коммуникации в доступности. Вид на горы и море, всего в 7 километрах от города. В поселке находиться все необходимое для постоянного места жительства: школа, садик, магазины, остановка общ. транспорта, мед. Пункт, хорошие подъездные пути к участку. Есть так же возможность приобретения смежного участка рядом.&amp;lt;/p&amp;gt;\r\n',	'Продается отличный земельный участок 17 соток г. Алушта п. Лучистое',	'Продается отличный земельный участок 17 соток г. Алушта п. Лучистое',	'Продается отличный земельный участок 17 соток г. Алушта п. Лучистое',	'Продается отличный земельный участок 17 соток г. Алушта п. Лучистое',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Лучистое'),
(948,	1,	'Продается участок видовой 1.5 Га г. Алушта, в поселке Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается участок видовой 1.5 Га г. Алушта, в поселке Лучистое. Рядом асфальтированная дорога, прямой подъезд с асфальта, есть возможность подключения к коммуникациям, вид на море, горы, виноградники, город и озеро. Отлично подойдет под застройку коттеджного поселка. Участок развернут в сторону моря, на Юг.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается участок видовой 1.5 Га г. Алушта, в поселке Лучистое',	'Продается участок видовой 1.5 Га г. Алушта, в поселке Лучистое',	'Продается участок видовой 1.5 Га г. Алушта, в поселке Лучистое',	'Продается участок видовой 1.5 Га г. Алушта, в поселке Лучистое',	'Продается, продажа, продам, купить, куплю, участок, город Алушта, село Лучистое'),
(949,	1,	'Продается квартира 1-но комнатная в г. Алушта, ул. Судакская.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 1-но комнатная в г. Алушта, ул. Судакская. Квартира общей площадью в 39 кв. м., с учётом просторной лоджии в 8,5 кв. м. под косметический ремонт, расположена на первом этаже из 5 многоквартирного дома в тихом районе города. В квартире отопление центральное, подключен газ, дополнительно установлена газовая колонка. Непосредственно возле жилого дома расположен детский сад и общеобразовательная школа, остановка общественного транспорта, а также магазины, женская и зубная клиники. Прогулка к морю и к центру города по ровной местности займёт не более 10 минут.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 1-но комнатная в г. Алушта, ул. Судакская.',	'Продается квартира 1-но комнатная в г. Алушта, ул. Судакская.',	'Продается квартира 1-но комнатная в г. Алушта, ул. Судакская.',	'Продается квартира 1-но комнатная в г. Алушта, ул. Судакская.',	'Продается, купить, куплю, продажа, квартиру, квартира, город Алушта, пальном районе, тихом районе, возле винзавода'),
(950,	1,	'Продается трехкомнатная квартира в Алуште, по ул. 60 Лет СССР.',	'&amp;lt;p&amp;gt;\r\n	Продается трехкомнатная квартира в Алуште, по ул. 60 Лет СССР. Квартира общей площадью в 68,6 кв. м., свободной планировки и состоянием под отделку, расположена на 15 этаже из 15-ти, в тихом спальном районе города. Есть возможность спланировать второй уровень в квартире. Из окон квартиры открывается шикарный вид на город Алушту, Крымские горы, море. В жилом доме предусмотрено два лифта, видеонаблюдение на входе, рядом удобная парковка, неподалёку остановка общественного транспорта, в двух минутах ходьбы район автовокзала, где есть школа, садик, магазины и рынок, почтовое и банковское отделения.&amp;lt;/p&amp;gt;\r\n',	'Продается трехкомнатная квартира в Алуште, по ул. 60 Лет СССР.',	'Продается трехкомнатная квартира в Алуште, по ул. 60 Лет СССР.',	'Продается трехкомнатная квартира в Алуште, по ул. 60 Лет СССР.',	'Продается трехкомнатная квартира в Алуште, по ул. 60 Лет СССР.',	'Продается, купить, куплю, продажа, квартиру, квартира, город Алушта, под отделку, новостройка, в новострое'),
(951,	1,	'Продается земельный участок 8 соток с видом на море г. Алушта, п. Лазурное',	'&amp;lt;p&amp;gt;\r\n	Продается земельный участок 8 соток с видом на море г. Алушта, п. Лазурное. Участок правильной формы, хорошие подъездные пути. С участка открывается не перекрываемый вид на море и горы. Активно застраиваемое место, наличие хороших соседей. Есть возможность подключения всех коммуникаций. По прямой до моря пешком, по тропинки 280 метров.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 8 соток с видом на море г. Алушта, п. Лазурное',	'Продается земельный участок 8 соток с видом на море г. Алушта, п. Лазурное',	'Продается земельный участок 8 соток с видом на море г. Алушта, п. Лазурное',	'Продается земельный участок 8 соток с видом на море г. Алушта, п. Лазурное',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, село Лазурное'),
(952,	1,	'Продается участок 10 соток ИЖС г. Алушта в п. Лаванда',	'&amp;lt;p&amp;gt;\r\n	Продается участок 10 соток ИЖС г. Алушта в п. Лаванда. Участок ровный и правильной формы, рядом асфальтированная дорога, до города 5 км, есть возможность подключения к коммуникациям, вид на горы.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается участок 10 соток ИЖС г. Алушта в п. Лаванда',	'Продается участок 10 соток ИЖС г. Алушта в п. Лаванда',	'Продается участок 10 соток ИЖС г. Алушта в п. Лаванда',	'Продается участок 10 соток ИЖС г. Алушта в п. Лаванда',	'Продается, продам, купить, куплю, продажа, участок, город Алушта, село Лаванда'),
(902,	1,	'Продается хороший видовой участок 11 соток г. Алушта, в Верхней Кутузовке',	'&amp;lt;p&amp;gt;\r\n	Продается хороший видовой участок 11 соток г. Алушта, в Верхней Кутузовке. Земельный участок ровный, развернут на Юг. По границе участка протекает горная река, так же рядом с участком имеется природный источник родниковой воды. Участок немного посажен вниз, что не даёт возможности господствующим ветрам властвовать в этом месте. Место хорошо застраиваемое, с второго этажа будущего дома открывается панорамный вид на море, южные горы и город. Отличные подъездные пути, асфальтированная дорога + 40 метров ХОРОШЕЙ грунтовой дороги. Коммуникации в доступности, свет, вода, газ в перспективе год (нижняя часть поселка уже газифицирована).&amp;lt;/p&amp;gt;\r\n',	'Продается хороший видовой участок 11 соток г. Алушта, в Верхней Кутузовке',	'Продается хороший видовой участок 11 соток г. Алушта, в Верхней Кутузовке',	'Продается хороший видовой участок 11 соток г. Алушта, в Верхней Кутузовке',	'Продается хороший видовой участок 11 соток г. Алушта, в Верхней Кутузовке',	'Продается, купить, куплю, продам, продажа, участок, 11 соток, город Алушта, поселок Верхняя Кутузовка'),
(953,	1,	'Продаются 2-х комнатные апартаменты, г. Алушта, п. Семидворье.',	'&amp;lt;p&amp;gt;\r\n	Продаются 2-х комнатные апартаменты, г. Алушта, п. Семидворье. Апартаменты категории люкс, общей площадью в 120 кв. м. расположены на 3-м этаже в отельном комплексе «Эллада», корпус «Фисташковый», в первой линии в 30 метрах от оборудованных пляжей. В апартаментах две большие комнаты, каждая с выходом на просторный балкон с шикарным видом на море и ухоженную озеленённую набережную, просторная прихожая и кухня, совмещённый сан. узел. Апартаменты с качественной отделкой и оборудованы всей необходимой мебелью и техникой. Территория рекреационного комплекса закрыта и охраняема, удобная инфраструктура для полноценного отдыха.&amp;lt;/p&amp;gt;\r\n',	'Продаются 2-х комнатные апартаменты, г. Алушта, п. Семидворье.',	'Продаются 2-х комнатные апартаменты, г. Алушта, п. Семидворье.',	'Продаются 2-х комнатные апартаменты, г. Алушта, п. Семидворье.',	'Продаются 2-х комнатные апартаменты, г. Алушта, п. Семидворье.',	'Продается, купить, куплю, продажа, квартиру, апартаменты, квартира, город Алушта, с выходом на море, возле моря , элитная, элитные'),
(954,	1,	'Продается однокомнатная квартира по улице Юбилейная в Алуште.',	'&amp;lt;p&amp;gt;\r\n	Продается однокомнатная квартира по улице Юбилейная в Алуште. Квартира общей площадью в 47,8 кв. м. находится на 3-м этаже 11 этажного монолитного дома 2006 года постройки в тихом спальном районе в 10-ти минутах ходьбы от автовокзала. В квартире: жилая комната площадью 18,8 кв. м., прихожая 10 кв. м., кухня 7 кв. м, совмещенный сан. узел и просторная лоджия в 10 кв. м. &amp;amp;nbsp;с частичным видом на город Алушту и море. В жилом доме предусмотрен лифт и закрытый коридор на 5 квартир, на входе в подъезд так же установлен домофон, просторная придомовая территория позволяет парковать авто.&amp;lt;/p&amp;gt;\r\n',	'Продается однокомнатная квартира по улице Юбилейная в Алуште.',	'Продается однокомнатная квартира по улице Юбилейная в Алуште.',	'Продается однокомнатная квартира по улице Юбилейная в Алуште.',	'Продается однокомнатная квартира по улице Юбилейная в Алуште.',	'Продам ,продажа, куплю, купить, квартира, Алушта, спальном районе, возле автовокзала, район автовокзала'),
(955,	1,	'Продается хороший земельный участок 25 соток г. Алушта в поселке Изобильное',	'&amp;lt;p&amp;gt;\r\n	Продается хороший земельный участок 25 соток г. Алушта в поселке Изобильное. Участок представляет собой две абсолютно ровные полочки по 12.5 соток каждая. С участка открывается замечательный вид на море и горы, в 400-та метрах от продаваемого участка находиться Изобильненское водохранилище. Хорошие подъездные пути, участок расположен в 20-ти метрах от асфальтированного покрытия с прямым заездом на участок. Есть возможность подключения к коммуникациям (свет, вода, газ). До города Алушта на автомобиле всего 5 минут езды. Так же ходит общественный транспорт, есть школа, магазины, больница. Документы РФ готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продается хороший земельный участок 25 соток г. Алушта в поселке Изобильное',	'Продается хороший земельный участок 25 соток г. Алушта в поселке Изобильное',	'Продается хороший земельный участок 25 соток г. Алушта в поселке Изобильное',	'Продается хороший земельный участок 25 соток г. Алушта в поселке Изобильное',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Изобильное'),
(956,	1,	'Продается квартира двухкомнатная в Алуште по ул. Октябрьская 51. ',	'&amp;lt;p&amp;gt;\r\n	Продается квартира двухкомнатная в Алуште по ул. Октябрьская 51. Квартира площадью в 49,5 кв. м. без учёта просторной лоджии и балкона, с хорошим видом на море и город Алушту и горы, расположенная на 12-м из 12-ти этажей, включает в себя: две жилые комнаты общей площадью &amp;amp;nbsp;в 30 м. кв., кухню 9 кв. м., прихожая комната 5,5 кв. м., сан. узел раздельный. В доме предусмотрено центральное отопление, грузовой и пассажирский лифты, в подъезде на входе установлен домофон. Сам жилой дом расположен в районе с развитой инфраструктурой, рядом есть магазины, тренажерный зал, детский сад и остановки общественного транспорта, к району автовокзала можно дойти за три минуты, а к морю за 10 минут.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира двухкомнатная в Алуште по ул. Октябрьская 51. ',	'Продается квартира двухкомнатная в Алуште по ул. Октябрьская 51. ',	'Продается квартира двухкомнатная в Алуште по ул. Октябрьская 51. ',	'Продается квартира двухкомнатная в Алуште по ул. Октябрьская 51. ',	'Продам, продажа, продается, квартира, Алушта, с видом на море, тихом районе. видовая'),
(957,	1,	'Продается 1-а ком. квартира в г. Алушта по ул. Б. Хмельницкого 23',	'&amp;lt;p&amp;gt;\r\n	Продается 1-а ком. квартира в г. Алушта по ул. Б. Хмельницкого 23. Квартира расположена на 5/9 этажного жилого дома, общей площадью 47 кв.м., комната 17.3 кв.м, прихожая 7 кв.м., кухня 9 кв.м., лоджия 7.5 кв.м., совмещенный сан. Узел 5.2 кв.м. Окна комнаты выходят на южную сторону с видом на море и город. Квартира светлая, теплая, сделан хороший ремонт, установлен двухконтурный газовый котел (свое автономное отопление). Дом 2008 года постройки, весь фасад здания утеплен, дом газифицирован, чистый подъезд, ухоженная зеленая территория, тихий спальный район. Развитая инфраструктура, магазины, детские площадки, остановка общественного транспорта, церковь.&amp;lt;/p&amp;gt;\r\n',	'Продается 1-а ком. квартира в г. Алушта по ул. Б. Хмельницкого 23',	'Продается 1-а ком. квартира в г. Алушта по ул. Б. Хмельницкого 23',	'Продается 1-а ком. квартира в г. Алушта по ул. Б. Хмельницкого 23',	'Продается 1-а ком. квартира в г. Алушта по ул. Б. Хмельницкого 23',	'Продается, продажа, продам, квартира, квартиру, купить, куплю, город Алушта, улица Б. Хмельницкого 23'),
(958,	1,	'Продаются апартаменты 1- комнатные в центре города Алушты. ',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты 1- комнатные в центре города Алушты. Апартаменты общей площадью в 32,8 кв. м. расположены на 4 -м этаже девятиэтажного Апарт -отеля «Фиеста» по улице Багликова в 500 метрах от моря. В апартаментах сделан современный ремонт, установлена хорошая мебель. В доме предусмотрено автономное отопление, два лифта, также предусмотрена просторная зона общего пользования: есть сушильная комната с выходом на общий балкон, с которого открывается вид на город и море. Развитая инфраструктура, в шаговой доступности центр города и городская Администрация, столовые, рынок, кафе, остановка общественного транспорта.&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты 1- комнатные в центре города Алушты. ',	'Продаются апартаменты 1- комнатные в центре города Алушты. ',	'Продаются апартаменты 1- комнатные в центре города Алушты. ',	'Продаются апартаменты 1- комнатные в центре города Алушты. ',	'Продам ,продажа, куплю, Алушта, возле моря, элитная, новая, в центре, апартаменты'),
(959,	1,	'Продаются апартаменты 1 комнатные в центре Алушты по ул. Багликова.',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты 1 комнатные в центре Алушты по ул. Багликова. Апартаменты расположены на 6-м этаже 9-ти этажного Апарт отеля «Фиеста», на расстоянии 500 метров от центральной набережной города Алушта. Площадь предлагаемых к продаже апартаментов с ремонтом и мебелью, составляет 38,6 м2., включает жилую комнату с выходом на уютный балкон с хорошим видом на город и крымские горы, совмещённый сан. узел, прихожую комнату. В доме предусмотрено автономное отопление, два лифта, общая сушильная комната с выходом на общий балкон с видом на город и море. Развитая инфраструктура, все необходимое как для жизни, так и для отдыха располагается в шаговой доступности. Апартаменты можно использовать для собственного проживания так и под сдачу.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты 1 комнатные в центре Алушты по ул. Багликова.',	'Продаются апартаменты 1 комнатные в центре Алушты по ул. Багликова.',	'Продаются апартаменты 1 комнатные в центре Алушты по ул. Багликова.',	'Продаются апартаменты 1 комнатные в центре Алушты по ул. Багликова.',	'Продам ,продажа, куплю, Алушта, возле моря, элитная, новая, в центре, апартаменты'),
(960,	1,	'Продаются апартаменты однокомнатные по ул. Багликова в Алуште. ',	'&amp;lt;p&amp;gt;\r\n	Продаются апартаменты однокомнатные по ул. Багликова в Алуште. Апартаменты общей площадью в 32,4 кв. м. с ремонтом и мебелью, расположены на 6 из 9 этажей здания Апарт-отеля «Фиеста» в центре города, в 500 метрах от моря. В доме предусмотрено автономное отопление, два лифта, просторные помещения общего пользования с хорошим видом на город и Крымские горы, сушильная комната с выходом на балкон с видом в сторону моря. В шаговой доступности, столовые, кафе, супермаркет, остановка общественного транспорта.&amp;lt;/p&amp;gt;\r\n',	'Продаются апартаменты однокомнатные по ул. Багликова в Алуште. ',	'Продаются апартаменты однокомнатные по ул. Багликова в Алуште. ',	'Продаются апартаменты однокомнатные по ул. Багликова в Алуште. ',	'Продаются апартаменты однокомнатные по ул. Багликова в Алуште. ',	'Продам, продажа, продается, апартаменты, в центре, купить, недалеко от моря'),
(961,	1,	'Продается квартира 1-комнатная в г. Алушта, район автовокзала.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 1-комнатная в г. Алушта, район автовокзала. Квартира общей площадью в 35 кв. м., расположена 3 этаже 5-ти этажного дома по улице Виноградной в тихом районе. В квартире подключен газ, установлена газовая колонка, отопление центральное. В доме отремонтирован подъезд, на входе установлен кодовый замок. Инфраструктура района развитая, рядом школа, детский сад, рынок, магазины, неподалёку почта и банковское отделения.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 1-комнатная в г. Алушта, район автовокзала.',	'Продается квартира 1-комнатная в г. Алушта, район автовокзала.',	'Продается квартира 1-комнатная в г. Алушта, район автовокзала.',	'Продается квартира 1-комнатная в г. Алушта, район автовокзала.',	'Продам ,продажа, куплю, квартира, Алушта, центр, автовокзал, спальном районе, тихом районе'),
(962,	1,	'Продается квартира 3- х комнатная на ул. Юбилейной в гор. Алушта.',	'&amp;lt;p&amp;gt;\r\n	Продается квартира 3- х комнатная на ул. Юбилейной в гор. Алушта. Просторная квартира общей площадью в 81,1 кв. м. с прекрасным видом на горы, расположена на 8 этаже в 13-ти этажном доме в тихом районе города, и включает в себя просторную общую комнату в 16 кв. м. с выходом на застеклённый балкон и две спальные по 14,5 и 15,6 кв. м., совмещенный сан. узел, кухню, совмещенную с лоджией и отдельную лоджию в 14 кв. м. В светлой квартире сделан хороший ремонт, автономное электрическое отопление, тёплый пол в ванной комнате, кондиционеры. В доме предусмотрено два лифта, на входе в подъезд домофон, закрытый коридор на 5 квартир на каждом этаже. Просторная придомовая территория позволяет парковать авто.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 3- х комнатная на ул. Юбилейной в гор. Алушта.',	'Продается квартира 3- х комнатная на ул. Юбилейной в гор. Алушта.',	'Продается квартира 3- х комнатная на ул. Юбилейной в гор. Алушта.',	'Продается квартира 3- х комнатная на ул. Юбилейной в гор. Алушта.',	'продажа, квартира, Алушта, купить, ЮБК, тихом районе, новом районе'),
(963,	1,	'Продается участок 6 соток г. Алушта в поселке Утес',	'&amp;lt;p&amp;gt;\r\n	Продается участок 6 соток г. Алушта в поселке Утес.&amp;amp;nbsp; Участок видовой на море и Медведь гору, «Аю-Даг», асфальтированный подъезд, есть два варианта подъезда на участок, все коммуникации рядом с участком. Рядом гостиницы, санатории, к морю всего 100 метров через парковою зону, чистые пляжи, набережная. Отличное место для загородного дома у моря! Назначение земли для «индивидуального жилого строения; малоэтажная жилая застройка; размещение дачных домов и садовых». Уникальный участок по своему месту расположению.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 6 соток г. Алушта в поселке Утес',	'Продается участок 6 соток г. Алушта в поселке Утес',	'Продается участок 6 соток г. Алушта в поселке Утес',	'Продается участок 6 соток г. Алушта в поселке Утес',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Утес'),
(964,	1,	'Продам квартиру 3-х комнатную в Алуште по ул. Октябрьской.',	'&amp;lt;p&amp;gt;\r\n	Квартира с отдельным входом, площадь которой 87,3 м2 расположена на первом из 5 этажей, и включает в себя кухню, совмещенную с гостиной в 40 м2, спальню 25 м2 с выходом во двор, и небольшую комнату в 6 м2, также предусмотрено два совмещённых сан. узла. В квартире подключен газ и установлен газовый двух контурный котёл. Инфраструктура района развитая, рядом магазины, рынок, детский сад и школа.&amp;lt;/p&amp;gt;\r\n',	'Продам квартиру 3-х комнатную в Алуште по ул. Октябрьской.',	'Продам квартиру 3-х комнатную в Алуште по ул. Октябрьской.',	'Продам квартиру 3-х комнатную в Алуште по ул. Октябрьской.',	'Продам квартиру 3-х комнатную в Алуште по ул. Октябрьской.',	'Продам ,продажа, куплю, Алушта,в спальном районе, в тихом районе, с двором'),
(965,	1,	'Продается участок 6 соток г. Алушта, поселок Кипарисное',	'&amp;lt;p&amp;gt;\r\n	Продается участок 6 соток г. Алушта, поселок Кипарисное. Участок имеет правильную форму, абсолютно ровный, на участок заведено 15 кВт света и водопровод. Участок огорожен бетонным забором, хорошие подъездные пути. Участок расположен рядом с трассой «Ялта-Симферополь-Севастополь-Алушта». Вид на горы и море.&amp;lt;/p&amp;gt;\r\n',	'Продается участок 6 соток г. Алушта, поселок Кипарисное',	'Продается участок 6 соток г. Алушта, поселок Кипарисное',	'Продается участок 6 соток г. Алушта, поселок Кипарисное',	'Продается участок 6 соток г. Алушта, поселок Кипарисное',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Кипарисное'),
(966,	1,	'Продается земельный участок 15 соток г. Алушта, поселок Лазурное',	'&amp;lt;p&amp;gt;\r\n	Продается земельный участок 15 соток г. Алушта, поселок Лазурное. Участок имеет форму земельного участка в виде буквы «Г». Участок граничит с асфальтированной дорогой, по границе участка проходит газопровод, вода, свет. С участка открывается хороший вид на море, горы и виноградники. Ходит общественный транспорт, есть магазин. До моря всего 400 метров пешком.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 15 соток г. Алушта, поселок Лазурное',	'Продается земельный участок 15 соток г. Алушта, поселок Лазурное',	'Продается земельный участок 15 соток г. Алушта, поселок Лазурное',	'Продается земельный участок 15 соток г. Алушта, поселок Лазурное',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Лазурное'),
(968,	1,	'Продается квартира 1 комнатная по улице Судакская 6 в Алуште.',	'&amp;lt;p&amp;gt;\r\n	Продается&amp;amp;nbsp; однокомнатная квартира по улице Судакская 6 в Алуште. Общая площадь квартиры 39,1 кв. м. с учётом просторной лоджии, расположена на 3 этаже 5- ти этажного многоквартирного дома в районе Винзавода «Массандра» в тихом зелёном районе среди сосен и кипарисов. Включает в себя: жилую комнату 17,3 кв. м., кухню 6 кв. м., сан. узел совмещенный в 3 кв. м. В квартире сделан косметический ремонт, установлен кондиционер, подключен газ, установлена газовая колонка. Дом находится неподалёку от школы, рядом детский сад, супермаркет и магазины, остановки городского транспорта.&amp;lt;/p&amp;gt;\r\n',	'Продается квартира 1 комнатная по улице Судакская 6 в Алуште.',	'Продается квартира 1 комнатная по улице Судакская 6 в Алуште.',	'Продается квартира 1 комнатная по улице Судакская 6 в Алуште.',	'Продается квартира 1 комнатная по улице Судакская 6 в Алуште.',	'продается квартира, квартира в алуште, куплю квартиру, недвижимость в алуште, куплю квартиру в алуште, жилье в крыму, в спальном районе, квартра на судакской'),
(969,	1,	'Продается 2-х комнатная квартира в г. Алушта.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается 2-х комнатная квартира в г. Алушта.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира расположена по улице Октябрьская, 4- этаж 9- этажного дома, общая площадь 62 кв. м., 2 спальные комнаты, 2 балкона,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	санузел раздельный. Коммуникации все центральные.&amp;amp;nbsp; Мебель и техника вся остается, состояние под отделку.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Закрытая придомовая территория, домофон, лифт. Район хороший, рядом всё, что необходимо для комфортного проживания,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	развитая инфраструктура: магазины, кафе, салоны красоты, фитнес центр, остановка, аптека.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Из окон открывается потрясающий вид на горы и море. Все документы РФ к сделке готовы.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается 2-х комнатная квартира в г. Алушта.',	'Продается 2-х комнатная квартира в г. Алушта.',	'Продается 2-х комнатная квартира в г. Алушта.',	'Продается 2-х комнатная квартира в г. Алушта.',	'продажа квартир, куплю квартиру в алуште, квартира в алуште, квартира на октябрьской, двухкомнатная квартира, 2х комнатная квартира в алуште, '),
(970,	1,	'Продается участок 15 соток в г. Алушта, с возможностью увеличения территории.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 15 соток в г. Алушта, с возможностью увеличения территории.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок расположен вблизи трассы Симферополь - Алушта, с хорошими подъездными путями, асфальтированный подъезд.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Есть возможность использовать под бизнес.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок правильной формы, абсолютно ровный, по границам участка проходят все коммуникации (газ, электричество, вода).&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Отлично подойдет для автомойки, торгового центра, магазина, сто, гостинницы и много другое.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Полный пакет документов РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается участок 15 соток в г. Алушта, с возможностью увеличения территории.',	'Продается участок 15 соток в г. Алушта, с возможностью увеличения территории.',	'Продается участок 15 соток в г. Алушта, с возможностью увеличения территории.',	'Продается участок 15 соток в г. Алушта, с возможностью увеличения территории.',	'продается участок, коммерческий участок, коммерческая земля, земля под коммерцию, участки в крыму, участки в алуште, куплю землю, куплю участок, продам участок, куплю автомойку, продам автомойку'),
(971,	1,	'Продается участок 10 соток в п. Семидворье.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 10 соток в п. Семидворье.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок имеет правильную прямоугольную форму, умеренный рельеф, грунтовый подьезд.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Все коммуникации в доступности, свет на участке, есть разрешение на строительство, получен ГПЗУ.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Растояние до моря 800 метров, вокруг участка хвойные и дубовые растения.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Соседей нет, есть возможность увеличить размеры земельного участка, панорамный не прикрываемый вид на море и горы.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Полный пакет документов РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается участок 10 соток в п. Семидворье.',	'Продается участок 10 соток в п. Семидворье.',	'Продается участок 10 соток в п. Семидворье.',	'Продается участок 10 соток в п. Семидворье.',	'куплю участок, куплю землю в семидворье, участок в алуште, земля в алуште, дом в алуште, продам участок в алуште, продам участок в семидворье'),
(972,	1,	'Продается участок 20 соток в г. Алушта, п. Семидворье.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 20 соток в г. Алушта, п. Семидворье.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок имеет правильную форму, умеренный рельеф, грунтовый подьезд.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Все коммуникации в доступности.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Растояние до моря 800 метров, вокруг участка хвойные и дубовые растения.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	У участка соседей нет, панорамный вид на море и горы.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Полный пакет документов РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается участок 20 соток в г. Алушта, п. Семидворье.',	'Продается участок 20 соток в г. Алушта, п. Семидворье.',	'Продается участок 20 соток в г. Алушта, п. Семидворье.',	'Продается участок 20 соток в г. Алушта, п. Семидворье.',	'участок в семидворье, продам участок в крыму, продам участок в алуште, куплю землю в алуште, куплю участок в семидворье, продам участок в семидворье'),
(973,	1,	'Продается видовой участок 8 соток в пгт. Партенит.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается видовой участок 8 соток в пгт. Партенит.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Рельеф участка, половина ровная и незначительный уклон.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Коммуникации в доступности, не далеко вся инфраструктура поселка: магазины, аптеки,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	общественный транспорт. К земельному участку ведёт хорошо накатанная грунтовая дорога 200 метров,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	за ней уже асфальтированная дорога, которая ведет в центр поселка.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок находится в жилом зеленом массиве, с видом на гору Медведь и виноградники.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Поселок, с развитой инфраструктурой, новый детский сад, школа общего образования, несколько магазинов,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	остановки общественного транспорта. Поселок расположен у подножия горы Медведь на берегу Черного моря.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается видовой участок 8 соток в пгт. Партенит.',	'Продается видовой участок 8 соток в пгт. Партенит.',	'Продается видовой участок 8 соток в пгт. Партенит.',	'Продается видовой участок 8 соток в пгт. Партенит.',	'участок в партените, участок у моря, продам землю, куплю землю, участок в крыму куплю землю в крыму, продам землю в крыму'),
(974,	1,	'Продается видовой участок 4 сотки в пгт. Партенит .',	'&amp;lt;div&amp;gt;\r\n	Продается видовой участок 4 сотки в пгт. Партенит .&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Рельеф участка ровный.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Коммуникации в доступности, не далеко вся инфраструктура поселка.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	К земельному участку ведёт хорошо накатанная грунтовая дорога,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	за ней уже асфальтированная, которая ведет в центр поселка.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок находится в жилом зеленом массиве, с видом на виноградники и горы.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Поселок расположен у подножия горы Медведь на берегу Черного моря.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается видовой участок 4 сотки в пгт. Партенит .',	'Продается видовой участок 4 сотки в пгт. Партенит .',	'Продается видовой участок 4 сотки в пгт. Партенит .',	'Продается видовой участок 4 сотки в пгт. Партенит .',	'участок в партените, продам участок в крыму, продам землю в партените, участок в крыму, куплю землю в крыму под постройку, участок в алуште'),
(975,	1,	'Продается участок 11 соток в п. Пушкино.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 11 соток в п. Пушкино&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Рельеф участка ровный, форма правильная.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Подъезд к участку с трассы Алушта - Ялта, асфальтированная дорога.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Коммуникации (свет, вода, газ) в доступности.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	На участке расположен сад и огород, а также посажены плодовые деревья (слива, инжир, вишня).&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Не далеко от участка вся инфраструктура: общественный транспорт, магазин, кафе.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Через дорогу магазин: Вино и сыр, Хлеб и соль.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Вид с участка на гору Медведь и черное море.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается участок 11 соток в п. Пушкино.',	'Продается участок 11 соток в п. Пушкино.',	'Продается участок 11 соток в п. Пушкино.',	'Продается участок 11 соток в п. Пушкино.',	'участок в пушкино, земля в пушкино, участок рядом с вино и сыр, участок у дороги,продам участок в алуште, срочно , участок в крыму, куплю землю '),
(976,	1,	'Продается участок 10 соток в п. Семидворье, мкр. Дельфин.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 10 соток в п. Семидворье, мкр. Дельфин.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок имеет ровный рельеф, правильную форму.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Подъезд к участку бетонный, 50 метров грунт.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Все коммуникации расположены в 100 метрах от участка (свет, вода, газ).&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Не перекрываемый вид на море, есть возможность увеличить размеры участка.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается участок 10 соток в п. Семидворье, мкр. Дельфин.',	'Продается участок 10 соток в п. Семидворье, мкр. Дельфин.',	'Продается участок 10 соток в п. Семидворье, мкр. Дельфин.',	'Продается участок 10 соток в п. Семидворье, мкр. Дельфин.',	'участок в семидворье, участок в мкр дельфин, участок у дельфина, участок у моря, продам землю, куплю землю, участок в крыму куплю землю в крыму, продам землю в крыму'),
(977,	1,	'Продается 3 комн. квартира в пос. Партенит.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается 3 комн. квартира в пос. Партенит.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Общая площадь продаваемой квартиры 68 квадратных метров, первый этаж со своим двориком.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира уютная, зайти в квартиру возможно как через подъезд, так и через свой дворик.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Установлен газовый котел. Территория двора ухожена.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается 3 комн. квартира в пос. Партенит.',	'Продается 3 комн. квартира в пос. Партенит.',	'Продается 3 комн. квартира в пос. Партенит.',	'Продается 3 комн. квартира в пос. Партенит.',	'Продается, купить, куплю, продажа, квартиру, квартира, Партенит, город Алушта,'),
(967,	1,	'Продаётся дом в городе Алушта, район Оливковая роща. ',	'&amp;lt;p&amp;gt;\r\n	Продаётся дом в городе Алушта, район Оливковая роща. Дом расположен на земельном участке в 600 кв.м., &amp;amp;nbsp;в 3-х км от берега черного моря в г. Алушта. Общей площадью в 150 м. кв., выстроенных 2 этажа и мансардный этаж. 1-й этаж: просторная гостиная для отдыха, санузел, кухня, спальная комната. 2-й этаж: комната студия с выходом на террасу, 2 спальные комнаты. Свет, вода централизованы. Комнаты меблированы и установлена техника. Рядом с домом магазин, аптека и все необходимое для жизни. Пакет документов РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продаётся дом в городе Алушта, район Оливковая роща. ',	'Продаётся дом в городе Алушта, район Оливковая роща. ',	'Продаётся дом в городе Алушта, район Оливковая роща. ',	'Продаётся дом в городе Алушта, район Оливковая роща. ',	'недвижимость в крыму, продам дом, куплю дом, дом в алуште, купть дом, купить коттедж, недвижимость в алуште, дом в оливковой роще'),
(978,	1,	'Продается видовой участок 25 соток ИЖС г. Алушта, поселок Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается видовой участок 25 соток ИЖС г. Алушта, поселок Лучистое. Участок с умеренным уклоном в сторону моря, 50% участка абсолютно чистый и свободный от насаждений. Живописный панорамный вид на море, город и горы. Рядом проходит газ и свет. Соседний смежный участок застраивается. В поселке есть все необходимое для постоянного проживания: школа, детский садик, магазины, ходит общественный транспорт в город. Все документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается видовой участок 25 соток ИЖС г. Алушта, поселок Лучистое',	'Продается видовой участок 25 соток ИЖС г. Алушта, поселок Лучистое',	'Продается видовой участок 25 соток ИЖС г. Алушта, поселок Лучистое',	'Продается видовой участок 25 соток ИЖС г. Алушта, поселок Лучистое',	'Продается, продажа, продам, купить, куплю, участок, город Алушта, поселок Лучистое'),
(979,	1,	'Продается три смежных земельных участка по 15 соток каждый назначение земли (ИЖС), г. Алушта, в поселке Лучистое',	'&amp;lt;p&amp;gt;\r\n	Продается три смежных земельных участка по 15 соток каждый назначение земли (ИЖС), г. Алушта, в поселке Лучистое. Рельеф данных земельных участков умеренный, с прекрасным живописным видом на горы, море и город. Все коммуникации включая свет, вода и газ проходят в ста метрах. Рядом жилые дома, активно застраиваемое место, хорошие подъездные пути. Возможно приобрести как вместе так и по отдельности. &amp;amp;nbsp;Документы РФ готовы к сделке.&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается три смежных земельных участка по 15 соток каждый назначение земли (ИЖС), г. Алушта, в поселке Лучистое',	'Продается три смежных земельных участка по 15 соток каждый назначение земли (ИЖС), г. Алушта, в поселке Лучистое',	'Продается три смежных земельных участка по 15 соток каждый назначение земли (ИЖС), г. Алушта, в поселке Лучистое',	'Продается три смежных земельных участка по 15 соток каждый назначение земли (ИЖС), г. Алушта, в поселке Лучистое',	'Продается, продажа, продам, купить, участок, город Алушта, поселок Лучистое'),
(980,	1,	'Продается видовой участок в п. Лучистое 28 соток.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается видовой участок в п. Лучистое 28 соток.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок имеет правильную форму, в 150 метрах от границы участка проходят линии электропередач,&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	газовая труба, вода. Земельного участок находится у подножия горы Демерджи,&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	С участка открывается потрясающий панорамный вид на море, горы и город.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Хорошо застраиваемое место, рядом уже построены дома.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	К данному земельному участку ведёт хорошо накатанная грунтовая дорога,&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	за ней уже асфальтированная дорога, которая ведет в центр поселка и в город.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Чистый горный воздух и кристально чистая горная вода.&amp;lt;/div&amp;gt;\r\n',	'Продается видовой участок в п. Лучистое 28 соток.',	'Продается видовой участок в п. Лучистое 28 соток.',	'Продается видовой участок в п. Лучистое 28 соток.',	'Продается видовой участок в п. Лучистое 28 соток.',	'продам участок в лучистом, участок в лучистом, куплю землю в алуште, земля в крыму, участок в крыму'),
(981,	1,	'Продаётся участок 11 соток г. Алушта, Профессорский уголок. ',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продаётся участок 11 соток г. Алушта, Профессорский уголок.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок ровный с видом на море и горы. Коммуникации по границе участка.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	К участку ведет асфальтированная дорога + 100 метров хорошая грунтовая дорога.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Место тихое, спрятанное от ветров,есть соседи.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Место хорошо застраиваемое. 70% участка без насаждений.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Земельный участок по назначению ИЖС.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продаётся участок 11 соток г. Алушта, Профессорский уголок. ',	'Продаётся участок 11 соток г. Алушта, Профессорский уголок. ',	'Продаётся участок 11 соток г. Алушта, Профессорский уголок. ',	'Продаётся участок 11 соток г. Алушта, Профессорский уголок. ',	'участок в профессорском уголке, продам участок, куплю участок, земля в крыму, купить землю в крыму, куплю участок в крыму'),
(982,	1,	'Продается видовой участок 12 соток г. Алушта, поселок Лавровое',	'&amp;lt;p&amp;gt;\r\n	Продается видовой участок 12 соток г. Алушта, поселок Лавровое. Участок с шикарным видом на Море, виноградники и гору Аю-Даг (Медведь гора), по границе участка проходят все коммуникации: свет, вода, газ. Хорошие подъездные пути, умеренный рельеф, лесной массив (реликтовых деревьев нет), рядом хорошие соседи постоянно проживающие, активно застраиваемо место. Отличное и тихое место для строительства загородного дома, коттеджа, виллы, вид 100% не перекрываемый. Документы РФ готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продается видовой участок 12 соток г. Алушта, поселок Лавровое',	'Продается видовой участок 12 соток г. Алушта, поселок Лавровое',	'Продается видовой участок 12 соток г. Алушта, поселок Лавровое',	'Продается видовой участок 12 соток г. Алушта, поселок Лавровое',	'Продается, продажа, продам, купить, куплю, участок, город Алушта, поселок Лавровое'),
(983,	1,	'Продаётся участок 15 соток г. Алушта, Профессорский уголок. ',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продаётся участок 15 соток г. Алушта, Профессорский уголок.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок обсолютно ровный с видом на море и горы. Коммуникации все на участке.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	К участку ведет асфальтированная дорога.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Место тихое,есть соседи постоянно проживающие.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Место хорошо застраиваемое. 90% участка без насаждений.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Рядом с участком речка, ресторан &amp;quot;Библиотека&amp;quot;, курортный комплекс &amp;quot;Дачи&amp;quot; .&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Земельный участок по назначению ИЖС.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продаётся участок 15 соток г. Алушта, Профессорский уголок. ',	'Продаётся участок 15 соток г. Алушта, Профессорский уголок. ',	'Продаётся участок 15 соток г. Алушта, Профессорский уголок. ',	'Продаётся участок 15 соток г. Алушта, Профессорский уголок. ',	'участок в алуште, земля в крыму, продается участок, куплю землю, '),
(984,	1,	'Продается участок 7 соток в г. Алушта, с.Лазурное. ',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 7 соток в г. Алушта, с.Лазурное.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок с видом на море и горы, коммуникации в доступности, свет 70 метров от участка,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	участок находиться у асфальтированной дороги. Ландшафт участка умеренный.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Целевое назначение земли (ИЖС). Все документы РФ к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается участок 7 соток в г. Алушта, с.Лазурное. ',	'Продается участок 7 соток в г. Алушта, с.Лазурное. ',	'Продается участок 7 соток в г. Алушта, с.Лазурное. ',	'Продается участок 7 соток в г. Алушта, с.Лазурное. ',	'продается участок в лазурном, участок в крыму, земля в крыму, куплю участок, продам землю'),
(985,	1,	'Продается участок 1 сотка в центре г. Алушта.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 1 сотка в центре г. Алушта.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Назачение земли - предпринимательство.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок расположен вблизи трассы Симферополь - Алушта, рядом с жилыми домами, рынком и магазинами.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок с хорошими подъездными путями, асфальтированный подъезд.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок правильной формы, абсолютно ровный, по границам участка проходят все коммуникации (газ, электричество, вода).&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Отлично подойдет для магазина, салона, сто и много другое.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Полный пакет документов РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n',	'Продается участок 1 сотка в центре г. Алушта.',	'Продается участок 1 сотка в центре г. Алушта.',	'Продается участок 1 сотка в центре г. Алушта.',	'Продается участок 1 сотка в центре г. Алушта.',	'участок в центре алушты, участок под бизнес, куплю землю, продам участок'),
(986,	1,	'Продам 1 ком. квартиру в г. Алушта, ул. Чатырдагская.',	'&amp;lt;div&amp;gt;\r\n	Продам 1 ком. квартиру в г. Алушта, ул. Чатырдагская.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Общая площадь апартаментов 65,6 кв.м., этаж 2, всего в доме 10 этажей.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Шикарная, просторная квартира с ремонтом, с прекрасным видом на горы, море и город.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Есть возможность переделать в 2 комнатную квартиру.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Развитая инфраструктура, 7 минут до пляжа.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Документы РФ к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продам 1 ком. квартиру в г. Алушта, ул. Чатырдагская.',	'Продам 1 ком. квартиру в г. Алушта, ул. Чатырдагская.',	'Продам 1 ком. квартиру в г. Алушта, ул. Чатырдагская.',	'Продам 1 ком. квартиру в г. Алушта, ул. Чатырдагская.',	'куплю квартиру, продам апартаменты, куплю апартаменты, жилье в крыму, апартаменты в алуште, '),
(987,	1,	'Продается 2-комнатная квартира в пгт. Партенит, ул. Партенитская.',	'&amp;lt;div&amp;gt;\r\n	Продается 2-комнатная квартира в пгт. Партенит, ул. Партенитская дом 12.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира с общей площадью 51,8 кв. м., расположена на 5 этаже в 5 этажном доме.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира с ремонтом и мебелью, просторная кухня, из окон открывается отличный вид на посёлок Партенит и горы.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Инфраструктура посёлка развитая,школа, детский сад, магазины, кафе, пансионаты.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Все документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается 2-комнатная квартира в пгт. Партенит, ул. Партенитская.',	'Продается 2-комнатная квартира в пгт. Партенит, ул. Партенитская.',	'Продается 2-комнатная квартира в пгт. Партенит, ул. Партенитская.',	'Продается 2-комнатная квартира в пгт. Партенит, ул. Партенитская.',	'продам квартира, куплю квартиру, квартира в крыму, квартира в алуште, квартира в партените'),
(988,	1,	'Продам земельный участок 6 соток в г. Алушта, п. Лучистое.',	'&amp;lt;div&amp;gt;\r\n	Продам земельный участок 6 соток в г. Алушта, п. Лучистое.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Назначение земли ИЖС, участок у подножия горы &amp;quot;Демерджи&amp;quot;, в центр села, рядом детский сад , магазин, остановка общественного транспорта,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	чистый воздух, потрясающий вид, все коммуникации на участке,чистейшая родниковая вода,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	хорошая подъездная асфальтированная дорога.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Шикарный панорамный вид на горы и море.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Все документы РФ готовы к сделке.&amp;lt;/div&amp;gt;\r\n',	'Продам земельный участок 6 соток в г. Алушта, п. Лучистое.',	'Продам земельный участок 6 соток в г. Алушта, п. Лучистое.',	'Продам земельный участок 6 соток в г. Алушта, п. Лучистое.',	'Продам земельный участок 6 соток в г. Алушта, п. Лучистое.',	'купить землю, купить участок, продам участок, продам, участок в лучистом, ижс участок, '),
(989,	1,	'СРОЧНО!!! Продаётся дом на участке в 10 соток,  г. Алушта поселок Лучистое. ',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	СРОЧНО!!! Продаётся дом на участке в 10 соток,&amp;amp;nbsp; г. Алушта поселок Лучистое.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Дом общей площадью в 200 кв.м., стоит на участке в 10 соток, назначение земли (ИЖС),&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	строение представляет собой 2-х этажный дом, хороший монолитный каркас с заполнением ракушечника,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	экологически чистого природного камня,высокие потолки. Из окон и участка открывается панорамный вид на горы и море,&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	хорошая подъездная дорога к дому. Дом расположился у подножья горы «Демерджи» где кристально чистейший и полезный воздух.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	по граниеце участка вода, газ и электроэнергия.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Поселок газифицирован, есть школа, построили новый современный детский садик, магазин, ходит общественный транспорт в город.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	До города Алушта 8 км., личным транспортом 7 минут езды. Цена занижена изначально!!! Документы РФ к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'СРОЧНО!!! Продаётся дом на участке в 10 соток,  г. Алушта поселок Лучистое. ',	'СРОЧНО!!! Продаётся дом на участке в 10 соток,  г. Алушта поселок Лучистое. ',	'СРОЧНО!!! Продаётся дом на участке в 10 соток,  г. Алушта поселок Лучистое. ',	'СРОЧНО!!! Продаётся дом на участке в 10 соток,  г. Алушта поселок Лучистое. ',	'срочно куплю дом, продам дом, продам участок, дом в лучистом, куплю дом, дом в крыму'),
(990,	1,	'Продается 2-х комнатная квартира г. Алушта, по ул. 60 лет СССР',	'&amp;lt;p&amp;gt;\r\n	Продается 2-х комнатная квартира г. Алушта, по ул. 60 лет СССР. Квартира расположена на 9/9ти этажного дома, площадью 60 кв.м., из которых: две комнаты раздельные зал 18 кв.м., спальня 12 кв.м. с выходом на лоджию в 4 кв.м., кухня 10 кв.м. с выходом на лоджию в 8 кв.м., совмещенный сан. Узел 7 кв.м., прихожая 7 кв.м. Продается полностью с мебелью, стоят стеклопакеты, интернет, заезжайте и живите. Рядом остановка городского транспорта, магазин, детская площадка. Из окон квартиры открывается замечательный вид на горы, море и город. К морю и центральной набережной пешком 15 минут ходьбы, или на общественном транспорте 5 минут. Тихий спальный район. Цена актуальна в течении месяца! Прописанных нет. Документы РФ к сделке готовы.&amp;lt;/p&amp;gt;\r\n',	'Продается 2-х комнатная квартира г. Алушта, по ул. 60 лет СССР',	'Продается 2-х комнатная квартира г. Алушта, по ул. 60 лет СССР',	'Продается 2-х комнатная квартира г. Алушта, по ул. 60 лет СССР',	'Продается 2-х комнатная квартира г. Алушта, по ул. 60 лет СССР',	'Продается, продам, купить, куплю, продажа, квартира, двухкомнатная, город Алушта, улица 60 лет СССР'),
(991,	1,	'Продается 2-х комнатная квартира в г. Алушта, по ул. 60 лет СССР.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается 2-х комнатная квартира в г. Алушта, по ул. 60 лет СССР.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Просторная двухкомнатная квартира площадью 82 кв. метра, переделанная в 3-х комнатную, сделан евроремонт, новая мебель,&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	большая кухня 13 кв. метров, гостиная, 2 спальные комнаты, совмещенный санузел,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	застекленная лоджия с шикарным видом на море и горы.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Дом новый, уженный, чистые подъезды,большая придомавая территория, парковка.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Квартира на 9 эаже/14 этажного дома.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Документы РФ, готовы к сделке.&amp;lt;/div&amp;gt;\r\n',	'Продается 2-х комнатная квартира в г. Алушта, по ул. 60 лет СССР.',	'Продается 2-х комнатная квартира в г. Алушта, по ул. 60 лет СССР.',	'Продается 2-х комнатная квартира в г. Алушта, по ул. 60 лет СССР.',	'Продается 2-х комнатная квартира в г. Алушта, по ул. 60 лет СССР.',	'продам квартиру, куплю квартира, квартира в алуште, квартира в крыму, квартира на 60 лет ссср, купить квартиру'),
(992,	1,	'Продается трехкомнатная квартира в новом монолитном доме в г. Алушта по ул. Пуцатова, 18а',	'&amp;lt;p&amp;gt;\r\n	Продается трехкомнатная квартира в новом монолитном доме в г. Алушта по ул. Пуцатова 18а. Квартира расположена на 5 этаже 10 этажного дома. Общая площадь 113.7 кв.м., включает в себя три комнаты, 24 кв.м, 20.5 кв.м.,15.1 кв.м., кухня 14.1 кв.м., балкон 2.2 кв.м., лоджия 5.3 кв.м., гардеробная 1.3 кв.м.&amp;lt;strong&amp;gt;&amp;amp;nbsp;&amp;lt;/strong&amp;gt;Автономное отопление, закрытый коридор. Квартира просторная, светлая, видовая. Прекрасный вид из комнат и кухни на горы, город и море. В квартире выполнен качественный ремонт, продается с мебелью и техникой. Возле дома есть место для парковки авто. Отличный район, в пешей доступности: круглосуточный магазин, рынок, больница, садик, школа, до центра города — 5 минут, до моря — 15 минут прогулочным шагом. Документы РФ, готовы к сделке. Показ в любое время.&amp;lt;/p&amp;gt;\r\n',	'Продается трехкомнатная квартира в новом монолитном доме в г. Алушта по ул. Пуцатова, 18а',	'Продается трехкомнатная квартира в новом монолитном доме в г. Алушта по ул. Пуцатова, 18а',	'Продается трехкомнатная квартира в новом монолитном доме в г. Алушта по ул. Пуцатова, 18а',	'Продается трехкомнатная квартира в новом монолитном доме в г. Алушта по ул. Пуцатова, 18а',	'Продам, продается, продажа, купить, куплю, квартиру, трехкомнатную, город Алушта, улица Пуцатова 18а'),
(993,	1,	'Продается участок 6,5 соток в г. Алушта по ул. Сергеева - Ценского в районе подстанции.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается участок 6,5 соток в г. Алушта по ул. Сергеева - Ценского в районе подстанции.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Участок ровный, рядом жилые дома, активно застраиваемый район, все коммуникации в доступности.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Рядом вся инфроструктура города: магазины, остановка, набережная, аптека, до автовокзала 300 м.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	К участку ведет асфальтированная дорога, 2 подъезда к участку, не перекрываемый вид на черное море и гору Демерджи.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Все документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается участок 6,5 соток в г. Алушта по ул. Сергеева - Ценского в районе подстанции.',	'Продается участок 6,5 соток в г. Алушта по ул. Сергеева - Ценского в районе подстанции.',	'Продается участок 6,5 соток в г. Алушта по ул. Сергеева - Ценского в районе подстанции.',	'Продается участок 6,5 соток в г. Алушта по ул. Сергеева - Ценского в районе подстанции.',	'продам участок в алуште, куплю землю, куплю участок, продам землю, участок в алуште, участок в крыму'),
(994,	1,	'Продается земельный участок 15 соток г. Алушта, п. Изобильное',	'&amp;lt;p&amp;gt;\r\n	Продается земельный участок 15 соток г. Алушта, п. Изобильное. На земельном участке выполнены большие земельные работы, получены все разрешительные документы для строительства (ГПЗУ), получены все технические условия под коммуникации, участок полностью готов под строительство загородного дома, стоит бытовка на участке. Хорошие подъездные пути (асфальт + грунт 30 метров), с участка открывается замечательный живописный вид на горы, море и город. До города и моря всего 4 км., или 5 минут на транспорте, в 100 метрах находиться остановка общественного транспорта. Документы РФ готовы к сделке.&amp;lt;/p&amp;gt;\r\n',	'Продается земельный участок 15 соток г. Алушта, п. Изобильное',	'Продается земельный участок 15 соток г. Алушта, п. Изобильное',	'Продается земельный участок 15 соток г. Алушта, п. Изобильное',	'Продается земельный участок 15 соток г. Алушта, п. Изобильное',	'Продается, продам, продажа, купить, куплю, участок, город Алушта, поселок Изобильное'),
(995,	1,	'Продается дом 136,5 кв. м. на на 8, 5 сотках земли, в г. Алушта, п. Кипарисное.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		Продается дом 136,5 кв. м. на на 8, 5 сотках земли, в г. Алушта, п. Кипарисное.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		Дом имеет 2 этажа + мансарда, фасад дома выполнен в современном дизайнерском стиле, с понорамными окнами.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		К дому ведет асфальтированная дорога, не далеко трасса Сиферополь - Ялта.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		На первом этаже: прихожая, большая гостиная с камином, санузел, гараж.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		Второй этаж: 3 спальные комнаты, санузел, терасса с видом на море.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		Третий этаж: спальная комната, санузел, кладовая комната.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		Заведены все коммуникации: свет, вода, газ, канализация, установлен двухконтурный газовый кател, сделана разводка теплых полов.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		Рядом жилые дома, соседи проживают постоянно.&amp;lt;/div&amp;gt;\r\n	&amp;lt;div&amp;gt;\r\n		Все документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n&amp;lt;/div&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/p&amp;gt;\r\n',	'Продается дом 136,5 кв. м. на на 8, 5 сотках земли, в г. Алушта, п. Кипарисное.',	'Продается дом 136,5 кв. м. на на 8, 5 сотках земли, в г. Алушта, п. Кипарисное.',	'Продается дом 136,5 кв. м. на на 8, 5 сотках земли, в г. Алушта, п. Кипарисное.',	'Продается дом 136,5 кв. м. на на 8, 5 сотках земли, в г. Алушта, п. Кипарисное.',	'куплю дом, дом в алуште, продам дом в кипарисном, продам дом, продается, дом в крыму'),
(754,	1,	'Продается участок 18,65 соток в Изобильном',	'&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;color:#000000;&amp;quot;&amp;gt;&amp;lt;span style=&amp;quot;font-size:14px;&amp;quot;&amp;gt;Продается участок 18,65 соток в Изобильном. Весь участок абсолютно ровный, коммуникации все по границе участка. Подъездные пути хорошие, соседи уже построены, с участка открывается прекрасный вид на моря и горы.&amp;lt;/span&amp;gt;&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	&amp;lt;span style=&amp;quot;font-size:14px;&amp;quot;&amp;gt;Весь пакет документов РФ к сделки готов.&amp;lt;/span&amp;gt;&amp;lt;/p&amp;gt;\r\n',	'Продается участок 18,65 соток в Изобильном',	'Продается участок 18,65 соток в Изобильном',	'Продается участок 18,65 соток в Изобильном',	'Продается участок 18,65 соток в Изобильном',	'Куплю, участок, продаётся, земля, продажа, Изобильное'),
(997,	1,	'Продается 2-х комнатная квартира в новостройке г. Алушта ул. Платановая 1.',	'&amp;lt;div&amp;gt;\r\n	&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Продается 2-х комнатная квартира в новостройке г. Алушта ул. Платановая 1.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Просторная квартира 80 кв. м. расположена на 6 этаже/ 9- и этажного дома.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	В квартире 2 просторные лоджии с шикарным видом на виноградники и горы, раздельный санузел, сделан дорогостоящий ремонт,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	общая площадь с лоджиями 93 кв. м, установлен двухконтурный газовый коотел.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Жилой дом находится в центральном районе города, закрытая территория, видеонаблюдение,&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	охрана по перриметру дома, на территории дома детская площадка.&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Возле дома школа, магазины, аптеки, отели, остановка общественного транспорта.&amp;amp;nbsp;&amp;lt;/div&amp;gt;\r\n&amp;lt;div&amp;gt;\r\n	Документы РФ, к сделке готовы.&amp;lt;/div&amp;gt;\r\n',	'Продается 2-х комнатная квартира в новостройке г. Алушта ул. Платановая 1.',	'Продается 2-х комнатная квартира в новостройке г. Алушта ул. Платановая 1.',	'Продается 2-х комнатная квартира в новостройке г. Алушта ул. Платановая 1.',	'Продается 2-х комнатная квартира в новостройке г. Алушта ул. Платановая 1.',	'продам квартиру, куплю квартиру, квартира в алуште, квартира в новостройке, квартира в крыму');

DROP TABLE IF EXISTS `product_discount`;
CREATE TABLE `product_discount` (
  `product_discount_id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL,
  `customer_group_id` int(11) NOT NULL,
  `quantity` int(4) NOT NULL DEFAULT '0',
  `priority` int(5) NOT NULL DEFAULT '1',
  `price` decimal(15,4) NOT NULL DEFAULT '0.0000',
  `date_start` date NOT NULL DEFAULT '0000-00-00',
  `date_end` date NOT NULL DEFAULT '0000-00-00',
  PRIMARY KEY (`product_discount_id`),
  KEY `product_id` (`product_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;


DROP TABLE IF EXISTS `product_image`;
CREATE TABLE `product_image` (
  `product_image_id` int(11) NOT NULL AUTO_INCREMENT,
  `product_id` int(11) NOT NULL,
  `image` varchar(255) DEFAULT NULL,
  `sort_order` int(3) NOT NULL DEFAULT '0',
  PRIMARY KEY (`product_image_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8;

