(14329,	0,	'featured',	'line_first',	'&amp;lt;aside&amp;gt;\r\n	&amp;lt;h3 class=&amp;quot;h3-title title-main&amp;quot;&amp;gt;\r\n		Смотреть &amp;lt;span&amp;gt;видео&amp;lt;/span&amp;gt;&amp;lt;/h3&amp;gt;\r\n	&amp;lt;p&amp;gt;\r\n		&amp;lt;b&amp;gt;Продаются 3 смежных участка в Алуште, Профессорский уголок.&amp;lt;/b&amp;gt;&amp;lt;iframe allowfullscreen=&amp;quot;&amp;quot; frameborder=&amp;quot;0&amp;quot; height=&amp;quot;136&amp;quot; src=&amp;quot;https://www.youtube.com/embed/Wj7vITHjYCA&amp;quot; width=&amp;quot;240&amp;quot;&amp;gt;&amp;lt;/iframe&amp;gt;Участки разбиты по 7,5 соток, под застройку жилого дома. Возможно приобрести как вместе так и отдельно, при желании есть возможность еще увеличить площадь за счет соседних участков. Коммуникации все в доступности, район успешно развивается, много зелени и прекрасный воздух. Очень видовое месте, открывается вид на моря,горы и гору «Кастель».&amp;lt;/p&amp;gt;\r\n&amp;lt;/aside&amp;gt;\r\n',	0),
(14330,	0,	'featured',	'line_second',	'&amp;lt;h1 class=&amp;quot;h4-title&amp;quot;&amp;gt;\r\n	Недвижимость &amp;lt;span&amp;gt;в Алуште:&amp;lt;/span&amp;gt;&amp;lt;/h1&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Агентство «Альянс Сити» оказывает комплекс услуг по продаже, покупке, сдаче в аренду жилых и коммерческих объектов на ЮБК. Недвижимость в Алуште была, и остается в зоне пристального внимания инвесторов, жителей Крыма и других регионов России. Жилой фонд города разнопланов и многовариантен ─ в районе Южного берега продаются земельные участки, типовые квартиры, роскошные виллы и апартаменты в прибрежной зоне.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Квалифицированные специалисты помогут выбрать квартиру, дом, офисное помещение, земельный участок, учитывая комплекс приоритетов клиента. Мы систематизировали базу данных, посетили каждый объект и составили подробное описание недвижимости. Результат наших усилий многократно оправдан – риелторы без труда находят выгодные решения для клиентов всех уровней.&amp;lt;/p&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	В каталоге агентства недвижимости, работающего в Алуште и других регионах Крыма, вы найдете жилье премиального, стандартного и бюджетного класса в интересующем районе Алушты, в новостройках, и на вторичном рынке. В список объектов включены квартиры с косметическим и дизайнерским ремонтом, уютные коттеджи с оригинальным интерьером, стильные дома в заповедных зонах, комнаты, отдельные помещения. Свяжитесь с нами для получения бесплатной консультации, получения помощи в выборе подходящего варианта. Содействие риелторов обеспечат:&amp;lt;/p&amp;gt;\r\n&amp;lt;ul&amp;gt;\r\n	&amp;lt;li&amp;gt;\r\n		нахождение нужного объекта;&amp;lt;/li&amp;gt;\r\n	&amp;lt;li&amp;gt;\r\n		юридическую чистоту и безопасность сделки&amp;lt;/li&amp;gt;\r\n	&amp;lt;li&amp;gt;\r\n		быстрый сбор и подготовку документов&amp;lt;/li&amp;gt;\r\n&amp;lt;/ul&amp;gt;\r\n&amp;lt;p&amp;gt;\r\n	Мы знаем преимущества и недостатки каждого объекта недвижимости, рейтинг застройщиков, перспективы развития районов. Позвоните, или свяжитесь с нами на сайте, чтобы получить более подробную информацию по интересующим вопросам. Профессиональный менеджер авторитетного агентства недвижимости представит объективные сведения, оформит заявку на выполнение выбранной услуги.&amp;lt;/p&amp;gt;\r\n',	0),
